INSERT INTO `MASTER` VALUES (1, 'bbba', NULL, '[v. 使谦卑,降低...的地位,贬低]', 'The president is not willing to abase himself before the nation.', '总统不愿在全国人民面前降低自己的威信。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/fc/35/FC3539D29E489E94EC113C76CBB3172E.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abase--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2, 'abash', NULL, '[vt. 使羞愧,使困窘]', 'His boss\'s criticism left him feeling rather abashed.', '老板批评了他,他感到有些难为情。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/30/4f/304F63808CADCE090EBDC45C889BC7BF.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abash--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3, 'abate', NULL, '[v. 缓和,减弱,消除]', 'Nothing could abate his rage.', '什么都不能平息他的愤怒。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/90/b3/90B3B8A4BA90D39735BD3BC58D38E78F.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4, 'abatement', NULL, '[n. 减少,减轻,缓和,减税额]', 'Third, the costs of abatement are large.', '第三,减少排放的代价是巨大的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7c/51/7C519749DD2E71ED953FCD82D71699C1.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abatement--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5, 'abbreviate', NULL, '[vt. 缩写,缩短,使简略]', 'In writing, the title `Doctor\' is abbreviated to `Dr\'.', '在书写时,Doctor头衔的缩写是Dr。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4d/2c/4D2CFAD424397974543E1CB3991A1661.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abbreviate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (6, 'abdicate', NULL, '[vt. 正式放弃,让位][vi. 退位,辞职]', 'He was forced to abdicate his claim on the property.', '他被迫放弃要求财产的权利。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/aa/01/AA010138FCD5D386A45307205BE08E77.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abdicate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (7, 'aberrant', NULL, '[adj. 异常的,脱离常轨的,畸变的]', 'Ian\'s rages and aberrant behaviour worsened.', '伊恩的怒气及反常的行为越发严重了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/24/97/24973E3DECB40D730E33981A22794028.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/aberrant--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (8, 'aberration', NULL, '[n. 偏差,失常,(一时的)精神失控]', 'These events were aberrations from the norm.', '这些事件不合常规。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b6/3c/B63C9355982312EF5C144F17BEFCB2D6.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/aberration--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (9, 'abet', NULL, '[v. 煽动,教唆,怂恿]', 'It\'s illegal to aid and abet a thief.', '伙同小偷作案是有罪的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ff/3c/FF3CF25481BE36DB7AB71852E96E9937.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abet--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (10, 'abeyance', NULL, '[n. 暂时中止,(问题等)缓议,搁置]', 'The decision was held in abeyance during the war.', '在战争期间,这项决定暂时搁下了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/3d/67/3D676F69ABC1CEA4B2872482F953F2C4.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abeyance--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (11, 'abhor', NULL, '[vt. 憎恶,厌恶,痛恨]', 'They abhor all forms of racial discrimination.', '他们憎恶任何形式的种族歧视。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a8/a6/A8A698DAB823EFA4C3ED7CEC175557BD.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abhor--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (12, 'abhorrent', NULL, '[adj. 令人憎恶的]', 'Such an act is abhorrent to my feelings.', '这种行为是我所憎恶的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d9/fa/D9FA4676889F07D570505D194130965A.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abhorrent--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (13, 'abiding', NULL, '[adj. 持久的]', 'I\'m tired of your abiding complaints.', '我讨厌你没完没了的抱怨。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/05/cd/05CD4E9C8F30ECEA6E363F918FE36BCF.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abiding--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (15, 'abjure', NULL, '[vt. 郑重放弃,戒除]', 'The conqueror tried to make the natives abjure their religion. ', '征服者试著让当地人宣誓放弃他们的宗教。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/65/17/6517A226D5E3C38A5479AA59AFEE9494.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abjure--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (16, 'ablaze', NULL, '[adj. 着火的,闪耀的,激昂的]', 'The whole building was soon ablaze.', '整座建筑物很快就烧起来了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/6c/ea/6CEADBC561E90A5C175A2626028A55D5.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/ablaze--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (17, 'abnegate', NULL, '[vt. 放弃,舍弃,克制]', 'He abnegated the idea of freedom.', '他放弃了自由的观念。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/25/65/2565405D8EE0518C041E4280B72C67C5.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abnegate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (18, 'abnegation', NULL, '[n. 克己,否认,放弃]', 'They discussed the abnegation of God. ', '他们讨论否认上帝。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a6/57/A657933E77F8E5C8968C1E685BAEB2A9.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abnegation--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (19, 'abode', NULL, '[n. 住处,住所]', 'Welcome to my humble abode.', '欢迎光临寒舍。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/3c/d9/3CD96C6CF65DE5CF5793B2C69AB0CCFB.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abode--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (20, 'abolitionist', NULL, '[n. 废除主义者,废奴主义者]', 'Abolitionist is a reformer who favors abolishing slavery.', '废奴主义者是赞成废除奴隶制的改革者。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8b/4e/8B4E4543D656B8169EE4AAF82B1C7023.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abolitionist--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (21, 'abominate', NULL, '[vt. 痛恨,憎恶]', 'All the teachers abominate cheating in examinations.', '所有教师都憎恶考试作弊。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/04/31/0431808BA1E53B8BB339C434E8F5544F.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abominate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (22, 'abortive', NULL, '[adj. 失败的,流产的,发育不全的]', 'We had to abandon our abortive attempts.', '我们的尝试没有成功,不得不放弃。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/cd/12/CD1240796515C4B9603E37B9E93896AA.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abortive--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (24, 'abrade', NULL, '[v. 擦伤,磨损]', 'The cook is trying to abrade carrote into threads.', '厨师正在把胡萝卜磨成细丝。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/90/d4/90D4581F0F9477F340AA0878D8FD7029.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abrade--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (25, 'abrasion', NULL, '[n. 擦伤,磨损,磨损处]', 'She was treated for cuts and abrasions.', '她的割伤和擦伤得到了治疗。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8a/b7/8AB7E18F625AD1C6ADB6EA55BE38579B.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abrasion--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (26, 'abrasive', NULL, '[n. 磨料][adj. 磨损的,生硬粗暴的]', 'An abrasive material is unsuitable for cleaning baths.', '有磨蚀作用的材料不适合擦浴缸。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a2/35/A235BE9FE47CF591D5E2B0AE0D8A2DAF.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abrasive--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (27, 'abridge', NULL, '[v. 删节,缩短,限制]', '\"This is an abridged edition of \"\"war and peace\"\".\"', '这是“战争与和平”的节略版。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/eb/33/EB333BDB3DA67BA6CC7B9D4B52709137.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abridge--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (28, 'abrogate', NULL, '[v. 废除,取消]', 'The government cannot just abrogate contracts.', '政府不能单纯的撤销合同。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/40/41/4041021CEC8D7196A07B8474650C2495.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abrogate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (29, 'abscond', NULL, '[v. 潜逃,逃匿]', 'He absconded from the country.', '他已潜逃出境。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a7/05/A705579C004C694A46E085E08E6528BF.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abscond--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (30, 'absentee', NULL, '[n. 缺席者,缺勤者]', 'The absentee cooked up some excuse about being ill.', '那位缺席者编造了一个有病的借口。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ad/f9/ADF9BED5A885E056A98E732E1300F7C8.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/absentee--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (31, 'absenteeism', NULL, '[n. (无故)旷课,(无故)旷工]', 'He\'s concerned about your absenteeism.', '他很关注你旷课的问题。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/78/49/7849730753632B2164B9D5FCCB27E75C.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/absenteeism--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (32, 'absolve', NULL, '[vt. 宣告...无罪,赦免]', 'The police absolved the suspect.', '警方释放了嫌疑犯。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/68/7c/687C8623CBC93835BCED4F1A4CDE5C3F.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/absolve--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (33, 'abstain', NULL, '[v. 戒绝,弃权,节制]', 'He swore to abstain from smoking.', '他发誓要戒烟。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/5f/22/5F22C9EC8F171056E38E9B040DE39DDC.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abstain--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (34, 'abstemious', NULL, '[adj. 有节制的,节省的]', 'He is abstemious in life. ', '他过简朴的生活。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/aa/fc/AAFC55B62009137E8CE5EB607523719B.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abstemious--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (35, 'abstention', NULL, '[n. 节制,戒绝,(投票)弃权]', 'There were high levels of abstention in the election.', '那次选举中有许多人弃权。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/52/9c/529CE298C55745E3E307FB8D2B04E243.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abstention--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (36, 'abstinent', NULL, '[adj. 有节制的,禁欲的][n. 禁欲者]', 'During treatment, sexual activity should be abstinent. ', '治疗期间, 宜节制房事。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/1f/88/1F880282FA665736447471FAC6AA4954.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abstinent--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (37, 'abstraction', NULL, '[n. 抽象,抽象概念,心不在焉]', 'The idea of redness is an abstraction.', '红色概念是一种抽象概念。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4d/65/4D656A8EE50EB1F1F68ACC25427E65AB.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abstraction--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (38, 'abstruse', NULL, '[adj. 深奥的]', 'Philosophical semantics is too abstruse to understand.', '哲学语义学深奥难懂。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2b/39/2B39788E1D7109C2FBBB3BD0D281E728.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abstruse--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (39, 'abundantly', NULL, '[adv. 大量地,丰富地]', 'Sulfur is found abundantly in volcanic regions.', '硫在火山地区大量存在。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/aa/f9/AAF97C6DB8912DF894DD3E769CF402E5.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abundantly--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (40, 'abut', NULL, '[v. 邻接,毗连]', 'His land abuts on mine.', '他的土地和我的土地相毗连。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/3f/d9/3FD959F6228DD32A4A4B85613024499F.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abut--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (41, 'abysmal', NULL, '[adj. 深不可测的,极坏的,完全的]', 'Woeful souls are wailing in an abysmal pond.', '悲伤的灵魂在无底的深潭里嚎啕。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/55/00/55004C2E9ABBEBF5921F5046AA73FC75.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/abysmal--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (42, 'acarpous', NULL, '[adj. (植物)不结果的]', 'He cut down those acarpous plant.', '他砍掉那些不结果实的植物。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d7/90/D7904DB2671D85D1F35EA88A6E7CD650.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/acarpous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (43, 'accede', NULL, '[v. 同意,继承,即位,加入]', 'We acceded to his request.', '我们同意他的请求。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9f/fb/9FFBE18111624270442ED4DAC7D6B9E0.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/accede--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (44, 'accelerated', NULL, '[adj. 加速的]', 'He also hurt his rotator cuff in his accelerated recovery effort.', '在他加速恢复的过程中,他的旋转腕骨也受了伤。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/25/9a/259AA10700929C8BC5DBEB5E742D5A8B.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/accelerated--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (45, 'accelerating', NULL, '[adj. 加速的,促进的,催化的]', 'Evelyn\'s career is accelerating, and mine is plateauing out a bit.', '伊夫琳的职业生涯蒸蒸日上,而我的则停滞不前。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/25/9a/259AA10700929C8BC5DBEB5E742D5A8B.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/accelerating--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (46, 'accentuate', NULL, '[v. 重读,强调,突出]', 'Accentuate the word “accent”on the first syllable.', '在“accent”一词的第一个音节上加重音符号。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/06/51/0651237AB3D96EC42D2E245AA2BD0C33.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/accentuate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (47, 'accessibility', NULL, '[n. 可以得到,易接近]', 'You can apply these accessibility settings to another computer. ', '您可将这些辅助功能设置应用到另一计算机上。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/32/f5/32F5EBBAC1656321324EBCE76A31DF10.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/accessibility--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (48, 'accidentally', NULL, '[adv. 偶然地,意外地,附带地]', 'The traffic accident was born almost accidentally.', '这个交通事故的发生几乎纯属偶然。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/5c/b3/5CB31271D61444765B1FDCFE130A9C2B.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/accidentally--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (49, 'acclaimed', NULL, '[adj. 受赞誉的,受人欢迎的]', 'She finally broke into films after an acclaimed stage career.', '她在取得舞台生涯的成功后,最终进入电影界发展。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/bc/8b/BC8B0EF4D7E30490DEDB8E485BAD4E20.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/acclaimed--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (50, 'acclimate', NULL, '[v. 使习惯于新环境]', 'I help them acclimate to living in the U.S.', '我帮助他们适应在美国的生活。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/82/6b/826B2488D55DF122CBF79DD12498E755.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/acclimate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (51, 'acclimatise', NULL, '[v. 使适应(新环境),使服水土]', 'This year he has left for St Louis early to acclimatise himself.', '今年他早早地前往圣路易斯以便适应新环境。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/45/fa/45FA7EFCB48381EAA15A718296FB46DA.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/acclimatise--_gb_1.mp3');
