INSERT INTO `MASTER` VALUES (152, 'allusive', NULL, '[adj. 暗示的,引用典故的]', 'Her allusive style is difficult to follow.', '她引经据典的风格晦涩难懂。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/18/98/189806A45EB4F69B0546A1266436859B.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/allusive--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (153, 'alluvial', NULL, '[adj. 冲积的,淤积的][n. 冲积土,淤积土]', 'Some alluvial deposits are a rich source of diamonds.', '一些冲积物是钻石的丰富来源。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/99/2b/992B78FE68E33544DF3B435CC9B5525D.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/alluvial--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (154, 'almond', NULL, '[n. 杏仁,扁桃,巴旦木,巴旦杏]', 'He brought me a bag of almond paste.', '他给我带来一袋杏仁软糖。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/5c/46/5C46444DED8C0436439A2586D2F4B51B.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/almond--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (155, 'aloof', NULL, '[adj. 疏远的,冷淡的][adv. 远离地]', 'She had always kept herself aloof from the boys in class.', '她一直和班上的男同学保持疏远的关系。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0c/bb/0CBB34E5819F278369C622C4E990C3C6.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/aloof--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (156, 'also-ran', NULL, '[n. 落选者,落选马,失败者]', 'I\'m afraid John is one of life\'s also-rans.', '很遗憾,约翰是人间的庸才。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7b/a9/7BA9651C0F3D008019EBD979CDF1BAE5.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/also-ran--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (157, 'alternately', NULL, '[adv. 交替地,轮流地,间隔地]', 'I own two flats where I used to dwell alternately.', '我拥有两个居所并一直交替地居住。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/30/aa/30AAEB7B689300656F910FD40AC91AD6.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/alternately--_gb_1.mp3');
