INSERT INTO `MASTER` VALUES (160, 'amalgam', NULL, '[n. 汞合金,混合物]', 'The dentist used amalgam to fill my teeth.', '牙医用汞合金给我补牙。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/56/3b/563BA84D2E58630916DD82994EAEA0E8.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/amalgam--_gb_1.mp3');
