INSERT INTO `MASTER` VALUES (162, 'ambidextrous', NULL, '[adj. 双手都灵巧的,熟练的]', 'A switch - hitter in baseball should be naturally ambidextrous. ', '棒球中的击球手应该是天生的双手灵巧的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c7/9e/C79EA74D3B9E9E5D45C726C8AF9645DE.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/ambidextrous--_gb_1.mp3');
