INSERT INTO `MASTER` VALUES (168, 'ameliorate', NULL, '[vt. 使改善,使变好][vi. 改善,变好]', 'Everyone wishes to ameliorate his own condition .', '改善自己境况的愿望人皆有之。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b5/91/B591D4ED816C151E8F9E2EA94EC8FC09.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/ameliorate--_gb_1.mp3');
