INSERT INTO `MASTER` VALUES (171, 'amiability', NULL, '[n. 和蔼可亲,友善,亲切]', 'I found his amiability charming.', '我觉得他和蔼可亲,富有魅力。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ab/8f/AB8FB6DAB030B1D618567EAA4E044E91.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/amiability--_gb_1.mp3');
