INSERT INTO `MASTER` VALUES (393, 'bane', NULL, '[n. 祸害,祸根]', 'We must beware of the bane that the Tao of sage caused.', '我们对圣人之道所带给我们的祸害,一定要小心谨慎以对。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/36/25/362523D336608A5227D27D9C03AD51FA.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/bane--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (394, 'banish', NULL, '[vt. 驱逐,流放,消除]', 'His lies caused his wife to banish him from the house.', '他因说谎而被老婆驱逐出家门。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b2/92/B292B4BACEFACDE65D6DD2430471727F.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/banish--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (395, 'banter', NULL, '[n. 轻松说笑][v. 戏弄,开玩笑]', 'He senses the truth beneath her banter.', '他辨出这玩笑话里有真意在。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/00/72/00728B464132C31B7FB33F4957AB1E4F.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/banter--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (396, 'barb', NULL, '[n. 倒钩,刻薄的言语]', 'Surgeons removed a foot-long barb from his heart.', '外科医生正从他的心脏移出一英尺长的倒钩。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/78/ed/78ED81AA985012789B56C929ED5F0C2D.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/barb--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (397, 'barbaric', NULL, '[adj. 极其粗野的,残忍的,残暴的]', 'I simply can\'t bear your barbaric behavior.', '你粗野的行为我简直忍受不了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/55/f5/55F5D87D5754D263713DDB357D3C0EC3.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/barbaric--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (398, 'barbarous', NULL, '[adj. 野蛮的,粗俗的]', 'It is a barbarous way to extend territory by arms.', '以武力扩张领土是一种野蛮的方式。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b6/7b/B67BEE2CA3FB73503FBB0029022ACF1B.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/barbarous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (399, 'barefaced', NULL, '[adj. 公然的,无耻的,无胡须的]', 'More and more people will try to tell barefaced lies.', '告诉朋友厚颜无耻的谎言,将会造成不良的关系。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b7/6b/B76B9F62558643BCFAC836CEEB69A9E1.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/barefaced--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (400, 'baron', NULL, '[n. 男爵,巨头(尤指商界)]', 'The Baron was in high good humour.', '男爵情绪很好。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/70/f1/70F1F27846372222B2412209D6F0C535.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/baron--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (401, 'baroque', NULL, '[adj. 巴洛克风格的,奇形怪状的]', 'The baroque church of San Leonardo is worth a quick look.', '圣莱昂纳多的巴洛克式教堂值得一看。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a5/09/A5096F95B1F5153BFD7C89F9EFAEF3ED.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/baroque--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (402, 'barrage', NULL, '[n. 弹幕,掩护炮火,拦河坝]', 'The council is standing firm against the barrage of protest.', '委员会面对接二连三的抗议拒不让步。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/37/59/37596D9C04EAD478F1295E9F99FEF7B2.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/barrage--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (403, 'barrenness', NULL, '[n. 不孕,不育]', 'Barrenness was, therefore, considered as the greatest misfortune.', '不孕,因此被视为最大的不幸。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/62/36/62364CB834FB5C307F643D97D47F5547.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/barrenness--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (404, 'barrister', NULL, '[n. 出庭律师]', 'The barrister entirely renounce his right to object to a juror.', '这位律师完全放弃了反对陪审团成员的权力。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c6/04/C6043F10DB896E32E38BE958B195090D.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/barrister--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (405, 'barter', NULL, '[v. 物物交换][n. 实物交易]', 'They used to barter for horses with salt.', '他们过去以食盐交换马匹。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/71/67/7167D1E178528CF3F2A5921FD0EC3A7F.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/barter--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (406, 'bashfulness', NULL, '[n. 羞怯]', 'Bashfulness is an enemy to poverty.', '羞怯是脱贫之敌。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/42/4b/424BD866E91C7E9C68C2174570E7D467.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/bashfulness--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (407, 'bask', NULL, '[vi. 取暖,舒适地晒太阳,沐浴于]', 'I saw her basking in the sunshine.', '我看到她在阳光下晒太阳。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/43/05/43055ADC50A198F8A39DE67BC0524C74.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/bask--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (408, 'bastion', NULL, '[n. 要塞,堡垒]', 'These clubs are the last bastions of male privilege.', '这些俱乐部是男性特权的最后棱堡。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/21/fe/21FE3B87AAA65D43CBAD6B1D77F24EF1.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/bastion--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (409, 'bawl', NULL, '[v. 大叫,大哭][n. 叫骂声,放声痛哭]', 'He bawls at me across the street.', '他在街道的另一边冲我大声喊。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/95/a7/95A7E6E1C7B99D949A89E1B61C4195D4.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/bawl--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (410, 'bazaar', NULL, '[n. 市集,商场]', 'I am going to go shopping in the bazaar in the morning.', '我上半天打算去商场购物。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/11/c8/11C8D756B09CAE41E9A644BC6C359826.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/bazaar--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (411, 'beacon', NULL, '[n. 烽火,灯塔,基地]', 'The beacon fire shines on the capital.', '烽火照西京。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a5/85/A585764F2598E803D0A9960D1ECD0CFD.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/beacon--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (412, 'beaded', NULL, '[adj. 串珠状的,粒状的,带珠的]', 'His face was beaded with sweat.', '他脸上挂着汗珠子。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8c/ec/8CEC7E5F1A6A09BB0AC634FF0EFECB71.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/beaded--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (413, 'beatific', NULL, '[adj. 祝福的,快乐的,慈祥的]', 'In beatific sound of close friends,I became his happy bride.', '在亲朋好友的祝福声中,我做了他的幸福的新娘。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/82/b1/82B121046EEC1B5D4A99AE88832D324C.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/beatific--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (414, 'bedraggled', NULL, '[adj. 全身泥污的,破旧的,荒废的]', 'Do you want to see your own sister in such a bedraggled condition?', '你愿意看见你的亲妹妹弄得这么一身泥,一身水的吗？', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/cb/83/CB83A0E982589E0DB0EDA812C436AA88.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/bedraggled--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (415, 'bedrock', NULL, '[n. 岩床,根底,基础,基本原则]', 'Whatever he heard, he always came down to bedrock.', '不管他听到什么,他总爱刨根问底。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/02/59/02592DA88053B149F10A0AE71A611896.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/bedrock--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (416, 'beehive', NULL, '[n. 蜂箱]', 'We\'re just about to kick a beehive.', '我们就要捅马蜂窝了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/fe/1f/FE1FBAB66E05B606C99C1570043478B9.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/beehive--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (417, 'befoul', NULL, '[vt. 弄脏,玷辱]', 'Pollutants that befoul the air and water.', '污染空气和水的污染物。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/31/63/3163031032AA750F0B14FF60E0D9A514.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/befoul--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (418, 'befriend', NULL, '[v. 待...如友,帮助]', 'If you want to befriend a Libra, try to be kind and fair.', '如果你想和天秤座的朋友交朋友,试着和善和公正。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/5a/18/5A18E8581EEDBDE36DB2E363D4A8049F.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/befriend--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (419, 'befuddle', NULL, '[vt. 使昏迷,使迷惑,使烂醉]', 'The new arrival was befuddled by the rapid-fire conversation.', '新到达者被连珠炮似的谈话弄糊涂了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/53/45/53454999906E3C490D5A5CB14F0BBE33.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/befuddle--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (420, 'beget', NULL, '[v. 产生,引起,生(子女)]', 'Great love will beget great faith.', '大的爱就产生大的信心。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4c/68/4C68E8E7F31AD2AAB1BF53105A1B33E1.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/beget--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (421, 'begrimed', NULL, '[adj. 污秽的,弄脏的]', 'His hands were begrimed with oil and dirt. ', '他的手被油和污物弄脏。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/81/ef/81EFF96428C658C474F138F04CB05F41.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/begrimed--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (422, 'begrudge', NULL, '[v. 嫉妒,羡慕,吝啬]', 'Nobody begrudges you your success.', '没有人忌妒你的成功。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/41/d7/41D7E3184D8EB003CB6C649B7BB27541.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/begrudge--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (423, 'behold', NULL, '[vt. 看到,注视,领悟]', 'They beheld the great wall.', '他们看到了雄伟的长城。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2c/d5/2CD5ECE8C3B837BD15B523CA1CCEE3FF.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/behold--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (424, 'beholden', NULL, '[adj. 蒙恩的,有义务的]', 'We were much beholden to him for his kindness.', '我们对他的好意感激万分。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/dd/ce/DDCE0CD105E3F09E805CFF4C7974B027.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/beholden--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (425, 'behoove', NULL, '[v. 理应,有必要]', 'Giving too much, people will think that behoove.', '给予太多,别人就会认为理所当然。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7f/c5/7FC59B4790357738C920C22244932F85.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/behoove--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (426, 'belabor', NULL, '[vt. 痛击,痛斥,冗长地解释]', 'He seems to be looking for a man of straw to belabor.', '他看来在找一个假想的敌人来加以痛打。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/48/62/486270E4CC97EC2A4F3B325460B49F5C.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/belabor--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (427, 'beleaguer', NULL, '[vt. 围攻,使烦恼]', 'Civilian beleaguered in the city has been airlifted to safety.', '被围困在城里的老百姓已空运到安全地区。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c7/03/C7039CDB7CCDB94963E536E3076CA740.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/beleaguer--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (428, 'belie', NULL, '[v. 掩饰,与...不符,使...失望]', 'His cheerful manner belied his real feelings.', '他那快活的样子掩饰了他真实的感情。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/20/47/204789B95229499DC1080B439079C1D4.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/belie--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (429, 'believable', NULL, '[adj. 可相信的]', 'But I am very much believable, however, you\'ll get him to come.', '我相信你不管怎样都能把他请来。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a7/82/A782E94E5D0D0D88ECBE17B09C55B5E0.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/believable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (430, 'belittle', NULL, '[vt. 轻视,贬低,使相形见小]', 'He will no longer belittle me or interfere with my research.', '他不再将轻视我或干涉我的研究。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c7/ce/C7CEF17C92F9B9097A8DE2DF231B2010.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/belittle--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (431, 'bellicose', NULL, '[adj. 好战的,好斗的]', 'His bellicose disposition alienated his friend.', '他生性好斗,他的朋友们都疏远了他。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f9/2a/F92A5F3AE1D6D39DCD73BBEB88249B16.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/bellicose--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (432, 'belligerence', NULL, '[n. 交战,好战性,斗争性]', 'What poses a threat here is not belligerence but inertia.', '这里的威胁不是好战,而是惰性。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/3e/91/3E91CCF29A4096806CC4FA7CEA40393A.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/belligerence--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (433, 'belligerent', NULL, '[adj. 好战的,交战的]', 'Tom always said some very belligerent things.', '汤姆他老是说些十分挑衅性的话。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/20/b2/20B2A3E16535A152682E59DBF0D34BB6.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/belligerent--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (434, 'bellow', NULL, '[vi. 吼叫][vt. 大声喝道]', 'I was distraught and let out a bellow of tearful rage.', '我心烦意乱,流着眼泪发了一通火。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/6b/9b/6B9B2051ECC3A1C787478AAE54FD5FE1.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/bellow--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (435, 'bellows', NULL, '[n. 风箱]', 'His job is to blow the bellows for the blacksmith.', '他的工作是给铁匠拉风箱。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0e/48/0E4876B60599F7BE9CA6A74F0DC49B08.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/bellows--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (436, 'bemuse', NULL, '[vt. 使困惑,使发呆,使茫然]', 'She was bemused by all the questions.', '她被所有这些问题难住了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4b/45/4B45C8241964BA8F64CF7448BA46C004.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/bemuse--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (437, 'bemused', NULL, '[adj. 困惑的,发呆的]', 'He was looking at them with a bemused expression.', '他困惑地瞪着他们。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e1/d0/E1D09EEA3659B0ED040F45D142E31B24.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/bemused--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (438, 'benefactor', NULL, '[n. 恩人,捐助者,赠送者]', 'He did, however, discover his anonymous benefactor.', '不过,他终于找到了那个匿名的恩人。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/66/a5/66A5D76CD2FD1B65FEE1503249D2AC0F.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/benefactor--_gb_1.mp3');
