INSERT INTO `MASTER` VALUES (879, 'confidently', NULL, '[adv. 有信心地,自信地]', 'This seemed to reassure him and he continued more confidently.', '这似乎使他放心一点,于是他更有信心地继续说了下去。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/dc/b7/DCB794F3BEFBF30CB2B5517A98505E7F.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/confidently--_gb_1.mp3');
