INSERT INTO `MASTER` VALUES (891, 'congestion', NULL, '[n. 阻塞,拥挤,充血]', 'Congestion frequently reduces traffic to walking pace.', '交通阻塞经常把车流的速度降低得如步行一般缓慢。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/5f/40/5F403C21C0727E24C1E46FD4D36C390A.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/congestion--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (892, 'conglomerate', NULL, '[n. 联合企业][vt. 使聚集,结合]', 'An American conglomerate holds a major share in the company.', '一家美国的大联合企业持有该公司的大部分股份。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8c/57/8C576CD8E22A478EE394A8D5093C456E.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/conglomerate--_gb_1.mp3');
