INSERT INTO `MASTER` VALUES (1075, 'dainty', NULL, '[adj. 娇美的,精致的,优雅的]', 'She collected some dainty porcelain.', '她收集一些轻巧精致的瓷器。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/af/f8/AFF8F3933C4D547005900DCCA6139D87.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dainty--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1076, 'daisy', NULL, '[n. 雏菊,菊科植物,极好的东西]', 'I prefer the daisy and the knapweed in particular.', '我特别喜欢雏菊和矢车菊。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/1a/a5/1AA5F3584451F145088FF627E888CD22.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/daisy--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1077, 'dalliance', NULL, '[n. 戏弄,闲混]', 'It turned out to be his last dalliance with the education system.', '这一次竟成了他对教育体制最后的嘲弄。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/eb/36/EB36936662325A80AE80085A83E56874.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dalliance--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1078, 'dally', NULL, '[v. 拖延,拖拉,挑逗]', 'Come on and don\'t dally.', '好了,别浪费时间了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/89/7c/897C0A741DD5ABFD7BF8EC8CBDB6F450.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dally--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1079, 'damped', NULL, '[adj. 阻尼的,衰减的]', 'My wish of going abroad to study English damped down. ', '我想出国学英语的愿望渐渐地淡漠了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/62/28/62282975CFDC39BC8DC5D9172A4E6375.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/damped--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1080, 'dangle', NULL, '[v. 悬垂,悬挂]', 'The leaves dangled in the wind.', '树叶随风摇摆。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f3/1f/F31FDF5787FD45DD08BC71CCF7B51EDA.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dangle--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1081, 'dank', NULL, '[adj. 阴湿的,阴冷的]', 'The dark, dank cave gave me the willies.', '这阴暗潮湿的山洞使我感到心惊肉跳。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0d/53/0D538193B8F5E189EB3A92F00A198CB2.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dank--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1082, 'dapper', NULL, '[adj. (男子)衣冠楚楚的,短小精悍的]', 'You will look very dapper in a silk leisure suit.', '真丝休闲西服,令您风姿翩翩。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b3/be/B3BED8D1BE65D7FE19DAD7AC361A7A83.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dapper--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1083, 'dappled', NULL, '[adj. 斑纹的,花的]', 'The dappled horse now began to go ahead.', '花马开始领先了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ee/30/EE30D3BC5E5746B847D18BA89783C834.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dappled--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1084, 'daredevil', NULL, '[n. 鲁莽大胆的人,蛮干的人,冒失鬼 ]', 'Don\'t try any of those daredevil stunts.', '不要耍那些天不怕地不怕的绝招。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b6/b9/B6B9D7DDCD14D1316C1634C14A6A84E4.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/daredevil--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1085, 'darkroom', NULL, '[n. 暗房]', 'I have a complete darkroom in my house.', '我屋子里有整套暗房设备。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7e/84/7E84140FB06A2907BFC2F029199D98CB.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/darkroom--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1086, 'dated', NULL, '[adj. 过时的,陈旧的]', 'Many dated expressions are being dropped from the new dictionary.', '这本新词典中删去了很多过时的词语。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ea/4e/EA4E371A92E9C476C5DCE22CA216F6F3.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dated--_gb_1.mp3');
