INSERT INTO `MASTER` VALUES (1088, 'daunting', NULL, '[adj. 令人畏惧的]', 'The prospect of meeting the President is quite daunting.', '一想到要会见总统就足以令人心悸。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/3b/12/3B122AB86B263522DDADDB5D039341B1.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/daunting--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1089, 'dawdle', NULL, '[v. 磨蹭,浪费时间,闲逛]', 'Look sharp! Do not dawdle about like that.', '快点！别这么磨磨蹭蹭了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/33/12/331244181EC14E71AD61411F377C4764.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dawdle--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1090, 'daze', NULL, '[vt. 使...茫然,使...眩目][n. 恍惚,晕眩]', 'We drove home in an absolute daze.', '我们茫然一片地驱车回家。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ca/65/CA653638BB8686888E033605C6967DE0.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/daze--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1091, 'dazzling', NULL, '[adj. 令人眼花缭乱的,耀眼的]', 'It lends vibrancy, dazzling color, and deep savoriness to foods.', '它带来有活力感,令人眼花缭乱的颜色,和浓郁口味的食物。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7a/69/7A691BCDCFC2E21BEB5B08BC5AAF5E62.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dazzling--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1092, 'deaden', NULL, '[vt. 抑制(感情),缓和(疼痛),减弱(声音)]', 'Her feet were deaden with cold.', '她的脚都冻得麻木了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8f/4a/8F4A7A8FC3637B35F520DE6C2A87ABB1.mp3', 1, 6, 0, 1, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/deaden--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1093, 'dearth', NULL, '[n. 缺乏,粮食不足]', 'There was a dearth of reliable information on the subject.', '关于这个课题还缺乏可靠资料。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ff/9b/FF9BC76040D61438F3746EC70871282D.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dearth--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1094, 'debar', NULL, '[v. 排除在外,阻止(行使权力等)]', 'So far, we can\'t debar the seismal possibility.', '到目前为止', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/bb/fe/BBFE1812E64033767B2C65859977A485.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/debar--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1095, 'debark', NULL, '[vt. 卸载][v. (使)下船,(使)登陆]', 'The passengers debarked in Miami.', '乘客们在迈阿密登陆。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/45/75/4575BE2E7562D494436D91DCA18C1355.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/debark--_gb_1.mp3');
