INSERT INTO `MASTER` VALUES (1099, 'debilitate', NULL, '[vt. 使...衰弱]', 'Their efforts to debilitate the political will of the Western alliance.', '他们削弱西方联盟政治意志的努力。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/63/a5/63A5CC963BB572547C97A1717B4FFE18.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/debilitate--_gb_1.mp3');
