INSERT INTO `MASTER` VALUES (1101, 'debonair', NULL, '[adj. 温文尔雅的,潇洒的 ]', 'You\'re also charming, debonair and always right.', '你还是非常迷人、温文尔雅的,而且总是对的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b6/2b/B62BF9A7E2A37565891D43EA767F60C5.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/debonair--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1102, 'debrief', NULL, '[v. 向…询问情况,汇报情况]', 'When they debrief you, that’s the story you’ll tell.', '当他们向你询问情况时,那就是你要讲述的故事。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4f/ae/4FAEF70469486CE70F9301455F43FC81.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/debrief--_gb_1.mp3');
