INSERT INTO `MASTER` VALUES (1104, 'decadence', NULL, '[n. 衰落,颓废]', 'The decadence of morals is bad for nation.', '道德的堕落对于国家是不利的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/5f/5b/5F5BC872E40AB921D632BC9DDCC52C98.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/decadence--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1105, 'decadent', NULL, '[adj. 堕落的,颓废的]', 'The decadent puppet regime was falling apart.', '那个堕落的傀儡政权正在土崩瓦解。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b0/81/B081100FA1108D1599FC74C4463238C1.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/decadent--_gb_1.mp3');
