INSERT INTO `MASTER` VALUES (1108, 'decapitate', NULL, '[v. 斩首,杀头]', 'They used these weapons to decapitate the barbarian.', '他们使用这些武器将野蛮人斩首。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/21/61/21612AF25EDB76E2219988E18D4B6AD4.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/decapitate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1109, 'decelerate', NULL, '[v. (使)减速]', 'The government has made every effort to decelerate inflation.', '政府作了种种努力降低通货膨胀率。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2b/29/2B293C3133DCB55A72EA3D529112E0EB.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/decelerate--_gb_1.mp3');
