INSERT INTO `MASTER` VALUES (1113, 'deciduous', NULL, '[adj. 每年落叶的,非永久性的]', 'Very few plants in my garden are deciduous.', '我公园里的落叶植物很少。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e7/cc/E7CC6B149CC94ED909CAE77DA5C27134.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/deciduous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1114, 'decimate', NULL, '[v. 大量毁灭,使骤减]', 'Student numbers have been decimated by cuts in grants.', '助学金削减後,学生人数大大减少。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/64/a3/64A3A311DBC4AAD94769C6B58F1CF4D7.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/decimate--_gb_1.mp3');
