INSERT INTO `MASTER` VALUES (1117, 'declaim', NULL, '[v. 高谈阔论,雄辩,大声说]', 'A preacher stood declaiming in the town centre.', '传教士站在市镇中心慷慨陈词。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b8/1c/B81C27DFE1D610E89CECB196DE7F6D14.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/declaim--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1118, 'decompose', NULL, '[v. 分解,拆分,拆解,腐烂]', 'A prism decomposes light.', '棱镜可以分解光线。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f7/8a/F78ADADAA620EBB07C3C7664AA2E17D4.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/decompose--_gb_1.mp3');
