INSERT INTO `MASTER` VALUES (1121, 'decorous', NULL, '[adj. 合宜的,高雅的,端庄的]', 'He gave his wife a decorous kiss.', '他给了他太太得体的一吻。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f1/fc/F1FCB1100E3778CC730696A07286050B.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/decorous--_gb_1.mp3');
