INSERT INTO `MASTER` VALUES (1185, 'deodorizer', NULL, '[n. 除臭剂]', 'This kind of  deodorizer can keep the fridge free of bad smells.', '此种除臭剂可防止冰箱出现臭味。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/37/95/37958F982B708A6EFCB0F54E45063E4A.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/deodorizer--_gb_1.mp3');
