INSERT INTO `MASTER` VALUES (1191, 'deprecate', NULL, '[v. 声明不赞成,抨击,反对]', 'The peace-loving people deprecate war.', '爱好和平的人民反对战争。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/89/c7/89C7CCC70266C984B06DD81805B4EED2.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/deprecate--_gb_1.mp3');
