INSERT INTO `MASTER` VALUES (1193, 'deprecatory', NULL, '[adj. 不赞成的,自嘲的]', 'She had made some deprecatory remarks about her opponent.', '她对她的对手提出了一些贬抑性的评论。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/cd/8f/CD8FA7B971321C2009AFAA3675C8F858.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/deprecatory--_gb_1.mp3');
