INSERT INTO `MASTER` VALUES (1207, 'desiccate', NULL, '[v. (使)干,干贮]', 'The device was able to desiccate the salty wate.', '这个装置能够蒸干咸水。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e4/4d/E44D52E14D11A02D0A5DC9C88FCE45E7.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/desiccate--_gb_1.mp3');
