INSERT INTO `MASTER` VALUES (1211, 'despoil', NULL, '[v. 夺取,掠夺]', 'A region despoiled of its scenic beauty by unchecked development.', '由于不加限制的发展而使这个地区丧失了其美丽景色。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/22/83/2283E53984346182A2DBC2CA42A32D07.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/despoil--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1212, 'despondent', NULL, '[adj. 沮丧的,泄气的]', 'Each time I get despondent,my father will cheer me up.', '我每次失望时,父亲总给我打气。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/36/bf/36BF0838FB966439DF8C85357D3A677B.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/despondent--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1213, 'despotic', NULL, '[adj. 专横的,暴虐的]', 'Our headmaster is a despotic person.', '我们的校长是个专横的人。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d0/58/D058E87E30274F1BB92E90ED74AEB330.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/despotic--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1214, 'despotism', NULL, '[n. 独裁,专制,暴政,专制政府]', 'A large proportion of the best citizen hate his despotism.', '一大部分最好的公民都痛恨他的专制君主统治。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/77/1c/771C28C0D8BC8D599D9F95D591844441.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/despotism--_gb_1.mp3');
