INSERT INTO `MASTER` VALUES (1221, 'detectable', NULL, '', 'The inflection point at this PH is barely detectable.', '在此PH值下,拐点不易发现。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b1/f3/B1F3095BD118D6482E363838479D41A2.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/detectable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1222, 'determinant', NULL, '[n. 决定因素][adj. 决定性的]', 'Education is an important determinant of one\'s outlook on life.', '教育是一个人人生观的重要决定因素。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/48/53/485329265735B5431A179AFEE4C31402.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/determinant--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1223, 'detest', NULL, '[v. 厌恶,痛恨]', 'I detest all affectation.', '我厌恶一切矫揉造作的行为。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/bc/86/BC86E61B054F6FB0FC6AF72EAB57D2E0.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/detest--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1224, 'detonate', NULL, '[v. 使爆炸,使爆裂,爆炸]', 'An engineer tried to detonate the mine.', '一名工程师试图引爆地雷。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/31/b6/31B65FC072246C7B96423615FBDD24E0.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/detonate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1225, 'detonation', NULL, '[n. 爆炸,引爆,爆炸声]', 'Could there be an accidental detonation of a nuclear weapon?', '有没有可能会有核武的意外爆炸?', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/6b/e8/6BE8BABE49D9121E8F9AEC52E9CC77E5.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/detonation--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1226, 'detour', NULL, '[n. 绕路,便道][v. 绕路而行]', 'During the construction we had to take a detour.', '施工期间,我们不得不绕路而行。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/85/11/8511F3F6D026CF919D7C1600EF52554F.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/detour--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1227, 'detract', NULL, '[vi. 减损][vt. 转移]', 'His bad manners detract from his good character.', '他的不礼貌减损了他的品质。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/59/11/591164EEDEE1C1324869C0C03206B515.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/detract--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1228, 'detraction', NULL, '[n. 诽谤,减损]', 'Envy has no other quality But that of detraction from virtue. ', '嫉妒除了损坏美德外,别无可取之处。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0c/cd/0CCD9D4D6751E7D0CC032DEA044C9978.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/detraction--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1229, 'devalue', NULL, '[v. 贬值,降低价值]', 'Governments may in fact suffer from having the option to devalue.', '事实上,政府因选择货币贬值也会遭受损失。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9e/26/9E2697E8178881A24F5E92D4B39F6959.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/devalue--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1230, 'deviance', NULL, '[n. 异常,变异]', 'His mother noticed his deviance , however.', '但他母亲注意到了他的不正常。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f5/95/F5951E8E211B61C6653C677D8D8FE139.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/deviance--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1231, 'deviant', NULL, '[adj. 不正常的,离经叛道的]', 'The social reactions to deviant and criminal behaviour.', '社会对偏常及犯罪行为的反应。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/61/be/61BE3FB1EFE52008D3CFEC4A2356008D.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/deviant--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1232, 'devious', NULL, '[adj. 迂回的,弯曲的,狡猾的]', 'The coach followed a rather devious course to its destination.', '长途汽车要绕很多弯路才到达目的地。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d4/b0/D4B0579DE8D384825BCC9A1ABF6E5F2E.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/devious--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1233, 'devoid', NULL, '[adj. 全无的,缺乏的]', 'It is a situation, in sum, devoid of logic.', '总之,该情况毫无逻辑。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ac/11/AC115794C9A5A16861E5FF7EABF64876.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/devoid--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1234, 'devotee', NULL, '[n. 信徒,皈依者,热爱者,迷恋者]', 'He has been a golf devotee for 25 years.', '他成为一个高尔夫爱好者已经有25年了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/bf/ad/BFAD39A9625778757039154AB94CC746.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/devotee--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1235, 'devotional', NULL, '[adj. 信仰的,虔诚的,祷告的]', 'Devotional music had been arranged by Adhar and Ram.', '阿达哈和罗姆已经安排了虔诚的音乐。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/cd/d1/CDD1378BF18863E19340A8B108179C16.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/devotional--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1236, 'devout', NULL, '[adj. 虔诚的,虔敬的,衷心的]', 'The devout Christian persists in his belief.', '那个虔诚的基督教徒坚持他的信念。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4a/c8/4AC8E9CDABB0D9368DCD73F5359A0D3D.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/devout--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1237, 'dexterity', NULL, '[n. 灵巧,机敏,熟练,手艺]', 'The circus acrobats performed feats of dexterity and strength.', '马戏团的杂技艺人表演了显示灵巧和力度的高超技艺。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e8/98/E89886A8E44B245C194F9DE6F44B7ADE.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dexterity--_gb_1.mp3');
