INSERT INTO `MASTER` VALUES (1240, 'diagonal', NULL, '[adj. 对角线的][n. 对角线]', 'The square matrix is called a diagonal matrix.', ' 该方矩阵称为对角矩阵。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2f/d3/2FD3CB9E1956D364BCC9D51D68DB0FA3.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/diagonal--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1241, 'diagonally', NULL, '[adv. 斜对地,对角地]', 'Vaulting the stile, he headed diagonally across the paddock.', '翻身跃过栅栏后,他便朝斜穿围场的方向走去。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/22/02/2202BDE57289EA4372F2808E8F533A27.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/diagonally--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1242, 'diaphanous', NULL, '[adj. 透明的,模糊的]', 'She was wearing a dress of diaphanous silk.', '她穿着一件薄如蝉翼的绸服。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ba/81/BA81532415C546594CE0ADFCEBEA843C.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/diaphanous--_gb_1.mp3');
