INSERT INTO `MASTER` VALUES (1246, 'dicker', NULL, '[v. 讨价还价]', 'I do not work for anybody now and I do bit of dicker.', '我现在不为任何人工作,我自己做点小生意。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/92/03/92030CAC3875790D3D7B32AE82FE27DB.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dicker--_gb_1.mp3');
