INSERT INTO `MASTER` VALUES (1251, 'dieter', NULL, '[n. 节食者]', 'Mary is a dieter who have got slim using these methods.', '玛丽是一个用这些方法变得苗条的节食者。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/74/e1/74E1AD421F553604642F6AB481B82EB5.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dieter--_gb_1.mp3');
