INSERT INTO `MASTER` VALUES (1257, 'dilapidate', NULL, '[v. (使)荒废,(使)毁坏]', 'She was living in a dilapidated old apartment building.', '她住在破旧的公寓里。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/13/bf/13BF416B3E1A6F66BA62656BED6D96C9.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dilapidate--_gb_1.mp3');
