INSERT INTO `MASTER` VALUES (1262, 'diligently', NULL, '[adv. 勤奋地]', 'He studies more diligently than his friend.', '他比他的朋友更勤奋地学习。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a9/61/A961D8583FB498D88E12DC6B1805B522.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/diligently--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1263, 'dillydally', NULL, '[vi. 磨蹭]', 'If you dillydally about any longer, we shall miss our plane. ', '如果你再磨磨蹭蹭的话, 我们要误飞机了。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c9/ab/C9ABA0C57D88FE740EC1B7EB18FF5C39.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dillydally--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1264, 'diminution', NULL, '[n. 减少,缩小,减少量,缩小量]', 'The government tried to prevent the diminution of resources.', '政府试图阻止资源的减少。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f4/83/F48372C34C415A48E54D7C99BDC6C18F.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/diminution--_gb_1.mp3');
