INSERT INTO `MASTER` VALUES (1267, 'dingy', NULL, '[adj. 肮脏的,昏暗的]', 'He lives in a dingy room.', '他住在一个肮脏的屋子里。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ac/d5/ACD5B4E86C06233BF049E1C6D14F0685.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dingy--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1268, 'dint', NULL, '[n. 借助,凭借,由于]', 'He succeeded by dint of hard work.', '他通过辛勤努力才获得成功。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/57/5d/575D7D680133EC2E1F42590FE55BDB37.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dint--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1269, 'dire', NULL, '[adj. 可怕的,悲惨的,极其的]', 'You\'ll be in dire trouble if you don\'t watch out.', '你若不小心,就会有可怕的麻烦。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/85/d9/85D95C135E937C63866ABF2F10E3881B.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dire--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1270, 'disabuse', NULL, '[v. 去除…的错误想法,使省悟]', 'I must disabuse you of your feelings of grandeur. ', '我必须去消除你的傲气。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/5a/d1/5AD149A523457189005EB6D01E4BBD46.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disabuse--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1271, 'disaffect', NULL, '[v. 使疏远,使不满]', 'The politician tried to disaffect every major voting bloc.', '该政客企图煽起每个主要的选举集团的不满。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/16/c8/16C83E0A4A055A4BDA2F8F7CAC1DFFFB.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disaffect--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1272, 'disagreeable', NULL, '[adj. 不愉快的,厌恶的,不为人喜的]', 'He always tried to avoid disagreeable topics.', '他总是努力避免不愉快的话题。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/15/27/1527EA6617938D513CFACB211E5B88ED.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disagreeable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1273, 'disarray', NULL, '[n. 混乱,紊乱]', 'The child had disarrayed the books.', '孩子把书弄乱了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9b/e2/9BE2D919F3926E85DA7C0B7428C4E9D2.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disarray--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1274, 'disavow', NULL, '[v. 否认,不赞成]', 'I disavow all responsibility for you.', '我不承认对你有任何责任。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/64/4b/644B8D0F4607356C15E333897BCCCF78.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disavow--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1275, 'disavowal', NULL, '[n. 否认]', 'Disavowal of pain is valid. ', '否认疼痛是有确实根据的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/61/19/61191964C658E243DDBAAC302C4A24A4.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disavowal--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1276, 'disburse', NULL, '[v. 支付,支出,分配]', 'That was an effort to disburse power away from the center.', '这是一个从中心,分散权力的努力。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/53/e8/53E8AD112601D9EF8BC959F60971383B.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disburse--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1277, 'discernible', NULL, '[adj. 可辨别的]', 'His face was barely discernible in the gloom.', '在黑暗中很难看得清他的脸。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e3/c8/E3C8309E184883C1E76A7DBC0C538B1A.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/discernible--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1278, 'discerning', NULL, '[adj. 有见识的]', 'She is a very discerning art critic.', '她是位眼光敏锐的艺术评论家。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/3d/26/3D26A64B7E57B5A04F3BA058CA2E7629.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/discerning--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1279, 'disciple', NULL, '[n. 弟子,门徒,信徒]', 'The sage asked this disciple to wait.', '智者让这个弟子等一会儿。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/12/e2/12E27D0A0B48131C216CB4CC58C2B163.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disciple--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1280, 'disclaim', NULL, '[v. 放弃,否认,弃权,拒绝]', 'She disclaimed ownership of the vehicle.', '她放弃了这辆车的所有权。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/1f/34/1F34D3F921F63B8C1C804E96B0FDFA43.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disclaim--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1281, 'discombobulated', NULL, '[vt. 使混乱,使困惑]', 'I get completely discombobulated when I work figures that big. ', '当我计算那么大一笔数时,我完全糊涂了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c3/38/C338E4D26119020512D0A068E37636AD.mp3', 0, 15, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/discombobulated--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1282, 'discomfit', NULL, '[vt. 使懊恼,挫败,征服]', 'He was discomfited by the unexpected questions.', '意料不到的问题使得他十分尴尬。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/21/bb/21BB28D633C012EA52EB50491DD929BC.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/discomfit--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1283, 'discomfort', NULL, '[n. 不适][v. 使不适]', 'One has to bear a little discomfort while travelling.', '旅行中总要忍受一点不便。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/29/67/29672142A94ABCBC68FE0C52F98FA700.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/discomfort--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1284, 'disconnect', NULL, '[v. 使分离,断开,拆开]', 'Disconnect cooling fan from electrical connector.', '断开冷却风扇电气接头。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8d/35/8D358318939A1925A25245F842EDD9E9.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disconnect--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1285, 'disconsolate', NULL, '[adj. 忧郁的,郁郁不乐的]', 'She was disconsolate about her son\'s death.', '她因儿子的死而哀伤。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/80/89/8089C01A29654F954C43F72787FA093E.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disconsolate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1286, 'discontent', NULL, '[n. 不满]', 'The workforce were smoldering with discontent.', '工人们流露出难以抑制的不满。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/65/b6/65B66F18874071174049FC5CE24F9207.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/discontent--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1287, 'discontented', NULL, '[adj. 不满意的]', 'He was discontented with his salary.', '他对自己的薪水感到不满。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/33/fd/33FDCD3C201FB8ED8BE02B4D2D201192.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/discontented--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1288, 'discontinue', NULL, '[v. 中断,中止,停止]', 'You must discontinue your actions.', '你必须中断你的行动。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f4/55/F45564FEEC5AFD869082C9339C300602.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/discontinue--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1289, 'discouraging', NULL, '[adj. 令人气馁的]', 'It\'s very discouraging to be sneered at all time.', '总是受到讥笑使人非常气馁。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/be/e8/BEE89CEC29868CE39DC4F257427DCC05.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/discouraging--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1290, 'discourteous', NULL, '[adj. 失礼的,无礼貌的]', 'I was offended by his discourteous reply.', '他无礼的回答使我很生气。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a4/cb/A4CB8AE666237D73AAFC49410542C56F.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/discourteous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1291, 'discredit', NULL, '[v. 使丧失信誉][n. 丧失名誉]', 'They concocted a plot to discredit the governor.', '他们捏造了一个故事来败坏州长的名誉。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8e/07/8E0786F92E4322E796F673687A4799E1.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/discredit--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1292, 'discrete', NULL, '[adj. 不连续的,分离的]', 'They give off discrete amounts of radiant energy.', '它们放出不连续的辐射能量。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0b/a4/0BA4C0CFF81DCE352319F4E30853A158.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/discrete--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1293, 'discretion', NULL, '[n. 谨慎,慎重,自行决定]', 'We reposed great trust in his tact and discretion.', '我们极为信任他的机智和谨慎。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/59/1c/591C563B4FA4D212B4DF1BD5CA2BA53E.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/discretion--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1294, 'discretionary', NULL, '[adj. 酌情行事的,便宜行事的]', 'The enactment of this regulation gives us discretionary power.', '这个法规的颁布,犹如给我们配备了上方宝剑。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/bd/47/BD4749202F74E28EFC90AE87F7F6FC4B.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/discretionary--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1295, 'discursive', NULL, '[adj. 东拉西扯的,离题的]', 'They complained that my writing was becoming too discursive.', '他们抱怨我的文章变得太散漫的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/09/50/09505688409537D56DBE48A4405EB3DC.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/discursive--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1296, 'disdain', NULL, '[n. 轻蔑,鄙视][v. 蔑视,鄙视]', 'Laval brushed this aside with disdain.', '赖伐尔以轻蔑的态度拒绝了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/74/8a/748A66947B5DC1FF966C2DB05854BB42.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disdain--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1297, 'disembodied', NULL, '[adj. 无实体的,空洞的]', 'A disembodied voice sounded from the back of the cabin.', '从柜子后面传来了一个不见其人的声音。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9c/81/9C813C7CB7E77971E31AB4E779863A0F.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disembodied--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1298, 'disenchant', NULL, '[vt. 使清醒,使不抱幻想]', 'Her arrogance has disenchanted many of her former admirers.', '她为人高傲,追求过她的许多人都已不再迷恋她了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c6/2b/C62B2932A9F3EAEA89146A9A5B6EE877.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disenchant--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1299, 'disenchantment', NULL, '[n. 失望,不抱幻想]', 'There\'s growing disenchantment with the Government.', '大家对政府的幻想渐渐破灭了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f8/1e/F81EC00DEB998F868F1D453209688506.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disenchantment--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1300, 'disenfranchise', NULL, '[vt. 剥夺...公民权]', 'White supremacists devise new methods to disenfranchise Negroes.', '白人至上论者想出新的方法以剥夺黑人的公民权。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/30/0c/300C4E2D6B066709DD199A8D0ADC9AF2.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disenfranchise--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1301, 'disengage', NULL, '[v. 解除,解开,使脱离]', 'He managed to disengage himself from the contract.', '他成功地为自己解除了契约义务。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/1e/f2/1EF2AA0ACACAC4B3A30E6E9DC4CAC1B2.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disengage--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1302, 'disentangle', NULL, '[v. 理顺(复杂或混乱的情况)]', 'This skein of wool won\'t disentangle.', '这束毛线解不开。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/6b/03/6B036BC4271365520BD1B5504166F69E.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disentangle--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1303, 'disfigure', NULL, '[v. 使丑陋,损毁(外貌等)]', 'The accident disfigured him for life.', '那次事故使他毁容,终生无法恢复。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7e/51/7E51BF30F0A5BDCAEC5CDE50CFA55B58.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disfigure--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1304, 'disgruntle', NULL, '[vt. 使不满,使不高兴]', 'The employees were disgruntled by their bad working conditions.', '雇员们因工作条件恶劣而不满。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a4/ae/A4AE3DFCC202D7FFB08CD51188DC914F.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disgruntle--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1305, 'disgruntled', NULL, '[adj. 不满意的(不高兴的)]', 'Disgruntled employees recently called for his resignation.', '不满的雇员们最近要求他辞职。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4c/b6/4CB694382984B8A3570B2B6D546F0162.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disgruntled--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1306, 'disgusted', NULL, '[adj. 厌恶的,使作呕]', 'I\'m disgusted with her affectation.', '我讨厌她的装腔作势。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/93/68/936809D71AD090B4F2A10C671AE4059B.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disgusted--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1307, 'disharmony', NULL, '[n. 失调,不一致,不和谐]', 'Internal disharmony is difficult to bear.', '承担内在的不和谐是艰难的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a8/6d/A86DFBB47F5DFDC09E637599897AC653.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disharmony--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1308, 'dishevel', NULL, '[vt. 使蓬乱,弄乱]', 'They looked dirty and disheveled.', '他们看起来脏兮兮的,衣衫不整。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e8/fd/E8FDF76D9C3410B042CA9CAD48919E31.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dishevel--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1309, 'disheveled', NULL, '[adj. 凌乱的,不整洁的]', 'A disheveled pile of books on the library table.', '图书馆的桌子上摆着一堆凌乱不整的书。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4e/1c/4E1CA55A2E367C02C3AC7E5DB6927753.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disheveled--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1310, 'disillusion', NULL, '[n. 觉醒,幻灭]', 'I knew it all, the whole drab compass of marital disillusion.', '我清楚地知道婚姻幻灭的单调乏味的境界。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/af/e6/AFE6CFE0606D0F215531F5E90CE0AE42.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disillusion--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1311, 'disillusionment', NULL, '[n. 醒悟,理想破灭]', 'Now she is in a state of complete disillusionment.', '现在她彻底醒悟了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/77/c1/77C1D39A83DC7419E800EA305D8238D6.mp3', 0, 15, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disillusionment--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1312, 'disinclination', NULL, '[n. 不情愿,勉强,不感兴趣,厌恶]', 'He felt a disinclination to take music lessons.', '他无意上音乐课。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/42/b2/42B296DFFBA101E064A7146427E6EDA7.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disinclination--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1313, 'disingenuous', NULL, '[adj. 不老实的,不诚实的,虚伪的]', 'It would be disingenuous to claim that we hadn\'t suspected them.', '要是说我们当时还没有怀疑他们,那就是言不由衷了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b0/ec/B0EC7001619245AE203B92EE3F0FFD56.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disingenuous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1314, 'disinter', NULL, '[v. 挖出,掘出]', 'The court granted him permission to disinter the body.', '法院批准他掘出尸体。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4d/2a/4D2AF41EB11220F3E103A2ECAB4F6BC8.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disinter--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1315, 'disinterest', NULL, '[n. 无兴趣,不关心]', 'His total disinterest in money puzzled his family.', '他对金钱毫无兴趣使他的家人感到迷惑不解。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7e/b0/7EB0C432466EEFD4709D5C9234B20D0E.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disinterest--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1316, 'disinterested', NULL, '[adj. 不感兴趣的,公正的,客观的]', 'He is a disinterested person.', '他是一个没有私心的人。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/65/ba/65BA644B7A84079B3B4486735F32B54E.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disinterested--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1317, 'disjunction', NULL, '[n. 析取,分离,分裂]', 'Operator performs logical disjunction on two expressions.', '运算符对两个表达式执行逻辑析取。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/16/64/1664AA7CE2AF8E78B86E676D494BCB7D.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disjunction--_gb_1.mp3');
