INSERT INTO `MASTER` VALUES (1319, 'dislocate', NULL, '[v. 使脱臼,使混乱]', 'How did she dislocate her shoulder 4 times?', '她怎么使她的肩膀四次脱臼?', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f6/d8/F6D8367DA5EBC9DEAB081ECDFFF3836B.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dislocate--_gb_1.mp3');
