INSERT INTO `MASTER` VALUES (1321, 'dismember', NULL, '[v. 肢解,瓜分]', 'The victim\'s dismemberedbody was found in a trunk.', '在一只大箱子里发现了受害者遭肢解的躯体。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c4/9e/C49E50F57CCD4D88AA9FDB185BC11A0E.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dismember--_gb_1.mp3');
