INSERT INTO `MASTER` VALUES (1324, 'disorientate', NULL, '[vt.  使迷失方向]', 'I felt completely disorientated with the jet lag.', '我乘长途飞机後因生理节奏失调而感到昏昏沉沉的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/1e/55/1E55818E83C63BC0E9C23BA71B067F50.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disorientate--_gb_1.mp3');
