INSERT INTO `MASTER` VALUES (1326, 'disparate', NULL, '[adj. 不同的,异类的]', 'The five experiments gave quite disparate results.', '这五次试验所获得的结果迥然不同。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ba/80/BA8068835E1BA6448696F8E211E55108.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/disparate--_gb_1.mp3');
