INSERT INTO `MASTER` VALUES (1331, 'dispenser', NULL, '[n. 药剂师,配药员,分配者]', 'The dispenser quickly filled the prescription for me.', '药剂师立刻照处方为我配了药。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b5/46/B54606F1BA579AFD56948F1368E014DC.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dispenser--_gb_1.mp3');
