INSERT INTO `MASTER` VALUES (1364, 'distinctly', NULL, '[adv. 清楚地,显然地,确定无疑地]', 'He spoke very distinctly.', '他说话十分清晰。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ff/1a/FF1A5EEED4FCA487EB81869C31543419.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/distinctly--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1365, 'distinguished', NULL, '[adj. 卓越的,尊敬的]', 'The scientist is distinguished in many spheres of knowledge.', '这位科学家在许多知识领域中都是杰出的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/41/32/4132036F61F677BFF486BC05725FF790.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/distinguished--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1366, 'distrait', NULL, '[adj. 心不在焉的]', 'The distrait boy is always losing his books.', '这个心不在焉的男孩老是丢书。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/36/27/36277A5CD435AB35F0037918CF184331.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/distrait--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1367, 'distraught', NULL, '[adj. 忧心如焚的,几乎发狂的]', 'She sounded absolutely distraught.', '听上去她完全心慌意乱。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4b/90/4B90E7D9B7B2676E0278119DE73C28DC.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/distraught--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1368, 'dither', NULL, '[n. 犹豫不决,焦虑][v. 犹豫不决]', 'The sight of the policeman made the murderer all of a dither.', '一见到警察,那个谋杀者吓得浑身发抖。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/52/9b/529B01694277E016C6F8B037A5BEB90D.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dither--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1369, 'diurnal', NULL, '[adj. 每日的,白天的]', 'Over water the diurnal change in refraction is likely to be small.', '在水面上,折光的周日变化可能是很小的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b8/d6/B8D6DC4936E6000F15BA98E81FADC11A.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/diurnal--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1370, 'divagate', NULL, '[vi. (文章或谈话)离题,漂泊]', 'Please don\'t divagate from what we\'re discussing about!', '请别从我们所讨论的事岔开话题！', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/46/5e/465E00BBA378A176AD3E127D379EDAF1.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/divagate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1371, 'diver', NULL, '[n. 跳水者,潜水员]', 'The diver first drew a deep breath.', '跳水员先深深地吸了一口气。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/5f/3a/5F3AE327622DE609DE5A2822498EB9DE.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/diver--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1372, 'diverge', NULL, '[v. (意见)分歧,分叉]', 'Our views diverged so greatly that it was impossible to agree.', '我们的观点存在着严重的分歧,绝无调和余地。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d4/bc/D4BCAE62582FF1E9D75E8FA4F5E321AD.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/diverge--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1373, 'divergence', NULL, '[n. 分歧,背离]', 'There is no sure cure for this transatlantic divergence.', '没有什么灵丹妙药可以消除大西洋两岸的分歧。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ea/cc/EACCD394958B1E9575C4D715A0EF1C7B.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/divergence--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1374, 'divergent', NULL, '[adj. 分歧的,分开的,偏离的]', 'For the Jazz, the loss produced divergent viewpoints afterward.', '失利后的爵士出现了很多有分歧的观点。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4b/90/4B90959689CD55B7FA904AE014DD56D1.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/divergent--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1375, 'diversification', NULL, '[n. 多元化]', 'We encourage diversification in the school system.', '我们鼓励办学模式有多元代的发展。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/77/f0/77F0FA4A60A1FB128A63445001725240.mp3', 0, 15, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/diversification--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1376, 'diversified', NULL, '[adj. 多样化的,多种多样的]', 'The Department of Commerce is a highly diversified organization.', '商业部是个高度多样化的机构。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/1c/01/1C0135E7B19B88641B2513EB010A1ACC.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/diversified--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1377, 'divisional', NULL, '[adj. 分割的,部门的]', 'And how about cadres at the regimental and divisional levels?', '团的干部、师的干部怎么样?', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e5/49/E549BE6EFF148A797ACAEC2CAD6C8429.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/divisional--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1378, 'divulge', NULL, '[v. 泄露,暴露]', 'He swore never to divulge the secret.', '他立誓决不泄露秘密。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/fd/6f/FD6FE1939CCBA0E21CA20F1017F3501B.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/divulge--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1379, 'dizziness', NULL, '[n. 头昏眼花,眩晕]', 'Just treat night sweat to dizziness originally.', '本方治盗汗眩晕。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7e/9e/7E9E6CF482A07E87DE06F0F0739F9EB3.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dizziness--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1380, 'dizzying', NULL, '[adj. 令人眩晕的,令人迷惑的]', 'After another glass of whisky I began to feel dizzy.', '我又喝了一杯威士忌之后,就觉得头晕目眩。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/16/07/16079CBDD36769B9CCE2D8640A5F7F39.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dizzying--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1381, 'docile', NULL, '[adj. 容易控制的,温顺的]', 'In every sense she is docile and obedient to him.', '她对他可谓百依百顺。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/71/90/7190C73448622DDF5DB480FB74BC63A3.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/docile--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1382, 'doctrinaire', NULL, '[n. 教条主义者]', 'Don\'t be so doctrinaire about things.', '别那样用理论去解释（判断）事物。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2f/e4/2FE4A1D0062BFD313616680383A28F1E.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/doctrinaire--_gb_1.mp3');
