INSERT INTO `MASTER` VALUES (1385, 'dogged', NULL, '[adj. 顽固的,顽强的]', 'He did it with dogged determination.', '他以顽强的决心做了这件事。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/67/77/67777B4105BC40642D8ECD767CB938AB.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dogged--_gb_1.mp3');
