INSERT INTO `MASTER` VALUES (1387, 'dogmatist', NULL, '[n. 独断家,独断论者]', 'In his manner was something of the dogmatist. ', '在他身上有一种独断专行的派头。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/01/5c/015CC1D3E42546CB3805D513193FF481.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dogmatist--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1388, 'doleful', NULL, '[adj. 悲哀的,寂寞的,阴沉的]', 'His doleful expression told me everything.', '他悲哀的表情让我知道了一切。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/da/1b/DA1BA3B839DC88F7795F1DCB0C4D91E8.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/doleful--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1389, 'dolorous', NULL, '[adj. 忧伤的,悲痛的]', 'With a broken - hearted smile, he lifted a pair of dolorous eyes. ', '带著伤心的微笑, 他抬起了一双痛苦的眼睛。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ad/65/AD6566D109DBACC889DF26EB755B3628.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dolorous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1390, 'domesticate', NULL, '[vt. 驯养,驯化(动物),培育(植物)]', 'Some men are very hard to domesticate.', '有些男人很难做好家务活。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ad/3e/AD3EFF5967F88018685DC469012243A2.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/domesticate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1391, 'domesticated', NULL, '[adj.乐于做家务事的,驯养的]', 'He\'s become a lot more domesticated since his marriage.', '他婚后变得非常恋家。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7d/c5/7DC5AD8AD00D81E80939B29693B0E586.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/domesticated--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1392, 'domineer', NULL, '[v. 擅权,作威作福]', 'Big boys sometimes domineer their younger brothers and sisters. ', '大男孩有时会欺压自己的弟妹们。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/30/63/30632552505538075DE1649C01A85B1D.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/domineer--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1393, 'doodle', NULL, '[v. 乱写乱画,信手涂鸦]', 'Brad was doodling on a sheet of paper.', '布拉德在一张纸上乱写。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/18/7d/187D933CDCD0EE50CAD70A1136A3D1EF.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/doodle--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1394, 'dormancy', NULL, '[n. 休眠,冬眠,潜伏]', 'Eggs hatch as turf comes out of dormancy.', '草地的休眠结束他也开始孵化。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/52/7e/527E9EE13B3F9CAD0C353C989F586AC2.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dormancy--_gb_1.mp3');
