INSERT INTO `MASTER` VALUES (1397, 'dossier', NULL, '[n. 档案材料,卷宗,病历]', 'The dossier in this museum which concern civil war are very rare.', '这个博物馆里有关内战的档案弥足珍贵。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/36/a8/36A8354329BB53442068772814F465F4.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dossier--_gb_1.mp3');
