INSERT INTO `MASTER` VALUES (1399, 'dour', NULL, '[adj. (人)冷酷的,严厉的]', 'I\'m sick of dour faces staring at me from the T. V. tower.', '我厌倦了电视台里瞪着我的那些严厉的面孔。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/68/34/6834D6002C4366DDC2142F1217634255.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dour--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1400, 'douse', NULL, '[v. 浸入,浇灭,泼水,熄灭]', 'The car was doused in petrol and set alight.', '这辆汽车被浇上汽油点燃了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7f/73/7F731175E8B3AA0124AAF4493C0AA600.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/douse--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1401, 'dowdy', NULL, '[adj. 过时的,不美观的]', 'She looked very plain and dowdy.', '她长得非常普通,衣着也过时。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/35/fe/35FE15180D5536B8D96B3E8730BAE725.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dowdy--_gb_1.mp3');
