INSERT INTO `MASTER` VALUES (1405, 'downsize', NULL, '[v. (公司、企业等)_裁员,精减 ]', 'Sales have decreased so much that they need to downsize.', '销售业绩减少很多,所以他们必须缩小规模。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b7/e8/B7E847AF5550E9010FEE40BEED8962AB.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/downsize--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1406, 'drab', NULL, '[adj. 单调乏味的,无光彩的,无生气的]', 'There are many drab houses in the smoky mining town.', '冒烟的矿内有许多土褐色的房子。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/cc/4d/CC4D55E465FCC0FEDB8E9C92DCDCB289.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/drab--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1407, 'draconian', NULL, '[adj. 严厉的,残酷的]', 'The city needs a draconian way of dealing with robbers.', '这个城市需要一个严苛的办法来对付强盗。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/99/97/999791999D5D3DC7A167B56066B2832D.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/draconian--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1408, 'draggy', NULL, '[adj. 拖沓的]', 'Draggy sales are attributed to a psychology of caution. ', '拖泥带水的销售归咎于谨慎的心理。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0a/27/0A274AEBE5606E43E4BB463EAFFF9A2F.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/draggy--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1409, 'dragonfly', NULL, '[n. 蜻蜓]', 'A dragonfly skimmed along the ground.', '一只蜻蜓掠过地面。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ef/8e/EF8EA86DED6A5EF4E81E708D6695AEB6.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dragonfly--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1410, 'dramatize', NULL, '[v. 戏剧化,夸张,渲染]', 'Don\'t believe everything she tells you; she tends to dramatize.', '她的话不可尽信; 她往往言过其实。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/81/da/81DAA5023588D533C01BFC59100EF64B.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/dramatize--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (1411, 'drawl', NULL, '[v. (拉长调子)慢吞吞地说 ]', 'He drawled a greeting to her.', '他慢吞吞地对她说声问候。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/fc/1d/FC1D05848BE85E314C41478F1B4886A7.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/drawl--_gb_1.mp3');
