INSERT INTO `MASTER` VALUES (1611, 'equivocate', NULL, '[vi. 推诿,含糊其词]', 'He is equivocating a lot about what is going to happen. ', '对于即将发生的事情,他极力搪塞。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/96/08/9608C5CDC1DD8C67959DAD1C76DDEAB2.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/equivocate--_gb_1.mp3');
