INSERT INTO `MASTER` VALUES (1613, 'erratic', NULL, '[adj. 不稳定的,难以预测的,不规则的]', 'He was like a stormy, erratic boy.', '他好象是个性急的古怪的孩子。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/70/26/7026A8E65B88ED2CE8DFA2E754C1413B.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/erratic--_gb_1.mp3');
