INSERT INTO `MASTER` VALUES (2093, 'grasshopper', NULL, '[n. 蚱蜢,蝗虫]', 'The spider trapped a grasshopper in its web.', '那蜘蛛在它的网上捕捉到了一只蚂蚱。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/78/31/7831DBAF07081B78E2C14BDD32CC63DF.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/grasshopper--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2094, 'grate', NULL, '[v. 磨擦,磨碎,(使)烦恼]', 'The fire in the grate, too, had burned low.', '炉栅里的火也已经很微弱了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/fb/8d/FB8DF2F9D14114130C3322A5FC69EA1E.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/grate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2095, 'gratification', NULL, '[n. 满足,喜悦]', 'He had the gratification of knowing that he had done his best.', '他了解自己已尽了最大努力而感到满足。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/54/64/5464A7A710227A7A241E6088C8F19A3B.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/gratification--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2096, 'gratify', NULL, '[v. 使满足,使高兴]', 'He did that to gratify his girlfriend\'s vanity. ', '他做那事是要满足他女友的虚荣心. ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d7/c9/D7C99F8B24FC34180B5E60B17B08DB39.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/gratify--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2097, 'grating', NULL, '[n. 格子,[物]光栅][adj. 刺耳的]', 'From the cellar grating floated up the flabby gush of porter.', '隔着地窖的格子窗飘出走了气的黑啤酒味儿。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0a/5c/0A5C8C17C2D83BBA5E9EDE8FA708A6C1.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/grating--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2098, 'gratuitous', NULL, '[adj. 无缘无故的,无必要的]', 'I did not want to be singled out for gratuitous punishment.', '我不愿意被叫出来遭受这无缘无故的惩罚。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0d/c4/0DC48EB7CE1141A47B0D6244FD666932.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/gratuitous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2099, 'gratuity', NULL, '[n. 小费,赠物,赏钱]', 'Gratuity is customary in this money-mad metropolis.', '在这个金钱至上的大都市里,给小费是司空见惯的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/99/34/9934673199B7199FA08F38879F5CED27.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/gratuity--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2100, 'gravel', NULL, '[n. 碎石]', 'The water is infiltrating the gravel bed.', '水正渗透进碎石底层。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9b/6d/9B6D830E12C851121901BE7657D7AEBC.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/gravel--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2101, 'gravitate', NULL, '[v. 受吸引,下沉]', 'In summer people gravitate to the seaside.', '夏天的海边吸引人们。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/47/2f/472F53CAF86C300AE4A2D0187528C2EE.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/gravitate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2102, 'gravitational', NULL, '[adj. 重力的,引力作用的]', 'It is a spontaneous gravitational instability.', '原因在于其自发的重力不稳定性。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/88/d9/88D9CCD9D873D3479E556AA4D4BC562B.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/gravitational--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2103, 'greenhorn', NULL, '[n. 初学者,新手,没经验的人]', 'He is a greenhorn in this field.', '他在这个领域还是个新手。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7a/e6/7AE66893CFF4CB05E3CFF5F9E7570E29.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/greenhorn--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2104, 'gregarious', NULL, '[adj. 爱社交的,群居的]', 'She\'s very outgoing and gregarious.', '她非常外向,喜欢交际。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8e/81/8E8174AC7CB7507CD09DB550FB7A13C3.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/gregarious--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2105, 'grievance', NULL, '[n. 委屈,冤情,苦况]', 'The idea makes me feel a sense of grievance.', '我突然感到很委屈。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e4/c3/E4C33DB71566A290E98DDBEAF4E4AC07.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/grievance--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2106, 'grimace', NULL, '[n. 鬼脸][vi. 扮鬼脸]', 'Thomas made a grimace after he had tasted the wine.', '汤玛斯尝了那葡萄酒後做了个鬼脸。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/fa/89/FA89AAF0A2ED7078DD72C7B9D1692416.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/grimace--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2107, 'grimy', NULL, '[adj. 肮脏的]', 'This is a grimy, forlorn industrial town.', '这是一个肮脏而又荒凉的工业小镇。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/3a/38/3A38494C3A14C0BB4E55D98A7EBB0BF1.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/grimy--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2108, 'gripe', NULL, '[n. 抱怨,肠绞痛]', 'My only gripe about the hotel was the food.', '我对这家旅馆唯一不满的是食物。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/02/18/02189539B2D1C17DAB11DEF89A6D4350.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/gripe--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2109, 'gripping', NULL, '[adj. 扣人心弦的,引人入胜的]', 'The story is so gripping;it makes you thirst for the next episode.', '这故事是那么扣人心弦,使人急于要知道下文如何。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/fb/eb/FBEB398998119CFC6B79F610B0B24DE4.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/gripping--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2110, 'grisly', NULL, '[adj. 可怕的,恐怖的]', 'Robbing graves is grisly.', '盗墓是可怕的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/27/e6/27E61326AC96E2D714CF63F3DF8E6B57.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/grisly--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2111, 'grit', NULL, '[n. 砂砾,勇气][vt. 撒盐,咬紧牙关]', 'Grit is spread on roads to make them less slippery in icy weather.', '在结冰的天气,在路上撒上砂砾心免路面太滑。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/12/1a/121A4B4B83F481E4729D37EDCE540C2B.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/grit--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2112, 'groom', NULL, '[n. 新郎][vt. (给动物)擦洗]', 'Her groom was much older than she was.', '她的新郎比她大很多。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/44/1a/441A1BB2FE9B49B2A33EFF4FBAFDD02B.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/groom--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2113, 'grotesque', NULL, '[adj. 怪诞的,奇形怪状的]', 'The fat old man looked grotesque in tight trousers.', '那个胖老头穿上绷得紧紧的裤子显得奇形怪状。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a6/52/A65257D703FD34FF09C5C20AA07F8366.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/grotesque--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2114, 'grouch', NULL, '[n. 牢骚]', 'Of course, they all call me a grouch.', '他们大家当然说我爱发牢骚。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f4/b7/F4B76D96658FF6D9346FC4FEE49E1564.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/grouch--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2115, 'groundless', NULL, '[adj. 无根据的]', 'Facts have proved these worries groundless.', '事实证明,这些忧虑是没有根据的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/cc/0a/CC0AFD7D59CD7E8423CB86C91888C5B7.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/groundless--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2116, 'grove', NULL, '[n. 小树林,果树园]', 'I used to take a walk in the quiet grove.', '过去我常在那安静的小树林里散步。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c2/84/C2847B29730351D0498654A46EA8B9B7.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/grove--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2117, 'grovel', NULL, '[v. 趴,匍匐,卑躬屈膝]', '\"Then he began to grovel and wail, \"\"I deserve to die!\"\"\"', '这时他趴倒在地嚎叫道“我该死”。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f2/c4/F2C4731B45B41346F40D78E603704EC3.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/grovel--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2118, 'growl', NULL, '[v. 咆哮,吼][n. 吠声,咆哮声]', 'I kicked the dog, which responded by growling/with a growl.', '我踢了那条狗,它便狂吠起来。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e0/08/E0082548A53AB14D2A052D394C3DD33A.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/growl--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2119, 'grudge', NULL, '[n. 怨恨,恶意][vt. 吝惜]', 'He harbors a secret grudge against his father.', '他对父亲暗怀不满。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/08/55/085584AF8492D1BF28F77F9E885E581A.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/grudge--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2120, 'gruesome', NULL, '[adj. 令人厌恶的,恐怖的,可怕的]', 'That gruesome story was enough to turn one\'s blood cold.', '那个可怕的故事足以使人毛骨悚然。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c5/3d/C53DB8B8050953FCCBD940B06F62DAA9.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/gruesome--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2121, 'gruff', NULL, '[adj. 态度生硬的,声音粗哑的]', 'His gruff manner made me angry.', '他粗暴的态度让我生气。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/21/6a/216A63A9D271576683C7968C065AD910.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/gruff--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2122, 'grumble', NULL, '[v. 嘟囔,发牢骚][n. 嘟囔,发牢骚]', 'A lot of students grumble about heavy reading assignments.', '许多学生发牢骚说阅读量太大。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/43/5c/435CE2C5776769AC16378F3B9B121CF5.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/grumble--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2123, 'grumpy', NULL, '[adj. 性情乖戾的,脾气暴躁的]', 'China has been a grumpy taker in this process.', '在这过程中中国是个暴躁的攫取者。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d5/09/D509A109C184855983C875EEFD9A5F4F.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/grumpy--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2124, 'guffaw', NULL, '[n. 哄笑,大笑][vi. 哄笑,大笑]', 'What he said aroused a blast of guffaw .', '他的话引起大家一阵哄笑。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b8/e0/B8E0F4333BD684A55C336797052073BB.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/guffaw--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2125, 'guile', NULL, '[n. 狡猾,狡诈]', 'They used their craft and guile to close the deal.', '他们用他们的精明狡猾完成了这笔交易。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/24/1e/241EEFA9A2860F895C1CB879390F3327.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/guile--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2126, 'guileless', NULL, '[adj. 不狡猾的,诚实的]', 'He is a guileless young man.', '他是个诚实的年轻人。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/37/6d/376DFDCA32F2CB061DFE26A52A80D38E.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/guileless--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2127, 'guise', NULL, '[n. 外表,外观,伪装]', 'They spoke to me under the guise of friendship.', '他们伪装成友善的样子对我说话。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2b/ec/2BECA14409951EC941B61FA364324A43.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/guise--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2128, 'gulch', NULL, '[n. 激流峡谷]', 'The trail ducks into a narrow gulch.', '这条羊肠小道突然下到一个狭窄的峡谷里。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ff/73/FF7336F9D7DEBF200013CC0FF9A52964.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/gulch--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2129, 'gull', NULL, '[n. 海鸥]', 'Gull flies over the sea.', '海鸥在大海上飞翔。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/50/c2/50C2DFAE0D2F6FF42EF3D376C8392A36.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/gull--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2130, 'gullible', NULL, '[adj. 易受骗的,轻信的]', 'Bill\'s so gullible that you could sell him anything.', '比尔非常容易上当,你骗他什么他都相信。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2b/44/2B44CD4E2CDE410022CE9F008B388C37.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/gullible--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2131, 'gulp', NULL, '[v. 狼吞虎咽,深呼吸]', 'She gulped nervously, as if the question bothered her.', '她紧张地咽了一下,似乎那问题把她难住了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/70/1b/701B3AF56E2F98C9EA88C919E20092FF.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/gulp--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2132, 'gumption', NULL, '[n. 机智,精明,勇气,胆量]', 'He didn\'t have the gumption to keep his mouth shut.', '他这人不老练,嘴不严。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/33/4a/334A7B75B8820FF5F296CE15144B10DE.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/gumption--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2133, 'gush', NULL, '[v. 喷出,涌出][n. 涌出]', 'Oil gushed out from the broken pipe.', '油从断裂的管道中涌出。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d6/22/D622071DEDD0CEA9CF9EBF76E91CBEF3.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/gush--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2134, 'gusher', NULL, '[n. 喷油井]', 'The oil rushes up the tube and spouts up as a gusher.', '石油会沿着钢管上涌,如同自喷井那样喷射出来。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2d/60/2D60FCED934F857CCE6C212E24336FDC.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/gusher--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2135, 'gust', NULL, '[n. 一阵强风,(感情的)爆发]', 'A sudden gust of wind blew the door shut.', '突然一阵大风把门吹得关上了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/27/91/2791DC1BEC8C6FFD4029C5C506E83C8F.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/gust--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2136, 'gustation', NULL, '[n. 品尝,味觉]', 'I have a sensitive gustation.', '我有灵敏的味觉。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4b/d0/4BD0D7FCA42361BA184F67E54DA01996.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/gustation--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2137, 'gustatory', NULL, '[adj. 味觉的]', 'Guests are enjoying the visual and gustatory pleasure.', '客人正在享受视觉和味觉乐趣。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/11/e3/11E3AC790276571CA082F5360F7CC4B9.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/gustatory--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2138, 'gutless', NULL, '[adj. 没有勇气的,懦怯的]', 'He was a yellow gutless worm. ', '他是个没勇气的可怜虫。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a1/5c/A15CBD46E2CEF6AE130511981311C8CF.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/gutless--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2139, 'gutter', NULL, '[n. 排水沟,贫民区]', 'There\'s a cigarette packet thrown into the gutter.', '阴沟里有个香烟盒。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c0/29/C029DC2619985DA5D79CA2B3C0171B61.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/gutter--_gb_1.mp3');
