INSERT INTO `MASTER` VALUES (2334, 'impassable', NULL, '[adj. 不能通行的,无路可通的]', 'When the road became impassable, we had to ditch the car and walk.', '道路无法通行时,我们只好弃车步行。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/38/ac/38AC9FE388929205AD0E3B14DA49A20A.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/impassable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2335, 'impasse', NULL, '[n. 僵局,死路]', 'But the political impasse lingers.', '但政治僵局却依然持续。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/98/d7/98D757AA008D64F58FE55BE3EF9DCC77.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/impasse--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2336, 'impassioned', NULL, '[adj. 慷慨激昂的,热烈的]', 'He made an impassioned speech in our school.', '他在我们学校做了一次慷慨激昂的演讲。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/94/4b/944BACDB5F74BD6DAC71C3C300F9DB4D.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/impassioned--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2337, 'impassive', NULL, '[adj. 面无表情的,喜怒不形于色的]', 'He listened with an impassive face.', '他面无表情地听着。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/3d/01/3D0185FD83D22717D630E2061C32AF7C.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/impassive--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2338, 'impeach', NULL, '[v. 怀疑,控告,弹劾]', 'Many people impeached the judge for taking bribes.', '很多人控告法官受贿。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/89/63/89636E0AED46D682E2E1E19293ADEAC1.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/impeach--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2339, 'impeccable', NULL, '[adj. 无瑕疵的,完美的]', 'Your English is impeccable!', '你的英语十分好！', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9f/97/9F97DEE4A42DE90ED57ECFF48028E1D2.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/impeccable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2340, 'impecunious', NULL, '[adj. 身无分文的,贫穷的]', 'But it may the easiest way to let you impecunious.', '但它也可能是让你变得身无分文最容易的办法。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/3b/44/3B44AEF1406CED7B5CE73D5EA448D2A1.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/impecunious--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2341, 'impede', NULL, '[vt. 妨碍,阻止]', 'He impedes me to do the job well.', '他妨碍我把工作做好。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/12/fd/12FD66BAA352E51E0215F488EE6C744A.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/impede--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2342, 'impediment', NULL, '[n. 障碍,阻碍,口吃]', 'The main impediment to growth is a lack of capital.', '影响发展的主要障碍是缺乏资本。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/87/5e/875E13CA5BC8F27EDBD681F7FB2ACD08.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/impediment--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2343, 'impel', NULL, '[v. 驱使,激励]', 'The President\'s speech impelled the nation to greater efforts.', '总统的讲话激励国民更加努力。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/35/2a/352A018A7CF02F6759DE84160472625F.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/impel--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2344, 'impend', NULL, '[vi. 迫近,逼迫,即将发生]', 'Crucial events impend in Europe.', '欧洲即将发生具有决定意义的事变。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/fe/df/FEDFE817B019CBD68F3586D2AA7B7608.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/impend--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2345, 'impending', NULL, '[adj. 即将发生的,迫在眉睫的]', 'The dark clouds suggest an impending storm.', '乌云表明暴风雨即将来临。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4e/ba/4EBAD9B88BC7259546FDD95AE762132D.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/impending--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2346, 'impenetrable', NULL, '[adj. 不能穿过的,不可理喻的]', 'Armor plate is impenetrable by ordinary bullets.', '装甲板普通子弹打不穿。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8f/46/8F4621C18C771D106D8C6D788D1F69B4.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/impenetrable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2347, 'impenitent', NULL, '[adj. 不知悔改的,顽固的]', 'His impenitent attitude is really annoying. ', '他死不改悔的态度真令人生气。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f9/8c/F98CADC58F5A5CBCA10352BEBA5E9D2A.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/impenitent--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2348, 'imperil', NULL, '[v. 使陷于危险中,危及]', 'The security of the country had been imperilled.', '国家安全处於危险之中。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a3/d0/A3D080035FE2FFB4C2F0580656F1E725.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/imperil--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2349, 'imperious', NULL, '[adj. 专横的,盛气凌人的]', 'His imperious look makes us angry.', '他那飞扬跋扈的样子令我们生气。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/3d/4f/3D4F6DA0F7A2125E388772C611508883.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/imperious--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2350, 'impermanent', NULL, '[adj. 暂时的,非永久的]', 'The world is in continuous flux and is impermanent.', '世界变迁不已,并非是常久不变的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9f/0b/9F0B3730732A08D330BB12625FBF7026.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/impermanent--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2351, 'impermeability', NULL, '[n. 不渗透性,不透过性]', 'They are testing the water impermeability of this material.', '他们正在测试这种材料的水不渗透性。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2b/c9/2BC9876159271D032925E60D307BF1AC.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/impermeability--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2352, 'impermeable', NULL, '[adj. 不能渗透的,不渗透性的]', 'Water cannot easily flow in these impermeable rocks.', '水不容易流进那些不透水的岩石。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d5/ff/D5FF8D9B8F5DD859524A2A97FA4A817F.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/impermeable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2353, 'impermissible', NULL, '[adj. 不允许的,不许可的]', 'Such a state of affairs is entirely impermissible. ', '这种状态是完全不能容许的。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/18/68/1868BD48D2E4671B76D9CB84D20AFCB2.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/impermissible--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2354, 'impersonal', NULL, '[adj.  缺乏人情味的,客观的]', 'I hate dealingwith large impersonal companies.', '我讨厌与那些没有人情味的大公司打交道。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/78/48/78488DFAEB978C2B99BAE611D6571B46.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/impersonal--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2355, 'impersonate', NULL, '[v. 模仿,扮演,假冒]', 'I use character quotes from movies and impersonate people we know.', '我会利用电影中的角色来扮演或模仿我们生活中熟悉的人。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e0/b1/E0B15B9C3739FE5D7442416202E09523.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/impersonate--_gb_1.mp3');
