INSERT INTO `MASTER` VALUES (2358, 'imperturbable', NULL, '[adj. 沉着的,冷静的]', 'Hitherto imperturbable, he now showed signs of alarm.', '到现在为止都很沉着,但现在他表现出了惊慌的迹象。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/31/87/318743B033663AEF5933F20453BE8A39.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/imperturbable--_gb_1.mp3');
