INSERT INTO `MASTER` VALUES (2361, 'implicate', NULL, '[vt. 牵涉,意味着,暗示]', 'His enemies tried to implicate him in the murder.', '他的仇人竭力想把他牵扯进谋杀案中。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0c/af/0CAF6FF7FD2B8FABBBBF048A3BD59047.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/implicate--_gb_1.mp3');
