INSERT INTO `MASTER` VALUES (2364, 'importune', NULL, '[v. 向…强求,对…胡搅蛮缠]', 'Above all I do not wish to importune or compromise you. ', '总之我不希望你胡搅蛮缠或妥协。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/21/64/2164B38D598756BF1E22156D8F773234.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/importune--_gb_1.mp3');
