INSERT INTO `MASTER` VALUES (2366, 'impoverished', NULL, '[adj. 贫困的,耗竭的]', 'The impoverished family subsisted on charity.', '那个贫穷的家庭靠慈善救济过日子。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/5d/61/5D61DF5E636D80153A41620495E41A28.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/impoverished--_gb_1.mp3');
