INSERT INTO `MASTER` VALUES (2381, 'inadequate', NULL, '[adj. 不适当的,不充分的]', 'He has made an inadequate choice.', '他做了一个不适当的选择。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a4/28/A42878CC89F6F6A0EE48B53D2921FD78.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inadequate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2382, 'inadvertence', NULL, '[n. 不注意,疏忽,怠慢]', 'We all suffer reproaches for the inadvertence of a few. ', '我们都因为一些人的疏忽而受到责备。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/38/be/38BE362D5BC01B643581AA77E640F1AD.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inadvertence--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2383, 'inadvertently', NULL, '[adv. 不注意地,疏忽地]', 'I inadvertently pressed the wrong button.', '我一疏忽按错了按钮。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/64/58/6458C06FC0516A3362D3B193D6D4C7E7.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inadvertently--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2384, 'inalienable', NULL, '[adj. 不可剥夺的]', 'Taiwan is an inalienable part of the Chinese territory.', '台湾是中国领土不可分割的一部分。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/19/3e/193E71C08E8E79305427F71D343F8B2A.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inalienable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2385, 'inanimate', NULL, '[adj. 无生命的]', 'Rocks and stones are inanimate.', '岩石是无生命的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/bf/7f/BF7FBE5A788D917E674DD22039FAB74C.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inanimate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2386, 'inappreciable', NULL, '[adj. 微不足道的]', 'All of the great action and mind have an inappreciable beginning.', '一切伟大的行动和思想,都有一个微不足道的开始。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4a/96/4A96B01B8096E633CF3D3B962B6AAB39.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inappreciable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2387, 'inappropriate', NULL, '[adj. 不适当的,不合宜的]', 'Your bright red coat would be quite inappropriate for a funeral.', '你鲜艳的红大衣很不适合葬礼。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d3/d2/D3D27069B71FC09771D7AED186E85390.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inappropriate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2388, 'incandescent', NULL, '[adj. 耀眼的,有活力的,暴怒的]', 'The sun blazed down from an incandescent sky.', '晴空中骄阳高照。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/78/59/78593326D9699BF94D63F57967C542DB.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/incandescent--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2389, 'incapacitate', NULL, '[v. 使不能,使不适于]', 'Poor eyesight will incapacitate you for a job in the library. ', '视力差将使你不适合于在图书馆工作. ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f7/d7/F7D746C92949CBBE9AC288D65E572715.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/incapacitate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2390, 'incarcerate', NULL, '[vt. 监禁,幽闭]', 'Why do you incarcerate yourself in the room every afternoon? ', '你为何每天下午将自己关在房间里? ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/fb/91/FB91514676FF3B4FEDDAEA4C734FC9C3.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/incarcerate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2391, 'incendiary', NULL, '[adj. 放火的,煽动的][n. 燃烧弹]', 'They had it that the fire was incendiary.', '他们认为这是有人纵火。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/be/88/BE88597570ED112669864F9C12A92CEB.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/incendiary--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2392, 'incense', NULL, '[n. (宗教仪式用的)香][vt. 激怒]', 'Distant dreams rise like incense.', '梦在远方化成一缕香。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ff/1c/FF1C56F8566828C2F5CB511306AA6C87.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/incense--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2393, 'incessant', NULL, '[adj. 不断的,无尽的]', 'The incessant barking of the dog annoyed me.', '不断的狗叫声让我苦恼。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/77/42/77427016E712BFEA5D2FFA4D514E24D6.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/incessant--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2394, 'inchoate', NULL, '[adj. 初期的,不成熟的]', 'Who knows the main symptom of inchoate lung cancer?', '有谁知道早期肺癌的主要症状吗？', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/38/9b/389BF09BFCF624323C24429904B19FA1.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inchoate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2395, 'incinerate', NULL, '[v. 焚化(废物),烧成灰,火化]', 'The government is trying to stop hospitals incinerating their own waste.', '政府正设法阻止医院自行焚烧垃圾废物。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f3/1d/F31DB382172D655C03F2BDF083F78CDF.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/incinerate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2396, 'incise', NULL, '[vt. 切入,切割,雕刻]', 'We need make a incise estimate in addavance. ', '我们需要事先作出准确的估计。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/10/a2/10A26F6CD2910672895DC546F15DD30C.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/incise--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2397, 'incision', NULL, '[n. 切口,切割]', 'An incision was made into his leg.', '他腿上切开了一个口子。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/31/00/3100D83220E5755BBF9964B733E40F38.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/incision--_gb_1.mp3');
