INSERT INTO `MASTER` VALUES (2399, 'incite', NULL, '[v. 煽动,刺激,激励]', 'Stop anyone trying to incite the people.', '有人煽动,实行挡驾。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/03/de/03DE65923BCE6F70637D2386DD2FABA7.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/incite--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2400, 'inclement', NULL, '[adj. 严寒的,狂风暴雨的]', 'The inclement weather brought forth a host of disease.', '严酷的天气引起了种种疾病。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/25/51/255142011A733F6CAA78520987DED9BF.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inclement--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2401, 'incoming', NULL, '[adj. 正来临的][n. 收入]', 'This phone only takes incoming calls.', '这部电话只接打进来的电话。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9f/0e/9F0EEF485DD0BE444A178DDCA7710D0C.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/incoming--_gb_1.mp3');
