INSERT INTO `MASTER` VALUES (2404, 'inconclusive', NULL, '[adj. 不确定的,无结论的]', 'The past two elections were inconclusive.', '过去的两次选举结果都尚不明确。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/92/47/924713841469B79433902A3CC0E56B4C.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inconclusive--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2405, 'incongruent', NULL, '[adj. 不协调的,不和谐的]', 'They have incongruent ideas on this thing.', '他们对这件事有不一致的看法。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/89/dd/89DD6199BCDE0B12D2557EBDD5E1B51A.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/incongruent--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2406, 'incongruity', NULL, '[n. 不调和,不一致,不配合]', 'She was struck by the incongruity of the situation.', '这一局面煞是怪异,让她惊愕不已。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e9/e5/E9E5947070737C6FC515AAD1FDA8CC20.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/incongruity--_gb_1.mp3');
