INSERT INTO `MASTER` VALUES (2408, 'inconstancy', NULL, '[n. 反复无常]', 'In contrast, inconstancy often results in failure. ', '反之, 反复多变往往导致失败。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/79/30/7930D829B6699B0A0A0342837DDCE5CC.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inconstancy--_gb_1.mp3');
