INSERT INTO `MASTER` VALUES (2410, 'incorrigibility', NULL, '[n. 无可救药,无法矫正]', 'I\'m just an incorrigibility.', '我只不过是个无可救药的人。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/6e/8e/6E8E164B93B3B4272697712909613A2A.mp3', 0, 15, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/incorrigibility--_gb_1.mp3');
