INSERT INTO `MASTER` VALUES (2412, 'increment', NULL, '[n. 增量,增加,增值]', 'Your salary will be $12000 a year, withannual increments of 500.', '你的年薪为12000美元,每年增加500美元。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/38/86/3886E6AA63F45F3DA5FD23A3E8435CDA.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/increment--_gb_1.mp3');
