INSERT INTO `MASTER` VALUES (2414, 'incubation', NULL, '[n. 孵化,[医]潜伏期]', 'The incubation period usually is 8 to 14 days.', '潜伏期通常为8-14天。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/34/1e/341EE4CC5048C3AEB08557EFE2CCE8B5.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/incubation--_gb_1.mp3');
