INSERT INTO `MASTER` VALUES (2417, 'indelible', NULL, '[adj. 不能擦除的,不能磨灭的,难忘的]', 'The scandal entailed on the government indelible disgrace.', '那件丑闻给政府带来了难以洗掉的耻辱。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/45/71/457185F460864545DDFD5173B40E4590.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/indelible--_gb_1.mp3');
