INSERT INTO `MASTER` VALUES (2422, 'indignity', NULL, '[n. 侮辱,轻蔑,有伤尊严]', 'She was subjected to indignity and humiliation.', '她受到侮辱和羞辱。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ca/68/CA680A9370E1EF5159B2C2A4F68DB013.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/indignity--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2423, 'indiscriminately', NULL, '[adv. 无差别,任意地]', 'I\'m afraid this disease strikes indiscriminately.', '恐怕各年龄段的人都有可能得这种病。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a9/20/A920DC3319BE3219BAFE641671EE263B.mp3', 0, 16, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/indiscriminately--_gb_1.mp3');
