INSERT INTO `MASTER` VALUES (2425, 'indolent', NULL, '[adj. 懒惰的,慢性的]', 'I don\'t want to make friends with indolent persons.', '我不喜欢和懒惰的人交朋友。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/6c/5d/6C5DF99B304EDB17999C64511D366DF0.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/indolent--_gb_1.mp3');
