INSERT INTO `MASTER` VALUES (2430, 'industrialise', NULL, '[v. (使)工业化]', 'They wanted to industrialise their nation.', '他们想使国家工业化。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/35/9f/359F5E278B838B7254E8ECC3DFFA06E3.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/industrialise--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2431, 'industrialization', NULL, '[n. 工业化]', 'Industrialization influences social usages.', '工业化影响着社会的习俗。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/5d/06/5D06AD3F77EC4C89C6091490DB8B8DCB.mp3', 0, 17, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/industrialization--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2432, 'industrialized', NULL, '[adj. 工业化的]', 'Industrialized countries are consuming 70% of the world\'s energy.', '工业化国家消耗著世界能源的百分之七十。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/57/ce/57CE88EB9F397881B99DE48BBA7108CB.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/industrialized--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2433, 'inebriate', NULL, '[adj. 陶醉的,喝醉的][n. 酒徒]', 'Drinking tea can inebriate people in summer.', '夏季饮茶不当也会让人有醉的感觉。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/21/0d/210D28FE381DD2F23379541234DD0D34.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inebriate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2434, 'ineffable', NULL, '[adj. (美好得)难以形容的,不可言喻的]', 'The beauty of a sunset is ineffable.', '日落的美是难以形容的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4a/04/4A0451576E19373D69B1F67C562B9CE8.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/ineffable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2435, 'inelastic', NULL, '[adj. 无弹性的,无伸缩性的]', 'The skin was hot, dry and inelastic, and had a doughy feel.', '皮肤热而干燥、无弹性,用手按捺时有柔软的感觉。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/3e/03/3E0353AC9B5B75EB75090589E8B93803.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inelastic--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2436, 'inelasticity', NULL, '[n. 无伸缩性]', 'Inelasticity was the reason for the discontent of the Wall Street bankers.', '缺乏弹性是华尔街银行家不满的原因。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f3/ab/F3AB6A67A4A73E23581E80EF8D6D49BF.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inelasticity--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2437, 'ineligible', NULL, '[adj. 无资格的,不合格的]', 'A foreign-born citizen is ineligible for the Presidency.', '外籍公民没有资格任总统。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/3e/e6/3EE6633A9897223869280D9A8007C909.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/ineligible--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2438, 'ineluctable', NULL, '[adj. 难免的,不能逃避的]', 'The onward march of globalisation is, of course, not ineluctable.', '当然,全球化进程并不是不可阻挡的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/68/52/68521A848EBBBD01D8AF6728C6EE0074.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/ineluctable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2439, 'inert', NULL, '[adj. 无行动的,惰性的,迟钝的]', 'She lay there inert, I thought she must be dead.', '她躺在那儿一动不动,我想她一定是死了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/1f/e9/1FE9AB0F1F9AE6D694E2EDA15E79CBC5.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inert--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2440, 'inescapable', NULL, '[adj. 无法逃脱的,不可避免的]', 'A credibility gap is almost inescapable between generations.', '两代人之间互不信任几乎是不可避免的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2e/b6/2EB6B19320849A62B1565EFB2D10E6AB.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inescapable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2441, 'inexpedient', NULL, '[adj. 不适当的,不明智的]', 'It would be inexpedient to inform them at this stage.', '在目前阶段就通知他们很不妥当。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/90/f5/90F57F1F1340400347E8E260F8074D2F.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inexpedient--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2442, 'inexpiable', NULL, '[adj. 不能补偿的]', 'She regards this deed as such an inexpiable crime.', '她认为这种行为是一种无可饶恕的罪行。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/08/06/080630F1201ABF0B5800B41988C5F001.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inexpiable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2443, 'inextricably', NULL, '[adv. 分不开地,无法摆脱地]', 'Our fates are inextricably joined.', '我们的命运是不可分地连结在一起的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e2/08/E20876D240B4E5CF1784DC737C3AB6FC.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inextricably--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2444, 'infancy', NULL, '[n. 婴儿期,初期]', 'Children are in their infancy when they are babies.', '孩子们还是小宝宝时,是处于婴儿期。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/14/95/1495A9C8A900D412B4E29CD13E179C96.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/infancy--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2445, 'infantry', NULL, '[n. 步兵,步兵部队]', 'We have less infantry than the enemy.', '我们的步兵比敌军少。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/36/4f/364F207E8D5BFF01DF2D954B0FC1D9B7.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/infantry--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2446, 'infatuate', NULL, '[v.  冲昏头脑]', 'Those are the toys that infatuate children. ', '这是些使孩子们愚蠢的玩具。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2d/12/2D128DD21D7EA2B3868806C170E8058B.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/infatuate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2447, 'infelicitous', NULL, '[adj. 不妥当的,不幸的]', 'There are several infelicitous remarks in this article.', '文中有一些不贴切的措辞。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e3/7b/E37BB9BD87B1E62507092839B72A9F05.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/infelicitous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2448, 'infelicity', NULL, '[n. 不幸,不恰当的言语]', 'There is so much infelicity in the world.', '人世间有很多不幸的事。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a5/c1/A5C1A3FCE9C3FD51812E6B509DBB1C05.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/infelicity--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2449, 'inferential', NULL, '[adj. 推理的,推论的]', 'The validity of inferential form is the key conception of logic. ', '推理形式的有效性是逻辑学的核心概念。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/38/4a/384ACC24C6360A34ECE9C61958BCDEB2.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inferential--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2450, 'infernal', NULL, '[adj. 地狱的,可恶的]', 'You infernal scoundrel, how dare you tell me that?', '你这个无法无天的流氓,好大胆子,竟敢跟我说这种话。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4b/92/4B92B404920EA8086972B7F763E85029.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/infernal--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2451, 'infertile', NULL, '[adj. 贫瘠的,不能生育的]', 'Plants can\'t grow well in the infertile land.', '在贫瘠的土地上庄稼长不好。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/76/54/76540E204F2C4F3E0ECEED26617143C4.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/infertile--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2452, 'infest', NULL, '[v.  (昆虫、老鼠等)大批出没于]', 'There is a warehouse infested by rats.', '那有一个大批老鼠出没的仓库。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/5c/35/5C35FF77BEB2452EFD444CF21B928884.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/infest--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2453, 'infiltrate', NULL, '[v. (使)渗透,(使)渗入,潜入]', 'The enemy infiltrated our land.', '敌人混入我国领土。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f2/7a/F27AEC85BEEC32DDA610A7865F245D87.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/infiltrate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2454, 'infirmary', NULL, '[n. 治疗室]', 'She still remained in the infirmary.', '她始终留在那间养病室里。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d4/10/D41004AB2D47E67388913E4EA0BE7BE0.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/infirmary--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2455, 'infirmity', NULL, '[n. 虚弱,病身,疾病,弱点]', 'Infirmity often comes with old age.', '虚弱常随年老而来。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9a/e4/9AE4C1444CF328A0FFEB0DF3861E83EE.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/infirmity--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2456, 'inflame', NULL, '[v. 激怒,加剧,发炎]', 'Her question seemed to inflame him all the more.', '她的问题似乎更加激怒了他。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/49/7a/497A9E65114E89316CF479EA2E821B73.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inflame--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2457, 'inflammable', NULL, '[adj. 易燃的,易怒的]', 'Petrol is highly inflammable.', '汽油是高度易燃的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/13/54/13542C47793711ACCF66725171280E1B.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inflammable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2458, 'inflammation', NULL, '[n. 发炎,炎症]', 'He has an inflammation of the lungs.', '他得了肺炎。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0c/f5/0CF558E880AFA8A35A58B90A45062DD9.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inflammation--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2459, 'inflexible', NULL, '[adj. 僵化的,顽固的,不可改变的]', 'The new plastic is completely inflexible .', '这种新塑料是完全不可弯曲的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8e/03/8E032C963F26513B3FF8D3079370466B.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inflexible--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2460, 'influx', NULL, '[n. (人、资金或事物的)涌入]', 'This influx of money could be exaggerating the market\'s gyrations.', '大量资金的流入会夸大市场的回旋余地。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7a/71/7A71F62D8C2B19445886470BC90BB5D2.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/influx--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2461, 'informed', NULL, '[adj. 见多识广的,消息灵通的]', 'Reading is an excellent way to learn new things and stay informed.', '阅读是学习新事物和使人见多识广的最佳方法。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/3f/55/3F5598AEAE6BDD90CDC365D04FF98C3D.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/informed--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2462, 'informer', NULL, '[n. 告发者,告密者]', 'The Inspector had received a phone call from an informer.', '警长刚刚接到一名通报者的电话。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/1f/1e/1F1E4FA4309135AA6D1FE8ECF83392CB.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/informer--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2463, 'infraction', NULL, '[n. 违反,违法]', 'You make it sound like a traffic infraction.', '你说起来像只是违反了交通规则。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/99/1b/991BDF0FF9AC9BDA129053B5250B98B4.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/infraction--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2464, 'infuse', NULL, '[vt. 注入,泡(茶等),全面影响]', 'We must infuse new blood into the Party.', '我们必须给党注入新鲜血液。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b2/40/B24067A7ABB4B044DD4689FEEE55CF3B.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/infuse--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2465, 'infusion', NULL, '[n. 注入,灌输,炮制的草药]', 'An infusion of capital bolsters their solid brands.', '注入的资本增强了其坚实的品牌。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/fd/54/FD5409C33BB0B933C15E98460ACF179C.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/infusion--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2466, 'ingeniously', NULL, '[adv. 巧妙地]', 'The roof has been ingeniously designed to provide solar heating.', '房顶经过巧妙设计,可提供太阳能取暖。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ed/64/ED641E90D0442CE989C3D037D10F39BF.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/ingeniously--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2467, 'ingestion', NULL, '[n. 吸收,咽下,摄取]', 'In case of accidental ingestion seek professional assistance.', '假如意外的摄取找寻专业的协助。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/dc/3f/DC3F2089B6640A83C4E650A2FA158E26.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/ingestion--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2468, 'ingratiate', NULL, '[v. 取悦,迎合,讨好]', 'He never ingratiate himself with his boss.', '他从不去讨好上司。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/fe/bf/FEBF67FC8264B4C0D38C6CF9774E3C95.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/ingratiate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2469, 'ingratiating', NULL, '[adj. 讨好的,奉承的]', 'His fellow students had found him too ingratiating.', '他的同学们发现他太爱奉承了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0a/03/0A0397B6F157EA1FD8AB2E17685C4D64.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/ingratiating--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2470, 'ingress', NULL, '[n. 进入,入口,入境]', 'A high seating position makes ingress and egress easy. ', '较高的座椅位置使入口和出口容易。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/5c/e2/5CE252EEF3B7492921A977C8105C52D2.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/ingress--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2471, 'inherently', NULL, '[adv. 天性地,固有地]', 'War is inherently a dirty business.', '战争与生俱来就是肮脏的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e3/c4/E3C419257CFC15F2F3ED514820F36332.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inherently--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2472, 'inhumane', NULL, '[adj. 无情的,残忍的,不人道的]', 'I don\'t think he\'s an inhumane man.', '我认为他不是一个没有人性的人。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/50/c1/50C1047A45EE90E6427C8A0264E38784.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inhumane--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2473, 'inimical', NULL, '[adj. 有害的,不友善的]', 'Lack of ambition is inimical to success.', '没有抱负,则难以成功。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c7/81/C781FDE165477B65DFDE606634122679.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inimical--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2474, 'inimitable', NULL, '[adj. 无与伦比的,无法仿效的]', 'He delivered the speech in his own inimitable style.', '他以其无人可模仿的独特风格发表了演说。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d3/5a/D35AB78E475DDE46E599642EF3ACFEF7.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inimitable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2475, 'iniquitous', NULL, '[adj. 不公正的,邪恶的]', 'Have you seen this bill? It\'s iniquitous !', '你看见这份帐单了吗?简直是漫天要价!', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e3/ab/E3ABC51C357FAFD242E3C17B921434A2.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/iniquitous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2476, 'iniquity', NULL, '[n. 邪恶,不公正,罪行]', 'He thought of New York as a den of iniquity.', '他认为纽约是个藏污纳垢之处。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c0/c3/C0C3759C32CAB49A88B8081DC27AB8DD.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/iniquity--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2477, 'injustice', NULL, '[n. 不公正,不公正的行为]', 'He struggled against every injustice.', '他与一切不公正行为作斗争。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9b/7b/9B7B288689813306D6143D841AAC3F8B.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/injustice--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2478, 'inkling', NULL, '[n. 暗示,略知]', 'I will try to give you an inkling.', '我会试着给你一些提示。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/28/3e/283EBA638C925D106F8FE6C183652438.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inkling--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2479, 'innate', NULL, '[adj. 天生的,固有的]', 'Ability is not innate, but comes through practice.', '本事不是天生的,是锻炼出来的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f3/de/F3DE4F269948F026D903D90837B53727.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/innate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2480, 'innermost', NULL, '[adj. 内心的,最里面的]', 'He confided his innermost secrets to her.', '他向她倾吐了内心深处的秘密。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/56/57/5657E301AF39D38118C593EEDD0E609B.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/innermost--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2481, 'innocuous', NULL, '[adj. 无害的,无毒的,无恶意的]', 'It seemed a perfectly innocuous remark.', '那像是一句毫无恶意的话。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c1/a5/C1A592A9473C2432F5659CC0547A593E.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/innocuous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2482, 'innuendo', NULL, '[n. 影射,暗讽]', 'Mark told by innuendo that the opposing team would lose the game', '马克暗讽地说敌队会在比赛中输掉。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/87/f6/87F661137872CFD7EB44958F1D2F8FE5.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/innuendo--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2483, 'inoculate', NULL, '[v. 给 ... 注射疫苗,灌输]', 'A corps of doctors arrived to inoculate the recruits.', '一队医生来给新兵打防疫针。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/6c/ff/6CFF492E4F7BEDE2932638B0EEB1FD09.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inoculate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2484, 'inoffensive', NULL, '[adj. 不冒犯人的,不让人讨厌的]', 'He never killed an inoffensive animal.', '他从不打死一只无害的野兽。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/eb/c7/EBC76A44F8D54ED0AF9CE8C10824C52E.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inoffensive--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2485, 'inordinate', NULL, '[adj. 过度的,过分的]', 'She had an inordinate fondness for junk food.', '她喜欢吃零食到了无节制的程度。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/35/92/3592B36E01203BAB1907FBB74CE9FC39.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inordinate--_gb_1.mp3');
