INSERT INTO `MASTER` VALUES (2487, 'insatiable', NULL, '[adj. 不知足的,贪求无厌的]', 'His thirst for knowledge is insatiable.', '他对知识的渴求不会满足。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/59/88/5988C18BC7DF6FEE210F991B7BE7031F.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/insatiable--_gb_1.mp3');
