INSERT INTO `MASTER` VALUES (2489, 'inscribe', NULL, '[v. 题写,题赠,题,刻]', 'Will you inscribe your name in the book?', '能否请你在这本书上签名?', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/24/56/2456E19C9460FFD45D8E427CB7F1D3B2.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inscribe--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2490, 'inscrutable', NULL, '[adj. 神秘莫测的,难以捉摸的]', 'The riddle remains inscrutable to us.', '那个谜对我们仍然是不可解的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/34/e6/34E6113991B84785EC0D0C940FE7EA00.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/inscrutable--_gb_1.mp3');
