INSERT INTO `MASTER` VALUES (2495, 'insincere', NULL, '[adj. 不真诚的,虚伪的]', 'Don\'t speak like that. It sounds insincere to me.', '别这样讲话,这样我听起来感到不诚恳。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d3/fa/D3FA574B9F8C6060D9DDC8076D7A0BDE.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/insincere--_gb_1.mp3');
