INSERT INTO `MASTER` VALUES (2500, 'insoluble', NULL, '[adj. 不能解决的,[化]不能溶解的]', 'These chemicals are practically insoluble in water.', '这些化学物质几乎不溶于水。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/36/61/3661652F12D9639B4EB5E42260A32996.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/insoluble--_gb_1.mp3');
