INSERT INTO `MASTER` VALUES (2522, 'insulting', NULL, '[adj. 侮辱的]', 'Her insulting remarks cut me to the quick.', '她那些带侮辱性的语言很伤害我的感情。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/66/f6/66F6CEA5C8A91447222E391AF5B501EB.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/insulting--_gb_1.mp3');
