INSERT INTO `MASTER` VALUES (2619, 'irrelevant', NULL, '[adj. 不相关的,不重要的]', 'Never pad out your essay with irrelevant details.', '千万别用不相干的细节来拉长文章。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/35/9c/359CA3B39CA404D3EF8BE248C5C2B39A.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/irrelevant--_gb_1.mp3');
