INSERT INTO `MASTER` VALUES (2968, 'navigable', NULL, '[adj. 可航行的,适于航行的]', 'The river is navigable during the rainy season.', '该河在雨季可以通行。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a0/fc/A0FCE5A5B3180184E3A1F627FBE95863.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/navigable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2969, 'naysay', NULL, '[n. 拒绝,否认][v. 拒绝,否认]', 'They will naysay any policy that includes the use of nuclear weapons. ', '他们将反对任何涉及到使用核武器的政策。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a6/cd/A6CD6457DB2450F2260136F744CA2B5B.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/naysay--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2970, 'nebulous', NULL, '[adj. 模糊的,不清楚的]', 'Ideas of fairness in taxation are usually nebulous.', '公平这一概念在税收领域一向是模糊不清的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/93/87/93872BF2188A6A823D085D35B12580A5.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/nebulous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2971, 'necessitous', NULL, '[adj. 贫困的,贫穷的]', 'The bishop planned to visit necessitous areas of the city. ', '主教打算走访城市里的贫困地区. ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d0/70/D070637CB9F193C88D4D9073794F2574.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/necessitous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2972, 'nefarious', NULL, '[adj. 违法的,邪恶的]', 'He guarded his nefarious doings from view.', '他不让自己的罪恶行径给人看到。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/81/0b/810BCF701E32B9C69F4CEBC14E981020.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/nefarious--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2973, 'nemesis', NULL, '[n. 报应,应得的惩罚]', 'To follow the proposed course of action is to invite nemesis.', '按照别人建议的行动步骤而行动就是自找报应。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b1/47/B1474D1F3B476CD46E650870DF35D7B1.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/nemesis--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2974, 'neoclassical', NULL, '[adj. 新古典主义的]', 'The house is decorated in neoclassical style.', '这座房子装修为新古典主义风格。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e4/4f/E44FA2C2DC628079DE7EAE264C108085.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/neoclassical--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2975, 'neolithic', NULL, '[adj. 新石器时代的]', 'Cattle were first domesticated in Neolithic times.', '新石器时代有人开始驯养牛。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ef/bc/EFBC2FCEFF7BF4FE4DFECE7B9A7A6BC0.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/neolithic--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2976, 'neologism', NULL, '[n. 新词,新意]', 'I don\'t think these neologisms worth passing on to beginners.', '我认为这些新词不值得教给初学者。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/89/3d/893D5CE2ED4060FC50812A33E3EF2E67.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/neologism--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2977, 'neon', NULL, '[n. 霓虹灯]', 'Helium and neon are inert gases.', '氦和氖为惰性气体。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/79/5e/795EA7A0F1B14A30DBDE2F678D816038.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/neon--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2978, 'neonate', NULL, '[n. 初生婴儿]', 'Hemolytic icterus occurs in the neonate of the horse and swine. ', '溶血性黄疸发生于马和猪的初生幼畜。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/cc/b2/CCB28CB86912B3A9404C19456744ABB8.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/neonate--_gb_1.mp3');
