INSERT INTO `MASTER` VALUES (2980, 'nethermost', NULL, '[adj. 最低的,最下方的]', 'Put your clothes in the nethermost drawer.', '把你的衣服放在最下面的抽屉里。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ea/ab/EAAB88DD3A6BEFDBB8C1B11B4ED94BB7.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/nethermost--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2981, 'neurologist', NULL, '[n. 神经病学家]', 'The neurologist is wrong about a neurological problem. ', '一个神经科专家在一个神经学上的问题上错了? ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/50/40/50406C49C545536DBD6E9A342A34FAA2.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/neurologist--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2982, 'neurology', NULL, '[n. 神经学,神经病学]', 'The study appears online in the journal Neurology.', '研究发表于神经学期刊线上版。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/62/a3/62A3711E44B194B3D27C017F2227C099.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/neurology--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2983, 'neuron', NULL, '[n. 神经元,神经细胞]', 'Impulse acts as a message sent through a neuron.', '冲动相当于通过神经元传送的信息。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/3f/c9/3FC9B8D2212630F5DF82F5E0C5AC6BE2.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/neuron--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2984, 'neurosis', NULL, '[n. 神经症,神经衰弱症]', 'He is majoring in the treatment of medical neurosis.', '他主修的是神经官能症的治疗。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/bf/01/BF01EAE1B82C72C0A72546FDE36A036D.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/neurosis--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2985, 'neurotransmitter', NULL, '[n. 神经传递素]', 'A neurotransmitter must be present within the presynaptic neuron.', '突触前神经元必须存在神经递质。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/78/f2/78F20DD47BB7F1FB888DED85FB37FB66.mp3', 0, 16, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/neurotransmitter--_gb_1.mp3');
