INSERT INTO `MASTER` VALUES (2987, 'newsletter', NULL, '[n. (某组织的)内部通讯,简讯]', 'She is reading an article in the club newsletter.', '她正在读俱乐部时事通讯上的一篇文章。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/19/37/1937FAB0D62AD016B64A60185D7FF475.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/newsletter--_gb_1.mp3');
