INSERT INTO `MASTER` VALUES (2989, 'newsworthy', NULL, '[adj. 有新闻价值的]', 'It is newsworthy because it reflects a cultural attitude.', '它具有新闻价值是因为它折射出了一种文化态度。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f4/45/F44563B6E718D35DD5E6C5D34D181360.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/newsworthy--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2990, 'nibble', NULL, '[v. 一点点地咬,轻咬,蚕食]', 'He didn\'t answer, but just continued to nibble at his food.', '他没有回答,只是继续一点一点地吃东西。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ef/43/EF43472B2BBE7FC309D3696983BD9F83.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/nibble--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2991, 'niche', NULL, '[n. 壁龛,称心的工作]', 'This is a stupa niche from the Sui Dynasty.', '你看这是隋代的塔龛。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/26/a7/26A78E719BAA6DFF6BF53F6646D3253B.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/niche--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2992, 'nicotine', NULL, '[n. 尼古丁]', 'Smokers who inhale are likely to become addicted to nicotine.', '吸烟的人容易对尼古丁上瘾。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/3c/00/3C00CAB4530C2D537E213BC10956CF11.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/nicotine--_gb_1.mp3');
