INSERT INTO `MASTER` VALUES (2995, 'niggling', NULL, '[adj. 麻烦的,琐碎的]', 'I work hard and I always train even if I\'ve got a niggling injury.', '我很努力,即便有点小伤也还坚持训练。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e3/a1/E3A12C42E39D8FF8847B17F3D7BECB0F.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/niggling--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (2996, 'nimble', NULL, '[adj. 敏捷的,伶俐的,机敏的]', 'He is a nimble climber.', '他是个敏捷的登山者。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8a/f7/8AF778021417FA7D08B061AEC8152194.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/nimble--_gb_1.mp3');
