INSERT INTO `MASTER` VALUES (3001, 'nonchalance', NULL, '[n. 不关心,无动于衷,冷淡]', 'Some journalists criticize her nonchalance and indifference.', '一些记者批评她的冷淡与漠不关心。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4d/48/4D485655A63B4C36AC4AA1E5986E8F19.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/nonchalance--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3002, 'nonchalant', NULL, '[adj. 无动于衷的,漠不关心的]', 'He immediately remarked with the most nonchalant air.', '他接着就装出十分冷静的模样说了话。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0f/29/0F2948B52BE75F2BEDBE196EA0B60EFC.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/nonchalant--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3003, 'nonchalantly', NULL, '[adv. 不激动地,冷淡地]', 'She shrugged nonchalantly and turned away. ', '她毫不在乎地耸耸肩,扭头走了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c4/77/C477EB12456AEB0E43FAB71FEAFCD2DC.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/nonchalantly--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3004, 'noncommittal', NULL, '[adj. 态度暧昧的,含糊的]', 'I asked him if he approved of our plan,but he was noncommittal.', '我问他是否赞同我们的计划,但他态度不明朗。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2e/8d/2E8DA581E6A1FDC24AFB7FC9DE8BE61A.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/noncommittal--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3005, 'nonconformist', NULL, '[adj. 不墨守成规的]', 'A Nonconformist chapel, especially a Baptist or Methodist one.', '非英国国教的教堂,尤指浸信会或卫理公会教徒。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/23/31/233162C97835153BC5E0B1461871FD7D.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/nonconformist--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3006, 'nonconformity', NULL, '[n. 不墨守成规]', 'Lovelock\'sprincipled nonconformity can be traced to his childhood.', '洛夫洛克自成一套的特立独行可以追溯到他的童年时期。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/84/e8/84E865C23F38D0B658A316E61EC7E8CC.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/nonconformity--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3007, 'nonentity', NULL, '[n. 无足轻重的人]', 'How could such a nonentity become chairman of the company?', '这样的庸才怎麽能当公司的董事长?', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7c/25/7C2544AB13D5BEDA68B44A1DBBFB13DC.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/nonentity--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3008, 'nonfiction', NULL, '[n. 纪实文学]', 'Nonfiction primarily Fiction combined is Adventure of Travel.', '非小说的散文文学主要地联合的小说是旅行的冒险。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f6/e1/F6E1DC49054E164E615F3EA96DA9FCDA.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/nonfiction--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3009, 'nonflammable', NULL, '[adj. 不燃烧的]', 'A nonflammable, sheet material. ', '是一种难燃的片状材料。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/81/62/816280296CDE1B1B760EBD36E6CB7DDB.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/nonflammable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3010, 'nonhuman', NULL, '[adj. 非人类的]', 'Nonhuman primate data also indicated that the approach was safe.', '非人类灵长动物的试验结果也显示了其安全性。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/14/30/1430AC008AD5E785D0F7F5BC86CA3449.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/nonhuman--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3011, 'nonplus', NULL, '[vt. 使困惑,使为难][n. 迷惑,困惑]', 'The professor is never at a nonplus, and never perplexed by a problem.', '那位教授从来不会感到困惑,也不会被任何问题所难倒。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9a/b9/9AB980041051BB6D2EB7863CF936E818.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/nonplus--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3012, 'nonplussed', NULL, '[adj. 不知所措的,进退维谷的]', 'The speaker was completely nonplussed by the question. ', '演讲者被这个问题完全难倒了。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/75/43/75433770051E64BE932FC6884ABAD628.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/nonplussed--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3013, 'nonporous', NULL, '[adj. 无孔的]', 'These nonporous surfaces paint badly with a brush.', '这些无孔的表面很难以刷子上漆。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8f/ec/8FEC00C40E83C4D234E716646AF6EE16.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/nonporous--_gb_1.mp3');
