INSERT INTO `MASTER` VALUES (3065, 'obviate', NULL, '[v. 排除,消除,避免]', 'By far,it can\'t obviate seismic possibility.', '到目前为止,还不能排除地震的可能性。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/78/7b/787B11A9B8A9103F6D19008A158937A2.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/obviate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3066, 'occlude', NULL, '[v. 使闭塞,堵塞]', 'The tourniquet should occlude venous and lymphatic return. ', '止血带应阻断静脉及淋巴回流. ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a4/ac/A4ACB15F9D18BDA75A33128E2BC126D6.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/occlude--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3067, 'occult', NULL, '[adj. 神秘的,超自然的]', 'He and the black-leather fellow looked very occult.', '他和那个象黑皮革似的家伙显得很神秘。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/cc/04/CC04ADF47A159C75276EFF7111A50397.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/occult--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3068, 'octopus', NULL, '[n. 章鱼]', 'One octopus has eight tentacles.', '一条章鱼有八根触角。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/bf/85/BF8544CB46FD2329BD130FDB39E23B49.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/octopus--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3069, 'ocular', NULL, '[adj. 眼(睛)的,视觉的]', 'The ocular defects made him lose the chance for the job.', '视力缺陷让他失去了这个工作的机会。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/08/7c/087CB0BA2BD51390A8AA60C9CA67F3CD.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/ocular--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3070, 'ode', NULL, '[n. 颂诗,颂歌]', 'I am reading \'Ode to Autumn\' written by Keats.', '我在读济慈的“秋颂”。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/fa/17/FA17CC51063F996DC277FF21E7309A26.mp3', 0, 3, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/ode--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3071, 'odious', NULL, '[adj. 可憎的,讨厌的,令人作呕的]', 'His character could best be described as odious.', '他的人格用可憎来形容最贴切。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0a/c1/0AC1914613C91D6AAE35F85F9737A811.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/odious--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3072, 'odium', NULL, '[n. 憎恶,厌恶]', 'He incurred the odium of everyone by sacking the old caretaker.', '他因解雇老管理员而激起公愤。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/59/21/59214A17FF81C8CC425055474628DA33.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/odium--_gb_1.mp3');
