INSERT INTO `MASTER` VALUES (3074, 'odoriferous', NULL, '[adj. 有香味的,芳香的]', 'The odoriferous spices stimulated her jaded appetite. ', '香料的芬芳刺激她疲惫的胃口. ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a1/ca/A1CA135EEDBA495E01657E862CB26D91.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/odoriferous--_gb_1.mp3');
