INSERT INTO `MASTER` VALUES (3077, 'offbeat', NULL, '[adj. 不寻常的,非常规的,非正统的]', 'His style is offbeat but highly creative.', '他的风格很不寻常但非常有创造力。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/46/8a/468AFF23CD83755ED60E938B428C59C3.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/offbeat--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3078, 'offhand', NULL, '[adj. 漫不经心的][adv. 不假思索地]', 'But this offhand explanation was not strictly true.', '不过这个搪塞的解释并不完全正确。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8a/5b/8A5B3271A97FF371FAA5BF863FDABD42.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/offhand--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3079, 'officious', NULL, '[adj. 好管闲事的,爱指手画脚的]', 'He is a harsh man, at once pompous and officious.', '他是个严酷的人,既自负又爱管闲事。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ce/40/CE40FB4F1E4089EEFA11F7569B8AA689.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/officious--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3080, 'offish', NULL, '[adj. 冷淡的,疏远的]', 'He can be quite stand-offish and rude, even to his friends.', '他有时会很冷淡,很粗鲁,甚至对自己的朋友也是如此。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a1/7e/A17EA5FAB163FA906EA4C6D55C726E83.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/offish--_gb_1.mp3');
