INSERT INTO `MASTER` VALUES (3093, 'onerous', NULL, '[adj. 繁重的]', 'Overtime work is often onerous, though it is well paid.', '报酬很好,但常常是很繁重的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/41/c9/41C91C346373454131666557E44A6025.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/onerous--_gb_1.mp3');
