INSERT INTO `MASTER` VALUES (3112, 'oracular', NULL, '[adj. 神谕的,高深莫测的]', 'To us this oracular remark seemed to herald Hitler.', '这番玄妙深奥的话在我们看来仿佛预示着希特勒的来临。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b9/2a/B92ADE4ECC1B0AF75A842BA0081EAEED.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/oracular--_gb_1.mp3');
