INSERT INTO `MASTER` VALUES (3124, 'osmosis', NULL, '[n. 渗透,渗透性,潜移默化]', 'My mother taught me about the science of osmosis.', '妈妈教我渗透的科学原理。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/00/ad/00AD7F10F88C8DB41472A9E66C058803.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/osmosis--_gb_1.mp3');
