INSERT INTO `MASTER` VALUES (3128, 'ostensible', NULL, '[adj. 表面的,假装的]', 'The ostensible reason wasn\'t the real reason.', '表面上的理由并不是真正的理由。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/45/e7/45E710851A87BD3A479DE57453536959.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/ostensible--_gb_1.mp3');
