INSERT INTO `MASTER` VALUES (3130, 'ostentatious', NULL, '[adj. 奢华的,炫耀的,招摇的]', 'Their daughter was ostentatious on her wedding reception.', '他们的女儿在办婚事时摆阔。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0e/98/0E9850B46BF7DF350E4A547FF29D72CC.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/ostentatious--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3131, 'ostracism', NULL, '[n. 排斥,排挤,孤立]', 'They face tougher sanctions and ostracism from the civilized world. ', '他们面临更严厉的制裁和文明世界的排斥。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/80/3c/803C497329C1C95464448F6BE9B6EF79.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/ostracism--_gb_1.mp3');
