INSERT INTO `MASTER` VALUES (3135, 'outburst', NULL, '[n. 爆发,突发,(感情)迸发]', 'His rash outburst incurred the displeasure of the judge.', '他勃然大怒使法官不悦。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/1f/c8/1FC8C2FAB86A425D2DE9454FFF238D68.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/outburst--_gb_1.mp3');
