INSERT INTO `MASTER` VALUES (3149, 'outsell', NULL, '[v.  比…卖得多,销量胜过]', 'This model outsells all others on the market.', '这种型号在市场上较其他型号畅销。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/70/4e/704E6BC683977B84B0DC8E4702C4721A.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/outsell--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3150, 'outshine', NULL, '[v. 比…更优秀,比…更出色,胜过]', 'You can never be afraid that someone\'s going to outshine you.', '你决不能害怕将有人会超越你。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/14/69/1469EC3CA1A6D9DE60E7C4BC551C8650.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/outshine--_gb_1.mp3');
