INSERT INTO `MASTER` VALUES (3152, 'outweigh', NULL, '[v. 比 ... 重要,比 ... 有价值]', 'The merits of your plan outweigh the defects.', '你制定的计划其优点胜过缺点。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e3/b4/E3B449BBE3A8F5B2FA796956D40989D4.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/outweigh--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3153, 'outwit', NULL, '[v. 智胜,用计击败(或超过)]', 'Two prisoners outwitted their guards and got away.', '有两个囚犯设计欺骗了警卫而逃走了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/72/2c/722C8BF678EDBF6915077184B55B0094.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/outwit--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3154, 'overawe', NULL, '[vt. 使极为敬畏,使胆怯]', 'Don\'t be overawed by people in authority.', '不管当官儿的职权有多大,都不要被他们吓倒。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/10/dc/10DCC854CCF79519AE5471FCA66A814A.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overawe--_gb_1.mp3');
