INSERT INTO `MASTER` VALUES (3156, 'overbear', NULL, '[v. 威压,压服]', 'With his huge body, he overbore his opponent under him dead.', '他用他那庞大的身躯把对手死死地压在身下。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/86/d5/86D56CAB6357EAE38E964049912D662B.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overbear--_gb_1.mp3');
