INSERT INTO `MASTER` VALUES (3160, 'overcast', NULL, '[adj. 多云的,阴沉的,阴天的]', 'Overcast mornings are the sure forerunners of steady rain.', '早晨阴天预示肯定下雨。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4d/12/4D126A76687808D9175C98EF96A5E629.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overcast--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3161, 'overcharge', NULL, '[v. 对…要价(或收费)过高]', 'They overcharged me (by) 1 for the shopping.', '我买东西他们多要了我1英镑。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c7/f0/C7F0F28C92583020511EE5E63C3CFC27.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overcharge--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3162, 'overconfident', NULL, '[adj. 自负的,过于自信的]', 'She warned me against being overconfident. ', '她告诫我不要过于自信。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c8/13/C81348DCB7A59748ED7E84B62D2C2A62.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overconfident--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3163, 'overcrowded', NULL, '[adj. 过度拥挤的]', 'Traffic in Japan\'s overcrowded cities has rarely moved so easily.', '在日本过度拥挤的城市中交通问题从没这么简单解决过。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/67/9b/679B40115AB892411A3EE15BB8396A43.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overcrowded--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3164, 'overdraft', NULL, '[n. 透支]', 'He has a huge overdraft to pay off.', '他有一大笔透支要偿还。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/72/4b/724B22ADD148F55D692E6604E8705045.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overdraft--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3165, 'overdraw', NULL, '[v. 透支]', 'Customers who overdraw their accounts will be charged a fee.', '透支的存户须付手续费。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/cf/c8/CFC8F889892A086C465BD086859791D6.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overdraw--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3166, 'overemphasize', NULL, '[v. 过分强调]', 'It\'s inadvisable to overemphasize this point.', '这一点不宜过分强调。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4f/50/4F5044C675B7001183DC2910B2687A33.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overemphasize--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3167, 'overestimate', NULL, '[v. 过高估计,过高评价]', 'I overestimated the amount of milk we\'d need for the weekend.', '我过高估计了我们周末的用奶量。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ee/a7/EEA7AADB5CB034B7394871BE0DE36B78.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overestimate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3168, 'overfill', NULL, '[v. 装得太多,装到满溢,充满]', 'Do not overfill as boiling water may be ejected.', '在烧水时请不要将水加得过满,因为这样可能会使水溢出。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a2/ad/A2ADEE0ACC9AE6DE645DCBD744B0B20E.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overfill--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3169, 'overgraze', NULL, '[vt. 过度放牧]', 'If land is overgrazed , it will be damaged.', '如果土地被过度放牧,就会遭到破坏。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c7/17/C7177C279B03EA701CDE4353110D15C3.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overgraze--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3170, 'overinflated', NULL, '[adj. (价格)过高的,过度充气的,夸大的]', 'Overinflated tyres burst more easily.', '充气过量的轮胎更容易爆裂。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ad/69/AD691DDBE70D3289B05BE6425ACA3FA0.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overinflated--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3171, 'overlapping', NULL, '[adj. 相互重叠的]', 'There is no overlapping question between the two courses.', '这两门课程之间不存在重叠的问题。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f8/9a/F89ADB6FB4064F9528DEA63E286D1218.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overlapping--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3172, 'overlie', NULL, '[v. 叠加于,置于…上面]', 'The granite overlies the older rocks.', '花岗岩覆盖着旧岩石。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/80/27/8027ECA0A36E941943472B3740A246B8.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overlie--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3173, 'overload', NULL, '[v. 使超载,使负担过重][n. 过多,超载]', 'That overloaded truck jibbed at the steep hill.', '那辆超载的卡车爬不上陡坡。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9c/41/9C41361E65A7A2ED6852AEAF51C3A93F.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overload--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3174, 'overpower', NULL, '[v. (以力量)制服,使难以承受]', 'One justice can overpower a hundred evils.', '一正压百邪。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/56/f4/56F4ACAAACBDD302BA891F0148F2BC00.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overpower--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3175, 'overpowering', NULL, '[adj. 强烈的,不可抗拒的,专横的]', 'It was as overpowering and imaginative as homesickness.', '那像思乡一样,是一种压倒一切的遐想。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/94/cf/94CF7C46F0C6937A21C9AC5419C00FA7.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overpowering--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3176, 'overrate', NULL, '[vt. 评价过高,高估,估价过高]', 'However, we should not overrate the role of the proposed law.', '尽管如此,我们也不能对草案可以发挥的作用评价过高。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/fe/93/FE93182831087C69A5C499BF8B92F677.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overrate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3177, 'overreach', NULL, '[v. 使(自己)因目标过高而失败]', 'Cleverness may overreach itself.', '聪明反被聪明误。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/10/39/103972E42520E55BD6F99EB11B643C88.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overreach--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3178, 'overriding', NULL, '[adj. 最主要的]', 'Development is of overriding importance. ', '发展是硬道理', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f2/1b/F21B511114850C5F18C3611A9F820E64.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overriding--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3179, 'overrule', NULL, '[v. 否决,驳回,宣布…无效 ]', 'We were overruled by the majority.', '我们的意见被多数人否决了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2c/3a/2C3AE051F7DEE29194088172BF480C4A.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overrule--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3180, 'overshadow', NULL, '[v. 给…蒙上阴影,使黯然失色]', 'Large oak trees overshadow the garden.', '高大的栎树把花园遮得很暗。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/49/a9/49A9DC5CFF8D33D152204400E5FBB14A.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overshadow--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3181, 'overtax', NULL, '[v. 使用过度,对…征税过重]', 'A good coach has to make sure not overtax his star players. ', '一个好的教练必须确保不会对他的明星球员造成过高的负担。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/82/5a/825A8DFE7EC4A62734D410ECEF2E80FC.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overtax--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3182, 'overtire', NULL, '[vt. 过于疲劳]', 'After your operation, you must be careful not to overtire yourself.', '手术后,你一定要当心不要让自己过分劳累。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/48/7b/487B7D42B7EFE7A1F0A7A1FB425D71BC.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overtire--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3183, 'overture', NULL, '[n. 序曲,前奏曲,友好姿态,建议]', 'Many spokesmen attacked consumingly this overture.', '大会上许多的发言人强烈抨击了这项提案。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/fe/bb/FEBBAB6DF02D9597E6E8B4703E525A88.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overture--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3184, 'overview', NULL, '[n. 概观(况),总结]', 'This page gives an overview about the company.', '这一页将向客户介绍公司的大致情况。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/96/22/962242098068FA5956F7636A8513ECC3.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overview--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3185, 'overweening', NULL, '[adj. 自负的,过度自信的]', 'The overweening enemy will soon learn this to his cost.', '关于这一点,傲视一切敌人不久就要得到惨痛的教训。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8a/be/8ABE00646A2D6F9BBBB48E2F6B5A0AD8.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overweening--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3186, 'overwork', NULL, '[n. 过度操劳,过度工作]', 'She was worn down by overwork.', '她因过度劳累而垮了下来。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7f/89/7F890422C250135F93094FB3D69FDAE6.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overwork--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3187, 'overwrought', NULL, '[adj. 过分忧烦的,过于激动的]', 'She was in a very overwrought state after the accident.', '事故发生后她精神十分紧张。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8f/7d/8F7DF1A32B1342FD64133F944EF62B39.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/overwrought--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3188, 'oxen', NULL, '[n. 牛]', 'Plows are still pulled by oxen in some countries.', '在一些国家犁头仍由牛拖拉。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f1/5e/F15E11E51A00B4362B2B2F10A6C70453.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/oxen--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3189, 'oxidize', NULL, '[v. 氧化,生锈]', 'The dye is allowed to oxidize before the next dip.', '染料允许在下个垂度之前氧化。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/fd/93/FD93E5713E8F7DFF74F2226509AFB6C3.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/oxidize--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3190, 'oyster', NULL, '[n. 牡蛎]', 'That oyster closed up its valves.', '那个牡蛎把壳合拢起来。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/1e/96/1E9600DAA9949A4C3B5146C02510E415.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/oyster--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3191, 'pacifist', NULL, '[adj. 非战主义的][n. 和平主义者]', 'Pacifist movements gathered strength in Norway.', '在挪威,和平主义的运动力量逐渐增强。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b8/f9/B8F9ED7B59EAB9256F4051ECDFDCFD78.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pacifist--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3192, 'pacify', NULL, '[v. 使 ... 平静,抚慰,安慰]', 'She knew that he had become delirious, and tried to pacify him.', '她知道他已经神志昏迷起来了,极力想使他镇静下来。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ab/57/AB5722AAFBDCEF26AD5B6FC43A671799.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pacify--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3193, 'packed', NULL, '[adj. 塞满的,收拾好行李的,紧压的]', 'The chaplain came and preached to a packed church.', '牧师来给挤满教堂的人们讲道。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/51/d4/51D4CCF136931953C4F9A6D476C026DE.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/packed--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3194, 'packer', NULL, '[n. 包装者,包装机]', 'Do they have to send the dates to a specialist packer for packing?', '供货商是否还要把蜜枣送到包装商那儿去包装?', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/cf/c0/CFC0C19966EA50563F882B337339E9C0.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/packer--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3195, 'paddler', NULL, '[n. 涉水者,涉泥浆者,划独木舟者]', 'My old brother is a skilful paddler.', '我哥哥是个技术娴熟的桨手。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/08/1e/081E1784B1AA41C2869CB3896C6449BE.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/paddler--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3196, 'paean', NULL, '[n. 欢乐歌,赞美歌]', 'It is a paean of the history of mankind.', '那是人类历史上不断重演着的赞歌。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/3c/7f/3C7FC18457BF559F8D6E77AC9289B010.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/paean--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3197, 'pagan', NULL, '[n. 无宗教信仰者][adj. 异教徒的]', 'Dymphna was a virgin daughter of a pagan king.', '邓娜是一位异教徒国王的女儿,并且还是处子之身。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7a/8e/7A8EAD1B71C36A935F4F51A9A547B0BF.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pagan--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3198, 'painstaking', NULL, '[adj. 勤勉的,小心的][n. 工夫]', 'Forensic experts carried out a painstaking search of the debris.', '法医专家对残骸进行了极其仔细的搜索。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/36/44/364475788938261B38CC8F948B12D73C.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/painstaking--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3199, 'painstakingly', NULL, '[adv. 费力地,苦心地]', 'Broken bones were painstakingly pieced together and reshaped.', '断骨被十分小心地接合复位。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a5/c2/A5C2F4581F7F3A5B9B4CD54C5469DF62.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/painstakingly--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3200, 'palatable', NULL, '[adj. 美味的,使人愉快的,如意的]', 'Mother provides palatable meals for our family every day.', '母亲每天为家人烹制美味的三餐。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/02/d6/02D6E14DDAE5BBD2967F57755597CEB5.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/palatable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3201, 'palate', NULL, '[n. 上颚,味觉,口味]', 'There is something wrong with my palate.', '我的上颚有些不适。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/bc/2b/BC2BA895BF52352F1390C10315E5B6E6.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/palate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3202, 'palatial', NULL, '[adj. 宫殿般的,宏伟的]', 'He shares this palatial apartment with me.', '他和我合住这间宫殿一般的房间。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/3a/ac/3AACA5247D0F6E73D4C82EEA9C8D1EBB.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/palatial--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3203, 'palaver', NULL, '[v. 空谈,奉承][n. 谈判,空谈,奉承]', 'I know that he want to palaver on me,but i am not believe this.', '我知道他想要拍我马屁,但我才不吃那一套。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e6/fa/E6FA90AEFBF47CE1F0E9F18B1C65F068.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/palaver--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3204, 'paleolithic', NULL, '[adj. 旧石器时代的]', 'The stone balls were tools of hunting in Paleolithic times.', '石球是旧石器时代原始人用来狩猎的工具。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d2/37/D237FA4941A4AA9DE863A45EEF27A1CF.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/paleolithic--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3205, 'paleontologist', NULL, '[n. 古生物学者]', 'British paleontologist who worked in Tanzania. ', '在坦桑尼亚工作的英国古生物学家', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/26/6d/266DB92B120F590EEF485DF50411D575.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/paleontologist--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3206, 'palette', NULL, '[n. 调色板]', 'He picked his brushes and palette.', '他提起画笔和调色板。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/fc/66/FC6646D936B7E1B4960BACD6C9A2E150.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/palette--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3207, 'pall', NULL, '[n. 遮盖物][v. 变得平淡乏味,腻烦]', 'A pall of mystery seem to hang over it all.', '整个事件似乎笼罩上一层神秘的气氛。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/1f/45/1F45362C7C84869F7A68F58CE893CD2D.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pall--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3208, 'palliate', NULL, '[vt. 减轻,缓和,辩解]', 'I don\'t wish to palliate them, I assure you. ', '我不想掩饰, 我可以向你保证。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/cd/c7/CDC76FF36E8411A707E3CF131F53E0FA.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/palliate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3209, 'palliative', NULL, '[adj. 减轻的,缓和的][n. 缓和剂]', 'Treatment of electrical burns is palliative.', '电烧伤的治疗只起治标作用。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/48/21/48218D8464BF882DB7F73542EC7EDF57.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/palliative--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3210, 'pallid', NULL, '[adj. 苍白的,暗淡的,无生气的]', 'You look a bit pallid,do you feel all right?', '你脸色有点苍白,你没事儿吧?', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/43/f1/43F1F185451D63FB9FC8E88BD8E56EEB.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pallid--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3211, 'palpable', NULL, '[adj. 易觉察的,可摸到的,明显的]', 'The tension in the room was almost palpable.', '屋子里的紧张气氛几乎能感觉到。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c2/cc/C2CC916BA855E1E0F2A7C03C434D63C0.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/palpable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3212, 'palpitate', NULL, '[vi. 悸动,心跳,发抖]', 'He felt suddenly faint, and his heart began to palpitate.', '他突然感到眩晕,心脏开始悸动。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8f/95/8F958D0A19241D052C90AAE0E2E649B3.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/palpitate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3213, 'paltry', NULL, '[adj. 微不足道的,琐碎的,无价值的]', 'His influence on this matter is paltry.', '他对这件事的影响是微不足道的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a3/76/A3762A8448996DA4202D003183FF3817.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/paltry--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3214, 'pamper', NULL, '[v. 纵容,溺爱]', 'Grandparents often pamper the children.', '祖母经常纵容这些孩子。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/54/d4/54D4F7121D8CF5C38B127485679E1E1F.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pamper--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3215, 'panacea', NULL, '[n. 万灵药,灵丹妙药]', 'There\'s no single panacea for the country\'s economic ills.', '国家经济弊病百出,并无万灵药可以医治。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/5f/97/5F971ACE75FB5CD9CA4B6B262C27485C.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/panacea--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3216, 'pancreas', NULL, '[n. 胰脏]', 'I didn\'t even know what a pancreas was.', '我当时甚至不知道胰脏究竟是什么。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b5/27/B5278F4688646592EA82F798368E1FDC.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pancreas--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3217, 'pandemonium', NULL, '[n. 喧嚣,极端混乱嘈杂的地方]', 'There was pandemonium when the news was announced.', '消息宣布後一片混乱。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f0/10/F010C44EDEE124C6B0A3E14817396E66.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pandemonium--_gb_1.mp3');
