INSERT INTO `MASTER` VALUES (3220, 'pang', NULL, '[n. 剧痛,悲痛,苦闷][v. 使剧痛]', 'She felt an acute pang in her arm.', '她感到手臂上一阵剧痛。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0c/4f/0C4F823EACC5D719C45455C01CE38C80.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pang--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3221, 'pantomime', NULL, '[n. 哑剧,童话剧][v. 打手势,演哑剧]', 'The actor is skilled in pantomime.', '这个演员擅长表演哑剧。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/76/1f/761FAB04BD5CBEE8DA6A6EB1037821FE.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pantomime--_gb_1.mp3');
