INSERT INTO `MASTER` VALUES (3228, 'parasitic', NULL, '[adj. 寄生的,靠他人为生的]', 'The mistletoe plant is a parasite on trees.', '槲寄生是寄生在树上的植物。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4d/86/4D866C460AC229769F70CECBC6C19CA2.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/parasitic--_gb_1.mp3');
