INSERT INTO `MASTER` VALUES (3305, 'perfunctory', NULL, '[adj. 敷衍的]', 'The little boy gave his face a perfunctory wash.', '这个小男孩敷衍地洗了把脸。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/25/16/251621F2A162462E19AAACFFCBB0160F.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/perfunctory--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3306, 'perimeter', NULL, '[n. 周长,周界,边缘]', 'Work out how long the perimeter of the playground.', '请你算一算体育场的周长是多少米?', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/34/a0/34A065B29A3028E278FB7E6F8BE2F913.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/perimeter--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3307, 'peripatetic', NULL, '[n. 巡行者,巡游][adj. 巡游的,兼职的]', 'Peripatetic music teachers visit the school regularly.', '兼职音乐教师定期到校授课。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0c/91/0C9175F8C1A62C27A64E33AA0CE11C9B.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/peripatetic--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3308, 'peripheral', NULL, '[adj. 外围的,不重要的][n. 外围设备]', 'We dealt with the peripheral aspects of a cost reduction program.', '我们谈到了降低成本计划的一些外围问题。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/33/bc/33BC5B511FBEA1B035260F75D2A0A675.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/peripheral--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3309, 'periphery', NULL, '[n. 周边,边缘,外围]', 'The US cordons China\'s periphery.', '美国在中国周边都画上了警戒线。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4e/11/4E1108F894075226D2EED93EB4294C35.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/periphery--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3310, 'perishable', NULL, '[adj. 易腐烂的,会枯萎的,会死的]', 'Perishable goods are piling up at the docks.', '码头上易腐烂的货物堆积如山。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a1/48/A1483B5D95902167BB9E49110D6CA5B1.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/perishable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3311, 'perishing', NULL, '[adj. 严寒的,不耐烦的]', 'He\'s too perishing mean to pay his share.', '他小气极了,连自己的那份钱也不付。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/92/c7/92C727E21C47C3E91C2C13E977F5954B.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/perishing--_gb_1.mp3');
