INSERT INTO `MASTER` VALUES (3313, 'perjury', NULL, '[n. 伪证罪,伪誓,背信弃义]', 'Two key witnesses at her trial committed perjury. ', '在对她的庭审中有两名主要证人犯了伪证罪。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/25/f8/25F8224FB969FD787F143D871E75F555.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/perjury--_gb_1.mp3');
