INSERT INTO `MASTER` VALUES (3315, 'perky', NULL, '[adj. 活泼的,得意洋洋的]', 'She hasn\'t been her usual perky self lately.', '她最近不像平常那样有精神。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d7/44/D744D4DE53B38F4D0BA8CD5611312014.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/perky--_gb_1.mp3');
