INSERT INTO `MASTER` VALUES (3318, 'perpendicular', NULL, '[adj. 垂直的,陡峭的][n. 垂直线]', 'The wall is usually perpendicular.', '墙通常是垂直的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/1e/57/1E57D45A137C98E0638F6EA22C35EC58.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/perpendicular--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3319, 'perpetrate', NULL, '[vt. 做(坏事),犯(罪)]', 'Only an insane person could perpetrate such a horrible crime.', '只有疯子才犯这种令人发指的罪行。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/dc/af/DCAFCF3C8971236B894CC66E1FC692C2.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/perpetrate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3320, 'perplexing', NULL, '[adj. 使人困惑的,麻烦复杂的]', 'The whole affair is very perplexing.', '整件事令人感到莫名其妙。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b6/95/B695E26B608FBEBAC32514778331F542.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/perplexing--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3321, 'perquisite', NULL, '[n. 额外补贴,临时津贴]', 'Perquisites include the use of the company car.', '福利包括可以使用公司的汽车。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/6a/6b/6A6BDF6DC26B7C5200F483B7995CE22B.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/perquisite--_gb_1.mp3');
