INSERT INTO `MASTER` VALUES (3448, 'poliomyelitis', NULL, '[n. 脊髓灰质炎,小儿麻痹症]', 'By 1995 poliomyelitis had been totally eliminated. ', '1995年,已消灭脊髓灰质炎.', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/17/52/1752956E0D0772B42C74C32379C577DF.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/poliomyelitis--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3449, 'polished', NULL, '[adj. 擦亮的,精练的,优美的]', 'I read her name on the polished brass plate.', '我在擦亮的黄铜门牌上看到了她的名字。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/21/57/2157FA951C164307900D7676B1DBA76C.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/polished--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3450, 'pollen', NULL, '[n. 花粉][vt. 授粉给]', 'Ben is allergic to pollen.', '班对花粉过敏。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/43/3d/433D9350D9BB1F20D822E2EF31093A9B.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pollen--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3451, 'pollinate', NULL, '[v. 给 ... 授粉]', 'Bees and butterflies pollinate the trees in the orchard.', '蜜峰与蝴蝶将果园里的树授粉。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/32/ff/32FFC8A9AE44D0C46AC901964C6A5A1B.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pollinate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3452, 'pollination', NULL, '[n. 授粉]', 'This brings difficulty to the promotion of bumblebee pollination.', '这给熊蜂授粉的推广带来困难。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/fc/40/FC40D47FE0E28B8081B15C9D85D9D0F8.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pollination--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3453, 'pollinator', NULL, '[n. 授花粉器,传粉者]', 'Flowers are often pollinated by bees.', '花常常由蜜蜂传授花粉。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/cd/ba/CDBADF5D9CDDD7CC7A35DF9AF148D89B.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pollinator--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3454, 'polygon', NULL, '[n. 多边形]', 'The following example draws a three-sided polygon.', '下面的示例绘制了一个三条边的多边形。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/04/dd/04DDE83B193279BCF2F2CFCC3B72AB46.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/polygon--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3455, 'polygonal', NULL, '[adj. 多角形的,多边形的]', 'The grains take on simple polygonal. ', '颗粒呈简单的多角形.', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/94/1b/941B66194C3CAC8B22CB1F4553B941F5.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/polygonal--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3456, 'pomposity', NULL, '[n. 自大,傲慢,炫耀]', 'The prince\'s manner was informal, without a trace of pomposity.', '王子的态度平易谦和,没有一点傲气。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e5/8c/E58CB8D2190D85038F5CF8B0AF8206FA.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pomposity--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3457, 'pompous', NULL, '[adj. 傲慢的,自大的,浮华的]', 'He\'s a real gentleman, if a little pompous at times.', '他可是个正人君子,虽然有时略显得傲慢了些。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ab/2e/AB2E5C04EBE8F453AFB4AC2E7CDADA5A.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pompous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3458, 'poncho', NULL, '[n. 斗篷,雨衣]', 'The original pattern in the book was a baby poncho.', '原本书上的织图是小宝贝的斗篷,', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0f/bb/0FBB68C48F6992A15111CF5A062CF5C3.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/poncho--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3459, 'ponderable', NULL, '[adj. 可秤的,有重量的,有价值的]', 'All ponderable bodies are constantly in motion in through space.', '所有有重量的物质都不断地处于运动中,贯穿空间。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c9/d9/C9D93E6C695CA7FC0A22639355251BDD.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/ponderable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3460, 'ponderous', NULL, '[adj. 笨重的,笨拙的,乏味的]', 'The elephant lowered its ponderous body into the water.', '大象把它那笨重的身躯浸入水里。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a2/78/A278C7B3B788332989D75B5EFC014744.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/ponderous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3461, 'pontifical', NULL, '[adj. 武断的,教皇的][n. 主教祭典用书]', 'The lawyer, with pontifical gravity, sat on a high chair.', '那律师摆出一副威严庄重的样子,坐在一把高脚椅上。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/cd/ff/CDFF6AA1B510B31863207DB16C59EF2B.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pontifical--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3462, 'poohed', NULL, '[adj. 疲倦的]', 'They are poohed on our scheme for raising money. ', '他们对我们的筹款方案嗤之以鼻. ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c9/e0/C9E0EB90186AF05E30508B71080A8058.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/poohed--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3463, 'populace', NULL, '[n. 平民,大众]', 'He attends the education of the populace by himself.', '第三,毛泽东亲身从事过平民教育。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/bd/10/BD10D83C197E8FA73E2B933C319B7A12.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/populace--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3464, 'popularize', NULL, '[vt. 普及,使流行,使通俗化]', 'We should popularize science on a grand scale.', '我们应该大规模普及科学。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ac/8f/AC8F6FAFBFEA83E02D60CBD61DE379D2.mp3', 1, 10, 0, 1, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/popularize--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3465, 'porcupine', NULL, '[n. 豪猪,箭猪]', 'A stormbound porcupine whimpered in a treetop.', '一只被风雪困住的豪猪在树上悲啼。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d2/f7/D2F7809193A410EAEB6BDD4C43FECB63.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/porcupine--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3466, 'pore', NULL, '[n. 毛孔,小孔][v. 熟读,钻研,沉思]', 'He was sweating through every pore.', '他每个毛孔都在冒汗。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/58/2b/582B9479507A1239F76673259ACDB52D.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pore--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3467, 'porous', NULL, '[adj. 可渗透的,多孔的]', 'Most soils and rocks are porous.', '大部分土壤和岩石都是多孔的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/40/10/4010296B96F74AA413F94E65D824F8E0.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/porous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3468, 'portend', NULL, '[vt. 成为...的前兆, 预知, 预警]', 'Black clouds portend a storm.', '乌云是暴风雨的前兆。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/5b/7b/5B7B2098A294EC1FA93CC559978313C1.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/portend--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3469, 'portentous', NULL, '[adj. 重大的,凶兆的,自负的]', 'The present aspect of society is portentous of great change.', '现在的社会预示着重大变革的发生。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/fa/b9/FAB9977D67E37CFF946AB43DB567FEA2.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/portentous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3470, 'portraitist', NULL, '[n. 肖像画家,人像摄影家]', 'Professor Huang is an excellant portraitist.', '黄教授是卓越的肖像画家。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f8/4e/F84ECB13543F577D7BB8C7D6EA82F4B4.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/portraitist--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3471, 'portraiture', NULL, '[n. 肖像画,肖像画法]', 'His portraiture is very expressive.', '他的肖像画颇能传神。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/19/b3/19B3D6B80E73AEC29360C88DC8E6B989.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/portraiture--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3472, 'posit', NULL, '[v. 假定][v. 安置]', 'Most religions posit the existence of life after death.', '大多数宗教都假定人死后生命仍存在。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4b/10/4B104CA51744D656A6919C126BD466CF.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/posit--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3473, 'positiveness', NULL, '[n. 肯定,信心,积极性]', 'Although his words are harsh, there is positiveness in them. ', '虽然他的话很苛刻, 但有建设性. ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/09/a5/09A52E2A2CCCE612F0E4B19CD7F6B526.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/positiveness--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3474, 'possessed', NULL, '[adj. 着魔的,冷静的,拥有的]', 'She was ranting and raving like she was possessed.', '她像着了魔似的大喊大叫。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/36/b5/36B5BED44C970DF0C3309967353DAFA0.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/possessed--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3475, 'postal', NULL, '[adj. 邮政的][n. 明信片]', 'The postal service here is very unreliable.', '这里的邮政服务很不可靠。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b2/dc/B2DC59F82F06D126BC086F6EDCEBDA6C.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/postal--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3476, 'postdate', NULL, '[vt. 把日期填迟,发生于...之后]', 'She let me postdate the cheque until the end of the month.', '她让我将支票上的日期填为月底。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d8/1b/D81B394D74581422CBAED7118787CDA7.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/postdate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3477, 'postgraduate', NULL, '[n. 研究生][adj. 研究生的]', 'She is a postgraduate at the University of Chicago.', '她是芝加哥大学的一名研究生。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/bb/02/BB0295728E56B716A6EAD70F9EF01A5A.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/postgraduate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3478, 'posthumous', NULL, '[adj. 死后的,死后出版的,遗腹的]', 'He received a posthumous award for bravery.', '他表现勇敢, 死后受到了嘉奖。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/93/4a/934AE01687B6C6566849410956F42AD9.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/posthumous--_gb_1.mp3');
