INSERT INTO `MASTER` VALUES (3480, 'postmaster', NULL, '[n. 邮政局(所)长]', 'He is the postmaster of this region.', '他是这个地区的邮政局长。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/18/99/189986B23AF2A41F37FE4EBCA2757592.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/postmaster--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3481, 'post-mortem', NULL, '[adj. 死后的,验尸的][n. 验尸]', 'A post-mortem showed that the victim had been poisoned.', '尸体检验表明受害者是被毒死的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/26/7e/267EE9A2549ABEFDCBBFA8FCB54B62CD.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/post-mortem--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3482, 'postoperative', NULL, '[adj. 手术后的]', 'In china acupuncture is used to alleviate postoperative pain.', '针刺疗法在中国被用来减轻病人手术后的疼痛。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/16/2a/162ADAB5A6CA9D9D394C17369DA63DE0.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/postoperative--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3483, 'postulate', NULL, '[n. 假定,基本条件][vt. 要求,假定]', 'Authority is a postulate of the moral order and derives from God.', '权威是一种道德秩序的主张,并且它来源于上帝。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/88/88/88880AFE218699BE92E2E252E59D0395.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/postulate--_gb_1.mp3');
