INSERT INTO `MASTER` VALUES (3485, 'potable', NULL, '[adj. 适于饮用的]', 'They voraciously drank all the potable water at one time.', '他们贪婪地一下就喝光所有饮用水。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9f/de/9FDE048C9C311FE3CCB0BD350847D8B3.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/potable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3486, 'potation', NULL, '[n. 畅饮,饮料]', 'Actually, reasonable potation is not able to hurt nerve cell.', '其实,适量饮酒不会对神经细胞造成伤害。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/fa/53/FA53D81F8185890814AB75D4F60E0A57.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/potation--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3487, 'potboiler', NULL, '[n. 粗制滥造的文艺作品]', 'This is just another legal potboiler.', '这就是另一本法律题材的烂作。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/cb/16/CB16270696C406A9400E50B362BC14DC.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/potboiler--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3488, 'potentate', NULL, '[n. 有权的人,统治者,君主]', 'People rose up against the despotic rule of their potentate.', '人们起来反抗君主的专制统治。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/51/f7/51F7B15020D8588C4813565A3571D8B8.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/potentate--_gb_1.mp3');
