INSERT INTO `MASTER` VALUES (3490, 'pother', NULL, '[n. 烦恼,喧闹,混乱][v. (使)烦恼]', 'She often pothers herself over unnecessary details.', '她常在不必要的琐事上自扰。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2a/31/2A31615D822F55380A524DAC8844AFC1.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pother--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3491, 'potpourri', NULL, '[n. 混杂物,文集,音乐串烧]', 'It\'smells like a potpourri bag. ', '闻起来像是百味袋. ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/5c/bb/5CBBE534B78B475BDB97040D0A3EDABA.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/potpourri--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3492, 'potshot', NULL, '[n. 近距离射击(肆意抨击)]', 'Reporters taking potshots at the mayor.', '记者们对市长胡乱加以批评', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/1b/40/1B40EC071A1C85CDE80718E7E8549C24.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/potshot--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3493, 'potted', NULL, '[adj. 盆栽的,罐装的,喝醉的]', 'He trimmed the oblique branches of that potted plant.', '他修剪了那棵盆栽的岔生枝干。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/95/44/954414950FCF3ECFDD7876045CEEF723.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/potted--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3494, 'potter', NULL, '[n. 陶工,陶艺家][vi. 懒散,闲逛]', 'The potter shaped the clay into a vase.', '陶工将泥土塑成花瓶。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7e/4e/7E4E46F7DC4DDA61190F4FC303599876.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/potter--_gb_1.mp3');
