INSERT INTO `MASTER` VALUES (3496, 'pouch', NULL, '[n. 小袋,小包][vt. 装...入袋中]', 'The drunk man lost his pouch in the bar.', '那个喝醉了的人在酒吧里丢失了钱袋。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/04/e6/04E6105A774986CFBACCE52A475162B3.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pouch--_gb_1.mp3');
