INSERT INTO `MASTER` VALUES (3498, 'pragmatic', NULL, '[adj. 实用主义的,实际的]', 'The American people are pragmatic by nature.', '美国人的性格是注重实际。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c8/5e/C85E61EA2491213BA8A8C6EB05872B32.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pragmatic--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3499, 'prairie', NULL, '[n. 大草原]', 'The prairie is topped occasionally by low hills.', '偶尔可见大草原上隆起几座低矮的小山。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/30/2b/302BA56A0315FEC05C5D1CC7EA540058.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prairie--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3500, 'prance', NULL, '[v. 腾跃,欢跃,昂首阔步地走]', 'The children were prancing about with delight.', '孩子们高兴得蹦蹦跳跳。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4a/da/4ADAF017B96971BD659098BEF1D894AE.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prance--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3501, 'prank', NULL, '[n. 恶作剧,开玩笑][v. 装饰,打扮]', 'He was the goat of their vicious prank.', '他成为他们恶作剧的对象。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ad/b8/ADB8ABDA40E0647803B666DA304C2B07.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prank--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3502, 'prate', NULL, '[v. 唠叨,闲聊][n. 唠叨,多嘴]', 'Listen to him prating on about nothing.', '听他瞎唠叨。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/aa/81/AA8169BEFB79B4A03DB83F82E18E15ED.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prate--_gb_1.mp3');
