INSERT INTO `MASTER` VALUES (3504, 'precarious', NULL, '[adj. 不稳定的,不安全的]', 'She makes a rather precarious living as a novelist.', '作为小说家,她过着不太稳定的生活。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/31/a0/31A0E6E81107E3C78C6E5C8FAF693C7E.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/precarious--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3505, 'precept', NULL, '[n. 道德箴言,规则,训诫]', 'Example is better than precept.', '身教胜于言传。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d0/5e/D05E6D951F7A0E52BCBA8AB52FB512B4.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/precept--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3506, 'precipitate', NULL, '[vt. 促成,使沉淀,猛落][n. 沉淀物]', 'All this will precipitate an economic crisis.', '所有这些会促成经济危机。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/1b/5e/1B5EC74C277B0F6EF2BFEC13C57D8138.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/precipitate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3507, 'precipitation', NULL, '[n. 降水,降雨,急躁,沉淀物]', 'You always act with precipitation.', '你总是仓促行事。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/00/0b/000B2435F39BF25656989CE404F856F5.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/precipitation--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3508, 'precipitous', NULL, '[adj. 险峻的,突然的,急躁的]', 'We have a precipitous climb to the peak.', '我们向着陡峭山顶攀登。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/45/0a/450A8619BBF5829E151A9E349CD52CC1.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/precipitous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3509, 'precocious', NULL, '[adj. 早熟的]', 'That child is far too precocious.', '孩子过于老成。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8b/c1/8BC104E32696BFF86D1F9EDC12679BDC.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/precocious--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3510, 'preconception', NULL, '[n. 预想,先入之见,偏见]', 'It was another case of the preconception fathering the prediction.', '这可以说又是按先入之见做出预言的一例。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/61/aa/61AA5A0556C447EE8A63B7EFAE9CDFBF.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/preconception--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3511, 'precursor', NULL, '[n. 先驱,前任,前兆,前驱体]', 'Her precursor as school principal was an eminent educator.', '她任校长前是一位卓越的教育家。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/61/6b/616B7AC6AF655E3D81A0F6428E927FB8.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/precursor--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3512, 'predestine', NULL, '[vt. 预定,注定]', 'She was obviously predestined to succeed.', '她显然注定了能成功。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b6/11/B611DFD1B7897938119E6816F91DC09A.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/predestine--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3513, 'predetermine', NULL, '[v. 预先决定]', 'We cannot read minds and we cannot predetermine intent. ', '我们不能看透别人的心中所想也不能预先断定别人的目的。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e8/81/E881C0E91048C415B24A0F77736E0284.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/predetermine--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3514, 'predictability', NULL, '[n. 可预见性]', 'Predictability is one thing, fear of change is something else. ', '可以预见是一回事, 怕改变又是一回事。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/41/cd/41CD36FACA05E03364CFF491C10562A7.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/predictability--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3515, 'predictive', NULL, '[adj. 预言的,预兆的,预测的]', 'Right, this stuff about predictive gene testing is cool.', '没错,基因检测的预测性尤其酷。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/36/2d/362DF43C8579C37A0F054F263BBC2306.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/predictive--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3516, 'predilection', NULL, '[n. 偏好,袒护]', 'He has a predilection for rich food.', '他偏好油腻的食物。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a9/42/A9424E1B02077D492CB3DD90C654E902.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/predilection--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3517, 'predispose', NULL, '[v. (使)易罹患,(使)预先偏向于]', 'The inhabitants are predisposed to rheumatism by the damp climate.', '因气候潮湿,居民易患风湿症。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/03/84/0384C60B5BD85393242E0F4FCCCB2435.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/predispose--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3518, 'predominantly', NULL, '[adv. 主要地,占优势地,压倒性地]', 'Vancouver is predominantly a service center.', '温哥华主要是一个服务中心。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/de/9c/DE9C0E27245A1FB76EDEB627C81F32A5.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/predominantly--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3519, 'preeminent', NULL, '[adj. 卓越的,优秀的,超群的]', 'A preeminent actor can bring a fictional character to life. ', '一个优秀的演员能把虚拟的人物演得有声有色。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b8/e3/B8E3CE18FC11E563914EB85AF3873685.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/preeminent--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3520, 'preempt', NULL, '[v. 抢占,先发制人,取代]', 'Better preempt to keep the opponent from bidding. ', '最好采用阻击叫,使对方难以参加竞叫。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/15/5b/155BB52328212659F09F1C56BE4E672B.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/preempt--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3521, 'preen', NULL, '[v. 整理羽毛,精心打扮,沾沾自喜]', 'Juvenile king penguins preen on the shore.', '年轻的企鹅首领在岸边用嘴整理羽毛。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/75/cf/75CF38A9B5180C71158862689A70E3F0.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/preen--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3522, 'prefabricate', NULL, '[vt. 预先建造]', 'Easily installed, no need basis etc. prefabricate assembly. ', '压缩机的安装简便, 无需基础等预制装配。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/88/79/88793703D1D0E183DCEFBFDC23CA16F0.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prefabricate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3523, 'prefabricated', NULL, '[adj. 预制的,预建的]', 'This is a prefabricated project.', '这是个预先编制的计划。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ba/6b/BA6BB465652C579EDBE6F3626EE67068.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prefabricated--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3524, 'preferably', NULL, '[adv. 更好地,宁可,宁愿]', 'I want to get married; preferably to a rich man.', '我想结婚,最好是找到一位有钱人。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/52/05/5205EB0F9667CE4132F8123F475EAE46.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/preferably--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3525, 'prefigure', NULL, '[v. 预示,预想]', 'It wasn\'t as bad as I had prefigured.', '这并不像我预想的那么糟。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/87/67/8767DA29DA5F752A7DA53CC292491C78.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prefigure--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3526, 'prehensile', NULL, '[adj. 适于抓握的]', 'Poets are those strangely prehensile men. ', '诗人是那些具有深刻洞察力的人们。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c4/71/C4711B106A245C16E7EF98E19BEC2502.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prehensile--_gb_1.mp3');
