INSERT INTO `MASTER` VALUES (3529, 'premeditate', NULL, '[vt. 预谋,预先计划]', 'I rarely premeditate, which is a mistake. ', '我很少预先计划, 这不是好习惯。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8f/86/8F860542DC01D9CC0B66D8F56D2EB5DC.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/premeditate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3530, 'premiere', NULL, '[v. 初次公演,初次演出][n. 初次公演]', 'The opera will premiere at the Arcadia Theater.', '这出歌剧将要在阿卡迪亚剧院首映。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/bb/54/BB54C0C03FFECF3C33930F3BC6F970D3.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/premiere--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3531, 'premonition', NULL, '[n. (不祥的)预感]', 'He had a premonition of impending doom.', '他有一种不祥的预感。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f5/3e/F53EDFD0145332508A2B1B96F3B7EED6.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/premonition--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3532, 'preoccupation', NULL, '[n. 占据思想,全神贯注]', 'She found his preoccupation with money irritating.', '她发觉他心里只有钱,感到很生气。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/00/6a/006A8BB3C84ADDA561CA387FF092BFCC.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/preoccupation--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3533, 'preponderance', NULL, '[n. 优势,多数]', 'I had some preponderance than him also.', '我还有比他优越的地方。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/55/48/5548BCA230597E47EB754525B0445570.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/preponderance--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3534, 'preponderant', NULL, '[adj. 占优势的,主要的,压倒性的]', 'Melancholy is the preponderant mood of the poem.', '忧郁的感情是该诗的基调。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d5/b3/D5B3D5125BB371A301E81B589EEA70F5.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/preponderant--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3535, 'preponderate', NULL, '[v. 以重量胜过,占优势,胜过]', 'Oaks and maples preponderate in our woods. ', '在我们的森林中,橡树与枫树占多数。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/3a/a7/3AA7DA5CAEBD8C2F4F94D097D5C8568D.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/preponderate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3536, 'prepossessing', NULL, '[adj. 给人良好印象的,有魅力的]', 'Clean clothes and good manners are prepossessing.', '清洁的衣服和良好的举止能给人以好感。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0c/4d/0C4D929FC2A9391F2684578AAAEB0BAF.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prepossessing--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3537, 'preposterous', NULL, '[adj. 荒谬的,可笑的]', 'That\'s a preposterous accusation!', '那样的指责简直荒谬可笑！', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9a/df/9ADFAF90AA3925A0EEDD85ADA8F8C885.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/preposterous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3538, 'prerogative', NULL, '[n. 特权,显著的优点]', 'A ruler may use his prerogative of mercy towards a criminal.', '统治者可行使赦免罪犯的特权。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/45/da/45DAEB7A24AD10FA64BE56E8BEB15735.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prerogative--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3539, 'presage', NULL, '[n. 预感,预兆,预知][v. 预示,预言]', 'Suddenly he had a presage about the near danger.', '他突然对即将到来的危险有了一种预感。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/86/86/86863C70A711DD6A09F2B0B8EA81D152.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/presage--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3540, 'prescience', NULL, '[n. 预知,先见]', 'Experience has shown the wisdom of his prescience', '历史经验证明了他的先见之明。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/da/d0/DAD0357DC4D5FFE56BC162ED6AD6C174.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prescience--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3541, 'prescient', NULL, '[adj. 预知的,有先见之明的]', 'It was a remarkably prescient vision. ', '这的确很有远见。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/38/5f/385F4BF83FFB0E6936212471BDDA13D6.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prescient--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3542, 'prescribed', NULL, '[adj. 规定的]', 'Other requirements prescribed by the State Council.', '国务院规定的其他条件。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/35/a8/35A85438E954FA897370EE2D443D8E38.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prescribed--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3543, 'presentiment', NULL, '[n. 预感]', 'She often has an ominous presentiment.', '她时时有一种不祥的预感。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/05/db/05DB7F937A2F64771D2E1415ACEEBD1A.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/presentiment--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3544, 'presumptuous', NULL, '[adj. 放肆的,冒昧的,自以为是的]', 'It is too presumptuous of him to do so.', '他这样做太放肆了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e5/40/E540B6C974BF62FC2737D116DB105A24.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/presumptuous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3545, 'presuppose', NULL, '[v. 预先假定,预料,必要的条件]', 'We cannot presuppose the truth of his statements.', '我们不能预先假定他的话属实。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/63/60/63607A38088DFBC4681742F51BB5753E.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/presuppose--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3546, 'presupposition', NULL, '[n. 预先假定,臆测]', 'You have made several unjustified presuppositions.', '你作了一些毫无根据的假设。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e2/e4/E2E4E9B8A788B46DBB00A681C4F2F55D.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/presupposition--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3547, 'pretense', NULL, '[n. 借口,虚假,伪装,自吹,炫耀]', 'It is merely a pretense.', '这只是托词而已。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a8/7a/A87A96DA0D1E4E4237BD2D0A39EC6000.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pretense--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3548, 'pretension', NULL, '[n. 声称,自负,狂妄,炫耀]', 'His social pretensions make him appear ridiculous.', '他冒充上流社会人士而出尽洋相。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f6/53/F65360B42BA9B27EA39DC468E7F41574.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pretension--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3549, 'pretentious', NULL, '[adj. 自命不凡的,自负的,炫耀的]', 'He is a talented but pretentious writer.', '他是一个有才华但自命不凡的作家。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/62/b0/62B07E711AD0D354A143F45C93F0CEC3.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pretentious--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3550, 'preternatural', NULL, '[adj. 异常的,超自然的,不可思议的]', 'Below his preternatural affability there is some acid and steel.', '在他异常和蔼可亲的表情之下,有着尖刻和钢铁般的坚毅。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8e/a2/8EA25F3FED42A985FDA4C46D5E815FDC.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/preternatural--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3551, 'prevailing', NULL, '[adj. 盛行的,广泛流传的,主流的]', 'He wore his hair in the prevailing fashion.', '他的头发梳的是当时盛行的发型。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/67/1f/671FE3BDD6FB3578D1C50C8C761F1C2F.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prevailing--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3552, 'prevaricate', NULL, '[v. 支吾其辞,搪塞]', 'Tell us exactly what happened and don\'t prevaricate.', '有什麽就原原本本地告诉我们吧,别躲躲闪闪的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c7/45/C74510D7909148A24F35C80D568B0586.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prevaricate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3553, 'preventative', NULL, '[adj. 预防性的][n. 预防法]', 'We have to take preventative measures.', '我们不得不采取预防措施。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/bf/b6/BFB653A0C73819ACE3779E435AB86BCE.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/preventative--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3554, 'prevision', NULL, '[n. 先见,预感]', 'It would be a first as there are no prevision in the UEFA rules.', '这将是第一例此类事件,因为此前欧足联从未有过先例规则。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ab/3e/AB3EF59EEB2B3E315C3254F24B8A9F6A.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prevision--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3555, 'prig', NULL, '[n. 自命不凡者,小偷][v. 偷]', 'He had been railed against by them as a prig and a poseur.', '他们责骂他是一个沾沾自喜、装腔作势的人。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b4/31/B43127C1C309526B268261B7B2720489.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prig--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3556, 'primal', NULL, '[adj. 最初的,原始的,主要的]', 'Then primal sedateness came back.', '而后世界又恢复了最初的安详。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/61/08/61081422CD91736E5C651CCFB4B2AF6F.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/primal--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3557, 'primate', NULL, '[n. 灵长目动物,首席主教]', 'The woolly spider monkey is the largest primate in the Americas.', '绒毛蛛猴是美洲最大的灵长类动物。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/6f/6b/6F6BDA4FB01A2053DBEACA0BB1A6986B.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/primate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3558, 'primordial', NULL, '[adj. 原始的,自原始时代的,最初的]', 'It is the primordial force that propels us forward.', '它是推动我们前进的原始动力。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9b/0f/9B0F1BE691B5997AC997D1EE3197D419.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/primordial--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3559, 'prioritize', NULL, '[vt. 把 ... 区分优先次序]', 'I now prioritize all of my tasks and create a plan.', '现在我会将所有任务排出优先次序然后制定出计划。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9f/6c/9F6CEFBD14E921C96521E43337031174.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prioritize--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3560, 'pristine', NULL, '[adj. 原始的,清新的,纯朴的]', 'The car is in pristine condition.', '这辆汽车是全新的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/08/d9/08D9747B575F5A9E30AAF1B8AABDFA55.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pristine--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3561, 'privation', NULL, '[n. 贫困,匮乏,丧失]', 'They endured years of suffering and privation.', '他们饱受多年的煎熬与贫困。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/88/59/8859A788DA2B76383EFE40C72225CBAC.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/privation--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3562, 'probation', NULL, '[n. 试用期,缓刑]', 'We hope love can have a probation period.', '我希望爱情可以有试用期。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7a/20/7A2073650C3CB770E184E216C2CB4CF8.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/probation--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3563, 'probity', NULL, '[n. 诚实,廉洁,正直]', 'But there is scant risk of too much fiscal probity in Washington.', '但在华盛顿再多财政廉洁也没有大风险。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/11/0d/110D9257985AA5003A7BEC95B99BB715.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/probity--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3564, 'proceeds', NULL, '[n. 收益]', 'They donated the proceeds to the local charities.', '他们把收益捐给了当地的慈善机构。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/34/af/34AF6172FAD751F3202648FD1EB28A9E.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/proceeds--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3565, 'proclivity', NULL, '[n. 倾向,癖性]', 'He has a proclivity to [toward] violence.', '他有暴力的倾向。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/45/0c/450CE132C91BD826EC214639A258BC08.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/proclivity--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3566, 'procrastinate', NULL, '[v. 延迟,拖延,耽搁]', 'He procrastinated until it was too late to do anything at all.', '他因循坐误,一事无成。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e7/a0/E7A043E6702F2F327F484A13F15B4B71.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/procrastinate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3567, 'procrustean', NULL, '[adj. 强求一致的]', 'We are firmly opposed to the policy of a Procrustean bed.', '我们坚决反对强求一致的政策。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/3e/75/3E75F92DB6CE9C00F0A10F8E06CD3A60.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/procrustean--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3568, 'procurement', NULL, '[n. 采购,获得,促成]', 'He is in charge of the procurement of materials.', '他负责物资的采购。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/83/60/8360081F7B918BB711B9DE4637D50B3F.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/procurement--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3569, 'prod', NULL, '[n. 刺针,刺激,激励][v. 戳,刺激]', 'She gave the man a prod with her umbrella.', '她用伞捅了那男子一下。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8a/4a/8A4A971DE9038007D4F6640B1D0E95A7.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prod--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3570, 'prodigal', NULL, '[adj. 挥霍的,慷慨的][n. 挥霍者]', 'I hate the prodigal administration.', '我痛恨铺张浪费的行政机关。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4a/30/4A30374AB740EB8B6C2E200EA3D9DCE5.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prodigal--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3571, 'prodigious', NULL, '[adj. 巨大的,惊人的,奇异的]', 'A nuclear reactor generates prodigious amounts of heat.', '一座核反应堆能发出巨大的热量。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/fb/f3/FBF3965ADD3D992A8BF932B852947763.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prodigious--_gb_1.mp3');
