INSERT INTO `MASTER` VALUES (3573, 'profane', NULL, '[adj. 亵渎的,世俗的][v. 亵渎,玷污]', 'His profane language annoyed us.', '他亵渎的言语激怒了我们。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/69/d6/69D6723B9C332187BB848A02E55F4B62.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/profane--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3574, 'professionalism', NULL, '[n. 职业水准或特性,职业化]', 'The professionalism of local social work is lagged.', '我国的社会工作起步较晚,职业化滞后。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d9/27/D927C84CA2919F2BB4191F8124DA6F60.mp3', 0, 15, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/professionalism--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3575, 'proffer', NULL, '[v. 提供,提出][n. 提供,提议]', 'He refused the proffered wine.', '他拒绝了对方端过来给他的酒。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2d/c6/2DC639D3C23BB6C7653C5F4888047CFA.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/proffer--_gb_1.mp3');
