INSERT INTO `MASTER` VALUES (3577, 'profligacy', NULL, '[n. 放荡,不检点,浪费]', 'Recession, they reason, must be a penance for past profligacy. ', '经济衰退, 他们推断, 肯定是对过去大肆挥霍的赎罪。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/6c/4a/6C4ACBF3304415D0E1146C286995A96F.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/profligacy--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3578, 'profligate', NULL, '[adj. 放荡的,不检点的][n. 享乐者]', 'Thus the crisis punishes the frugal more than the profligate.', '如此看来,危机对节俭者的惩罚,要比对恣意挥霍者更为严厉。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d9/0c/D90CDE7BE9ECAA3CB02F6F530AB8B5A6.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/profligate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3579, 'profoundly', NULL, '[adv. 深深地,深刻地]', 'His feeling has been harmed profoundly.', '他的感情被深深地伤害了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/38/0a/380A9409ADF5E5B708113B6EA5463F9D.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/profoundly--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3580, 'profundity', NULL, '[n. 深奥,深刻,深厚,渊博]', 'This is the profundity of our world.', '这正是我们世界的深奥之处。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f5/bb/F5BB7EEF0A483B6DDF13ACEC1AC0F93C.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/profundity--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3581, 'profuse', NULL, '[adj. 很多的,丰富的,慷慨的]', 'He made profuse apologies.', '他再三道歉。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/40/cb/40CBB3CD522D2F10AB68B9C2BB45ECA1.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/profuse--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3582, 'progenitor', NULL, '[n. 祖先,先驱]', 'It is said that our progenitors are monkeys.', '据说我们的祖先是猴子。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7d/7a/7D7ABFDDEB98CADFA6B7F0156A07B432.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/progenitor--_gb_1.mp3');
