INSERT INTO `MASTER` VALUES (3584, 'prognosis', NULL, '[n. 预断病情,预后,预测]', 'The prognosis depends on the source of the vertigo.', '对于病情的预判要视形成眩晕的原因而定。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/fb/84/FB84C5429F5B8A56164CBC56AE55274F.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prognosis--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3585, 'prognosticate', NULL, '[vt. 预知,预言,预测]', 'So I know there are a lot of folks that will want to prognosticate.', '所以我知道有很多人想要预测。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b3/d4/B3D49EEBB9A9ABD9B7404EA81E347A56.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prognosticate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3586, 'prohibitively', NULL, '[adv. 令人望而却步的,价格过高的]', 'Car insurance can be prohibitively expensive for young drivers.', '汽车保险费有时高得让年轻开车人承受不起。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9e/c1/9EC1EAFE45BC4AADF46BA5FC797D6148.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prohibitively--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3587, 'projectile', NULL, '[n. 发射体,抛射物][adj. 向前开进的]', 'The path followed by a projectile is called its trajectory.', '发射体所循的路径称为它的轨道。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b3/61/B3616577F5E589AFE326C9FD23C1811C.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/projectile--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3588, 'projecting', NULL, '[adj. 突出的,伸出的]', 'I caught my coat on a loose brick projecting from the wall. ', '我把大衣挂在一个突出于墙外的一块松动的砖头上. ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/11/a0/11A06ACB60D95313C274D6FEFFA003D2.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/projecting--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3589, 'projectionist', NULL, '[n. 放映师,电视技师,地图制作者]', 'He was a projectionist at Silver Cinema.', '他是银都戏院的一个放映员。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/74/21/7421149473AAF2DB23105E036835E045.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/projectionist--_gb_1.mp3');
