INSERT INTO `MASTER` VALUES (3641, 'provincialism', NULL, '[n. 地方主义,地方风格,方言,偏狭性]', 'Nobody likes to make friend with the provincialism people.', '没有人喜欢与心胸狭窄的人交朋友。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/01/88/01885737159C3C4703E8285EDD41D9C2.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/provincialism--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3642, 'provisional', NULL, '[adj. 暂时的][n. 临时性,临时人员]', 'We are now in a position to attempt a provisional synthesis.', '我们现在可以探讨一下暂时的综合。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8a/44/8A448903001B292F97422BBA639C52B9.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/provisional--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3643, 'prowess', NULL, '[n. 英勇,非凡的能力]', 'He shows great prowess at acting.', '他显示了非凡的演技。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d6/a7/D6A7ADEF8AA0AAE0458860C30D7DC2C5.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prowess--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3644, 'prowl', NULL, '[v. 窥伺,逡巡于][n. 潜行,徘徊]', 'Many wild animals prowl at night.', '许多野生动物在夜间觅食。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/af/ab/AFAB2619C42887105D1B44E72688F209.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prowl--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3645, 'prude', NULL, '[n. 过份正经的女人]', 'Don\'t be such a prude.', '别那么拘谨。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/15/94/1594D5D1F935C601A9631AD71CE0DD02.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prude--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3646, 'prudish', NULL, '[adj. 过分拘谨的,装规矩的]', 'American culture is in many ways still fairly prudish.', '美国文化在许多方面还是相当拘谨的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0d/ed/0DED18D89CE92ED46044C1AB37A78CA5.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prudish--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3647, 'prune', NULL, '[v. 修剪,削减][n. 梅干,李子脯]', 'You should prune your roses in the spring.', '你应该在春天修剪一下你的玫瑰花。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/60/7b/607B2B6A1EE8013B0647B349675B089B.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/prune--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3648, 'pry', NULL, '[v. 打听,窥探,用杠杆撬开][n. 窥探]', 'Don\'t pry into private life of others.', '不要窥探别人的私生活。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/22/c0/22C0975491F13EF8CF7EEB7842928CE9.mp3', 0, 3, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pry--_gb_1.mp3');
