INSERT INTO `MASTER` VALUES (3650, 'pseudonym', NULL, '[n. 假名,笔名]', 'No one knew that he was operating under a pseudonym,', '没人知道他一直在使用假名。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/99/5f/995F09F0DF29B7ABAA578582A6C1AFAC.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pseudonym--_gb_1.mp3');
