INSERT INTO `MASTER` VALUES (3653, 'puddle', NULL, '[n. 水坑,胶泥][v. 搅浊,使泥泞]', 'The puddle evaporated rapidly in the sun.', '水坑在阳光下迅速蒸发。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4b/8d/4B8DEA6821CF056FA4C8385F1C1D7734.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/puddle--_gb_1.mp3');
