INSERT INTO `MASTER` VALUES (3655, 'puerile', NULL, '[adj. 青春期的,孩子气的,未成熟的]', 'He was trying to give puerile excuses.', '他给出的借口总是愚蠢至极。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/42/21/42218995F990ECC2E3A81158DAF815FB.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/puerile--_gb_1.mp3');
