INSERT INTO `MASTER` VALUES (3657, 'pugnacious', NULL, '[adj. 好斗的]', 'When he was a child, he was pugnacious and fought with everyone.', '他小时候很好斗, 跟每个人都打过架。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/00/8b/008BAD6877C83E9DBC060482D6ADB18A.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pugnacious--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3658, 'puissant', NULL, '[adj. 强有力的,强盛的,有权力的]', 'The young man has a puissant body.', '这个年轻人有一副强壮的身体。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/22/0b/220BA329A05A1D79C00EBF565EAA6CEA.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/puissant--_gb_1.mp3');
