INSERT INTO `MASTER` VALUES (3660, 'pullet', NULL, '[n. 小母鸡,[美俚]小姑娘]', 'Better an egg today than a pullet . ', '今天一个鸡蛋,胜过明天一只小母鸡。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/6f/4c/6F4C35B6CCE332664566F405D3CD7262.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pullet--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3661, 'pulley', NULL, '[n. 滑车,滑轮,皮带轮]', 'There is no bucket and pulley to this well.', '那口井没有吊桶和滑车。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/26/22/26225D9FE67AAAD1194708C6CCAA42D9.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pulley--_gb_1.mp3');
