INSERT INTO `MASTER` VALUES (3665, 'pulverise', NULL, '[v. 磨成粉或捣成末,粉碎,摧毁]', 'Now she is likely to pulverise Mr Obama over his lack of policies.', '现在她则可能要通过奥巴马先生政策上的匮乏来摧毁他。', 'https://dictionary.cambridge.org/media/english/us_pron/p/pul/pulve/pulverize.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pulverise--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3666, 'pulverize', NULL, '[v. 磨成粉,粉碎]', 'On other occasions I threatened to pulverize it.', '在其他的时刻,我扬言要粉碎它。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/73/0d/730DC77209B65979761D5B8DE24A45DF.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pulverize--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3667, 'pumice', NULL, '[n. 浮石,浮岩][v. 用浮石磨]', 'Add only a little alcohol and pumice as you work.', '每次只要加很少的酒精和浮石粉。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9c/f6/9CF6014179A3841D0601EEE936ED0129.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pumice--_gb_1.mp3');
