INSERT INTO `MASTER` VALUES (3669, 'puncture', NULL, '[n. 刺穿,刺孔][v. 刺穿,削弱]', 'Some cyclists carry repair outfits in case they have a puncture.', '有些骑自行车的人带修理工具,以防车胎被刺破。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/db/f4/DBF4ED6D5F166131B3F570178EEB76EC.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/puncture--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3670, 'pundit', NULL, '[n. 权威人士,专家]', 'The pundits disagree on the best way of dealing with the problem.', '如何妥善处理这一问题,专家众说纷纭。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ba/15/BA1548D52CE79F9BA5B001D19FEFF387.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pundit--_gb_1.mp3');
