INSERT INTO `MASTER` VALUES (3673, 'pupation', NULL, '[n. 昆虫化蛹]', 'Pupation takes place abou the middle part of April. ', '四月中旬开始化蛹,蛹期十八至二十天。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/36/09/36095650855BF4104469E99DAA607436.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pupation--_gb_1.mp3');
