INSERT INTO `MASTER` VALUES (3678, 'purloin', NULL, '[vt. 偷窃]', 'What person purloin be after all their money? ', '究竟是什么人盗取了他们的钱 呢 ?', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/3b/bc/3BBCE3564B3A737BA7CD380BACCAE8C2.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/purloin--_gb_1.mp3');
