INSERT INTO `MASTER` VALUES (3682, 'pusillanimous', NULL, '[adj. 懦弱的,胆小的]', 'The pusillanimous man would not defend his own family. ', '软弱无力的人不会保卫他自己的家。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d7/af/D7AFDDECD6E17B2AD1AFF886887773B7.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/pusillanimous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3683, 'putative', NULL, '[adj. 假定的,被公认的]', 'DNA samples from the putative father are always required.', '推定生父的DNA样本是必须提供的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2b/27/2B27668FEB824EF7205AC70C41F002BC.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/putative--_gb_1.mp3');
