INSERT INTO `MASTER` VALUES (3739, 'rasp', NULL, '[n. 锉刀,刮擦声][v. 发出刺耳声]', 'He wanted to rasp the surface smooth.', '他想把表面锉平。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d1/71/D171ED126FE148E309CE33AA7BC47B55.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/rasp--_gb_1.mp3');
