INSERT INTO `MASTER` VALUES (3741, 'ratiocination', NULL, '[n. 推理,推论]', 'A study of the time ratiocination in the artificial Intelligence.', '人工智能中时间推理的研究。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0d/a6/0DA6731A2CA9CA9794904C6BE181F168.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/ratiocination--_gb_1.mp3');
