INSERT INTO `MASTER` VALUES (3748, 'ravel', NULL, '[v. 解开线团,使...更迷惑]', 'Bind the edge of the rug so that it won\'t ravel.', '给地毯镶个边以免开线。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/80/16/801607465ACBE09D3922FAA9AA491AE8.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/ravel--_gb_1.mp3');
