INSERT INTO `MASTER` VALUES (3751, 'ravenous', NULL, '[adj. 贪婪的,极饿的]', 'The country has also become a ravenous consumer.', '这个国家还成为一个贪婪的消费者。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/02/2d/022D870D15AD6FAA7AEE2FBB228952AB.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/ravenous--_gb_1.mp3');
