INSERT INTO `MASTER` VALUES (3755, 'rawhide', NULL, '[n. (牛的)生皮,生牛皮鞭]', 'A whip or rope made of rawhide.', '生牛皮鞭由生牛皮制成的鞭或绳', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/85/91/8591C26E6BF7690666196691D2BF2572.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/rawhide--_gb_1.mp3');
