INSERT INTO `MASTER` VALUES (3760, 'reaffirm', NULL, '[vt. 重申,再确认]', 'It is particularly important to reaffirm this point today.', '今天重申这一点,有特别重要的意义。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/87/c9/87C9428FCAD5FC6AD0ADFC83DA9C1B5E.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/reaffirm--_gb_1.mp3');
