INSERT INTO `MASTER` VALUES (3762, 'realign', NULL, '[v. 重新编制,重新排列,重新结盟]', 'The company is planning to realign its sales operations.', '这家公司计划重新调整其销售经营。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a6/6e/A66ED1F65252376AC730D980A4FA4B54.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/realign--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3763, 'rebarbative', NULL, '[adj. 厌烦的,令人讨厌的,难看的]', 'He became rebarbative and prickly and spiteful.', '他变得令人讨厌,容易发怒,而且满怀恶意。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ed/05/ED0518D98EBF3407A5EC1CA94CF85310.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/rebarbative--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3764, 'rebroadcast', NULL, '[vt. 转播,重播][n. 转播,重播]', 'The station will rebroadcast the exhibition match this afternoon.', '今天下午电视台会重播这场表演比赛。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/36/6c/366C1A300DB30E3FC887FB3EAFCCB20E.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/rebroadcast--_gb_1.mp3');
