INSERT INTO `MASTER` VALUES (3769, 'recant', NULL, '[v. 放弃主张,撤回,公开宣布]', 'The torture can not make the man recant.', '拷问者不能使那个人放弃他的主张。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e9/ae/E9AEF2F6B29DA9310C27D447A58DFD98.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/recant--_gb_1.mp3');
