INSERT INTO `MASTER` VALUES (3772, 'recast', NULL, '[v. 重塑,重作,更换演员]', 'She recast her lecture as a radio talk.', '她把讲义改动后用作电台的讲话。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/14/a8/14A8B3E402E0D692FACCCACBBB5AA1C3.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/recast--_gb_1.mp3');
