INSERT INTO `MASTER` VALUES (3832, 'regent', NULL, '[n. 摄政者,评议员][adj. 摄政的]', 'The regent carried out an advanced system in his country.', '摄政者在他的国家推行了一套先进的制度。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0b/7c/0B7CDCE6A9D8224869AFF717403E779A.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/regent--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3833, 'regimentation', NULL, '[n. 严格控制,纪律,系统化]', 'Discipline without regimentation was Miss Bulstrode\'s motto.', '注意纪律,又不刻板,这就是布尔斯特罗德小姐的座右铭。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b9/77/B97712B35292D6EA74046F5BDEB0B9C4.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/regimentation--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3834, 'regress', NULL, '[v. 倒退,回归,退化]', 'Some children may regress to an earlier stage of development.', '有些孩子的状态会倒退到更小的年龄段。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/04/8a/048A0938D568C93D32B0E8CC68AB6733.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/regress--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3835, 'regressive', NULL, '[adj. 退步的,退化的,回归的]', 'This is both regressive and likely to aggravate the deficit.', '这既是一种退步,又可能使财政赤字加速增长。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c4/59/C45969DB65C528045A87A98A6712127C.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/regressive--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3836, 'regretfully', NULL, '[adv. 懊悔地,遗憾地]', 'Emma shook her head regretfully.', '爱玛遗憾地摇了摇头。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e9/df/E9DF82084587A8E354EE1BE8A56AE518.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/regretfully--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3837, 'regurgitate', NULL, '[v. 使反胃,使反哺]', 'He\'s simply regurgitating stuff remembered from lectures.', '他只不过是照背讲义而已。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/46/7c/467CE4BC3175031BCC97D9C913014FA8.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/regurgitate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3838, 'reigning', NULL, '[adj. 统治的,在位的,本届的,支配的]', 'A reigning Hindu princess or queen.', '拉尼握有统治权的印度公主或女王', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ec/e7/ECE72983468AC055DF6239C6C94DB503.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/reigning--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3839, 'reimburse', NULL, '[vt. 偿还,报销]', 'I was reimbursed in full.', '我已得到全部补偿。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/03/24/03246598A14DE9BDFF189851E7ECAD04.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/reimburse--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3840, 'reincarnate', NULL, '[v. 使化身,转生][adj. 转世的]', 'We reincarnate into successive lives. ', '我们连续不断地再生。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/6f/60/6F60B5C480CB27FE7CF0925C104AD104.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/reincarnate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3841, 'reinstate', NULL, '[vt. 使复位,恢复]', 'There he proposed to reinstate the ancient Olympic Games.', '会议上,他提出恢复古代奥林匹克运动会。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/84/d7/84D7FDCDD053D44E40E335EA377E1C2D.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/reinstate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3842, 'reinterpretation', NULL, '[n. 重新解释]', 'Sometimes this takes the form of a reinterpretation of events.', '乐观有时需要对事件进行重新解释。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/bf/e4/BFE4EBD3EBDDEEC6186870EABA39F69A.mp3', 0, 16, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/reinterpretation--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3843, 'reinvigorate', NULL, '[vt. 使再振作,使复生]', 'We need to reinvigorate the economy of the area.', '我们需要给这个地区的经济注入新的活力。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/fe/61/FE6103D3DD2ECC88E5334742E9228B81.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/reinvigorate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3844, 'reiterate', NULL, '[vt. 重申]', 'The captain reiterated the command to us.', '上尉对我们重申了那项命令。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0f/98/0F9883FD937322D46BF951B3E7986905.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/reiterate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3845, 'rejoin', NULL, '[v. (使)再结合,再加入,反驳]', 'She should strain a point to rejoin him.', '她应该克服成见同他再次结合。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/64/59/64595A1076BFD54220AB2B4D7BA5DD90.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/rejoin--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3846, 'rejoinder', NULL, '[n. 回答,反驳,第二次答辩]', 'She always has a witty rejoinder to any question.', '她总是对待任何问题都能机智的回答。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2a/c1/2AC163966EB80BEEBCDB082A898B2B33.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/rejoinder--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3847, 'rejuvenate', NULL, '[v. 使...年轻,使...恢复精神, 变年轻]', 'The mountain air will rejuvenate you.', '山上的空气将使你变得年轻。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/3a/10/3A10D4B93A38278534EB380A8DBBBE8F.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/rejuvenate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3848, 'rekindle', NULL, '[v. 重新点燃]', 'Nothing could rekindle her extinct passion.', '她激情已逝,无从心回意转。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/04/45/04454F040C2A21898358FAAC0A06135E.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/rekindle--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3849, 'relapse', NULL, '[v. 再陷入,故态复萌][n. 旧病复发]', 'Some patients will relapse.', '一些患者会复发。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/43/76/4376958064C639872E796E7E21C2206C.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/relapse--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3850, 'relegate', NULL, '[v. 使降级,流放,移交,委任]', 'Mr. Taylor relegate his project to his son after he have ret.', '泰勒先生退休后把他的事业移转给儿子。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a7/45/A745846B5AC5C579641D8032AEF52EE6.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/relegate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3851, 'relent', NULL, '[v. 变宽厚,变温和,动怜悯之心,缓和]', 'At first she threatened to dismiss us all, but later she relented.', '起初她威胁要解雇我们所有的人,但是后来她态度软化了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/52/8f/528FE7FAD81770A90997919669B9EDE7.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/relent--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3852, 'reliability', NULL, '[n. 可靠性]', 'I\'m rather doubtful about its reliability.', '我很怀疑其可靠性。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/6b/a1/6BA15474209FE540A02F0F73A6163F8C.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/reliability--_gb_1.mp3');
