INSERT INTO `MASTER` VALUES (3854, 'relieved', NULL, '[adj. 放心的,放松的]', 'She looked immensely relieved when she heard the news.', '她一听到这个消息似乎立刻放心了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/95/c3/95C341B6652EDA74243245CF14C6146B.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/relieved--_gb_1.mp3');
