INSERT INTO `MASTER` VALUES (3856, 'relocate', NULL, '[v. 重新装置,再配置,放在新地方]', 'The board decide to relocate the company in scotland.', '董事会决定将公司迁至英格兰。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a3/47/A347369D1A5013983C56823A9D6840DB.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/relocate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3857, 'remand', NULL, '[n. 遣回,还押][v. 送回,还押候审]', 'He is currently being held on remand.', '他正被还押候审。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ec/6c/EC6C6B299BE103912095D2C07E24E2DD.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/remand--_gb_1.mp3');
