INSERT INTO `MASTER` VALUES (3861, 'remit', NULL, '[v. 宽恕,免除,汇款][n. 移交事项]', 'He remitted some money to his mother.', '他给他母亲寄了一些钱。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a1/0a/A10A34FF710CFBE243182CBDF3B0FADF.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/remit--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3862, 'remittance', NULL, '[n. 汇款]', 'He has returned the completed form with your remittance.', '他已经把填好的表格连同你的汇款一并寄回了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b3/48/B348362C1E7CDF620FAD582CDA073671.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/remittance--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3863, 'remonstrance', NULL, '[n. (正式)抗议,抱怨,告诫]', 'I made remonstrance against his rudeness.', '我对他的粗暴提出抗议。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/61/3e/613E0CF957830790FED2AB78F1BDADDF.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/remonstrance--_gb_1.mp3');
