INSERT INTO `MASTER` VALUES (3866, 'remorselessly', NULL, '[adv. 冷酷地,无悔意地]', 'The police pursued the criminal remorselessly. ', '警方追捕那罪犯毫不松劲。', 'https://dictionary.cambridge.org/media/english/us_pron/u/usr/usrem/usremin005.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/remorselessly--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3867, 'remoteness', NULL, '[n. 远离,远隔,细微,偏僻]', 'His remoteness was resented.', '他的冷漠让人厌恶。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/37/a1/37A1F7F492F9D5415BB954513F23C71F.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/remoteness--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3868, 'remunerate', NULL, '[vt. 给与报酬,酬劳]', 'The company will remunerate you for your travelling expenses.', '公司将给你报销旅费。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a6/f5/A6F53944D36F6290675BF8E1FACDD6A7.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/remunerate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3869, 'remuneration', NULL, '[n. 报酬,酬劳,赔偿]', 'He received generous remuneration for his services.', '他因服务而得到优厚的报酬。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0f/10/0F1074FD3EB283C3D8824B9A78B7AB6A.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/remuneration--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3870, 'remunerative', NULL, '[adj. 有报酬的,有利益的]', 'It\'s a vast and remunerative market even with high prices.', '这是一个巨大的高额利润回报的市场,甚至价格高的离谱。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/bb/cb/BBCB818E300A397829DE2E14F4BEC755.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/remunerative--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3871, 'renal', NULL, '[adj. 肾脏的]', 'People with renal diseases have to eat salt-free foods.', '患有肾脏疾病的人只能吃不含盐的食物。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9c/5c/9C5CCA6B96F2B9EFDB507DF5609642FB.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/renal--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3872, 'renascent', NULL, '[adj.  复兴的, 再生的]', 'Jesus makes them renascent then, turn them into wanted look.', '耶稣于是让他们复活,变成他们想要的样子。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/17/7c/177C2B95B9A32DEE2A43F68D27116DD9.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/renascent--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3873, 'rend', NULL, '[v. 撕破,分裂,劈开,强夺]', 'Wolves will rend a lamb to pieces .', '狼群会把一只羔羊撕成碎片。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d3/1a/D31A5E062470009EB7D257949BEFA65D.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/rend--_gb_1.mp3');
