INSERT INTO `MASTER` VALUES (3880, 'reorient', NULL, '[v.  重定 ... 的方向(或方位)]', 'China had to reorient her foreign policy according to the new situation.', '中国必须根据新的形势重新调整其外交政策。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/08/68/0868DA44ED9319065BE7241B7B675BB3.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/reorient--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3881, 'repack', NULL, '[vt. 重新打包,重新装箱]', 'Repack all the superfluous cups in the box.', '把多余的杯子都重新装入箱中。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/95/53/95530105FA737C4E62E8BFA00B2A0D49.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/repack--_gb_1.mp3');
