INSERT INTO `MASTER` VALUES (3883, 'reparation', NULL, '[n. 补偿,赔偿]', 'You must make reparation for the sorrow you have caused.', '你必须对所造成的伤害予以补偿。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b8/25/B825FE262CB3E345C268660B6686ED6C.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/reparation--_gb_1.mp3');
