INSERT INTO `MASTER` VALUES (3885, 'repatriate', NULL, '[n. 被遣返回国者][v. 回国,遣返]', 'The UK owner be compelled to repatriate foreign earnings. ', '英国业主不必缴回在国外获得的利润。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0e/00/0E004EB0A483E6F5F3956CCE6A31DDCA.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/repatriate--_gb_1.mp3');
