INSERT INTO `MASTER` VALUES (3887, 'repellent', NULL, '[n. 驱虫剂][adj. 排斥的,驱除的]', 'Then we passed on to an equally repellent sight.', '接着我们又去参观了另一个同样令人厌恶的地方。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/42/1e/421EF934964D819653FCEFACC31672F6.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/repellent--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3888, 'repent', NULL, '[v. 后悔,悔悟,忏悔]', 'He is kind and gracious to all sinners who repent.', '他对忏悔的罪人一概慈悲为怀。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/57/13/57135C8003BCF2A14E3FFBE444D5204E.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/repent--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3889, 'repercussion', NULL, '[n. 弹回,反响,后果,反射]', 'The president\'s death had unexpected repercussion.', '总统的逝世引起出乎意料的反响。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ec/3c/EC3C450D1A57C7DA266655B9D92D6B8B.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/repercussion--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3890, 'repertory', NULL, '[n. 全部剧目,仓库,积贮]', 'She acted with a repertory company for three years.', '她在一个轮演剧目剧团里演出三年。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/50/45/504599DF79AC812A511CEB4F434BE746.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/repertory--_gb_1.mp3');
