INSERT INTO `MASTER` VALUES (3919, 'rescission', NULL, '[n. 废除,取消]', 'The basis for rescission is that reality of consent is absent.', '这种废除的理论基础就是缺乏真实的同意。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/45/72/457237E04FE0B6439C939F573310241D.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/rescission--_gb_1.mp3');
