INSERT INTO `MASTER` VALUES (3927, 'resonant', NULL, '[adj. 共鸣的,回响的,洪亮的]', 'The air was resonant with bells.', '空中回荡着钟声。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/62/9b/629BEC763F8AE0700E27E975095FA9FF.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/resonant--_gb_1.mp3');
