INSERT INTO `MASTER` VALUES (3929, 'respiration', NULL, '[n. 呼吸,呼吸量,植物呼吸作用]', 'He was using his accessory muscles of respiration.', '他在用呼吸辅助肌进行呼吸。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e7/d9/E7D9910175A46ED685C52B52A347400F.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/respiration--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3930, 'respiratory', NULL, '[adj. 呼吸的,与呼吸有关的]', 'The lungs are respiratory organs.', '肺是呼吸器官。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7d/cd/7DCD12FB8B83FE91B8531EE603D36E0B.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/respiratory--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3931, 'respite', NULL, '[n. 暂缓,缓刑][vt. 延迟,推延]', 'The drug brought a brief respite from the pain.', '药物暂时缓解了疼痛。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0d/84/0D84D1FA2EF8E3A5511C66F1B8E3AA74.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/respite--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3932, 'resplendent', NULL, '[adj. 辉煌的,灿烂的]', 'He glimpsed Sonia, resplendent in a red dress.', '他瞥了索尼亚一眼,见她一身红衣,光彩照人。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a8/ee/A8EE2D55D6795066E7F5B5D20A23FC81.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/resplendent--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3933, 'restatement', NULL, '[n. 再声明,重述]', 'Thus, fault plays a role in the Restatement assessment. ', '所以, 在重审估价中,缺陷也起着一定作用。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/fe/02/FE02505575ABE00BE03FCD4BEBA90203.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/restatement--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3934, 'restitution', NULL, '[n. 归还,赔偿,恢复原状]', 'These goods were compelled restitution.', '这些物品被责令退回。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/48/37/48373807C7F3B334D9E30E1809AB335E.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/restitution--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3935, 'restive', NULL, '[adj. 倔强的,难驾驭的,不耐烦的]', 'His face was quite stolid,but he looked at her with restive eyes.', '他脸上没有表情,眼睛却倔强地看着她。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ca/1f/CA1F8B33010B53F3030FEAB7823BFF18.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/restive--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3936, 'restiveness', NULL, '[n. 倔强,难以驾御]', 'There were signs of restiveness among the younger members.', '年轻成员流露出了不满的情绪。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/65/33/65331487F200EC8AB85D3B09FE82CF78.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/restiveness--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3937, 'resurge', NULL, '[vi. 再起,复活,复生]', 'The candidate resurged after leaving politics for several years.', '这位候选人在离开政坛几年后重新振作起来。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c9/6d/C96DC124DC530380FDEF531F5C196CBB.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/resurge--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3938, 'resurgence', NULL, '[n. 再起,复活,再现]', 'A resurgence of his grief swept over Nim.', '悲痛又涌上了尼姆的心头。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e0/63/E0632A17751D19DD117E7CC00CCB36F3.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/resurgence--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3939, 'resurrect', NULL, '[v. 使复活,复兴,挖出]', 'It is said that this medicine can resurrect the dead.', '据说这种药能起死回生。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4e/7f/4E7F3CDB317FA71FF3BD58C17182E17C.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/resurrect--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3940, 'resuscitate', NULL, '[v. 使复活,使苏醒,使复兴]', 'Why did South Korea resuscitate Chinese Characters?', '韩国为什么恢复汉字？', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c4/8a/C48ABEF1AB9465B99BF2E711824E38DA.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/resuscitate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3941, 'retailing', NULL, '[n. 零售业]', 'They vastly outstripped the others in the retailing industry.', '他们远远超过了零售业其他公司。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e8/ac/E8ACE7B01E9FC30B52EE6600650221DE.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/retailing--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3942, 'retard', NULL, '[v. 妨碍,迟延,减缓][n. 弱智]', 'Cold weather retards the growth of the crops.', '寒冷的天气妨碍了庄稼生长。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8e/03/8E035D9112583B060A0EF12CF1387531.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/retard--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3943, 'retch', NULL, '[v. 作呕,反胃]', 'The strange smell made me retch.', '这种怪味闻的我直干哕。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/07/72/0772F02D2BC2726C83F0C3B07DC21319.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/retch--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3944, 'retentive', NULL, '[adj. 记性好的,有保持力的]', 'She has an amazingly retentive memory.', '她有着一个惊人的好记性。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/eb/bd/EBBDFE28311EDA8769A160915A6988B9.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/retentive--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3945, 'reticent', NULL, '[adj. 寡言少语的,沉默的,谨慎的]', 'He is a reticent and modest man.', '他是个寡言少语、谦虚谨慎的人。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0c/cf/0CCF28289C06A6620E6EDD8199DD5B7D.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/reticent--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3946, 'reticular', NULL, '[adj. 网的,网状的,错综复杂的]', 'Among the tumor cells there were no or a few reticular fibers. ', '网状纤维染色肿瘤细胞间网状纤维少。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4a/c8/4AC810FC1A4BB0156498314026D6240C.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/reticular--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3947, 'retina', NULL, '[n. 视网膜]', 'Sight is made possible by rays of light impinging on the retina.', '由于光线射到视网膜上,眼睛才看得见。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b6/79/B6796A2DA01E2499CFC47CF0D2FDCF8C.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/retina--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3948, 'retiring', NULL, '[adj. 退休的,退役的,腼腆的]', 'I can\'t disappoint my public by retiring.', '我可不能退休,否则大家会失望的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a0/cc/A0CC50A303748C3B0867B38EC7FD45A7.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/retiring--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3949, 'retool', NULL, '[v. 重组,重新装备]', 'We must retool the town\'s economy.', '我们必须对乡镇经济进行重组。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/37/08/370862E05E1698F26668ECB3454597E3.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/retool--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3950, 'retouch', NULL, '[v. 润饰,修整][n. 润饰,修整]', 'Or retouch over solid edges with the Retouch brush. ', '或者用修饰刷通过修饰固体边缘。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/78/8e/788E142F04F4B97D3108CEB99D34D07C.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/retouch--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3951, 'retrace', NULL, '[v. 重描,折回,追溯]', 'We should not retrace the route our forefathers had taken.', '我们不应重走我们祖先走过的老路。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/45/87/45876D1E72F7CD241596B999E89875C5.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/retrace--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3952, 'retract', NULL, '[v. 缩回,收回,撤销]', 'I decided to retract what I had said before.', '我决定收回前面说过的话。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/1e/d9/1ED90FD1A505079AD77D24CEBD08B036.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/retract--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3953, 'retrench', NULL, '[v. 减少开支,削减花费]', 'Inflation has forced us to retrench.', '因通货膨胀我们不得不紧缩开支。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8e/ed/8EED5B3A3704EFD76F407E54F33AC7C2.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/retrench--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3954, 'retrenchment', NULL, '[n. 减少,删除]', 'Retrenchment will be necessary. ', '有必要进行紧缩。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e4/4c/E44C3A22152E312C51C84D2D14F248E7.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/retrenchment--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3955, 'retribution', NULL, '[n. 报应,惩罚,报复,报偿]', 'Restitution is more important than retribution.', '赔偿比惩罚重要。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/df/c8/DFC86E3B19CEB53383BED01D6AFC84D7.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/retribution--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3956, 'retriever', NULL, '[n. 寻回犬]', 'Oh, yes, I have a dog now, a golden retriever. ', '对了, 我现在有一条狗, 一条金色的猎狗。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/dc/e4/DCE44A28584A7BF6C5B69DBB5AF50F82.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/retriever--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3957, 'revegetate', NULL, '[v. [植] 再生长,再植]', 'They decided to revegetate in the backyard.', '他们决定在后院重新种上花草。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/62/e0/62E0734F1B5D70F7A7496B68DBDFBA6D.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/revegetate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3958, 'reverberate', NULL, '[v. 回响,反响,反射]', 'The room reverberated with the noise of the shot.', '房间里回响著枪声。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/79/26/7926D0DF78F5423F780A4FA5DD6173F4.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/reverberate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3959, 'revere', NULL, '[v. 尊敬,敬畏,崇敬]', 'Students revere the old professor.', '学生尊敬这位老教授。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/35/48/35486EBE6A2A1E86647C2DD50700FB61.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/revere--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3960, 'revered', NULL, '[adj. 可敬的,尊敬的]', 'He had been a revered Justice of the U.S.Supreme.', '他一直是一位受人爱戴的美国最高法院法官。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/35/48/35486EBE6A2A1E86647C2DD50700FB61.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/revered--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3961, 'reverential', NULL, '[adj. 虔诚的,充满敬意的]', 'It will generate reverential atmosphere in the home.', '这会使家中充溢着恭敬虔诚的气氛。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/92/f5/92F50A73BBE29D3F17E10787710A1FA3.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/reverential--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3962, 'reverently', NULL, '[adv. 恭敬地,虔诚地]', 'Drop on to their knees reverently.', '虔诚地屈膝下跪。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b0/99/B0998CCAE41E3BD4BBAE5A601639298A.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/reverently--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3963, 'reversion', NULL, '[n. 返回,逆转,恢复,反向]', 'I\'m trying to prevent the reversion of my garden to nature.', '我正在试图防止我的花园返回一片荒芜的自然状态。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0c/63/0C63D1D263D21496E71B94ACBFC4F6CD.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/reversion--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3964, 'revert', NULL, '[vi. 恢复,回复,归还]', 'You should try not to revert to your old eating habits.', '你应该尽力不要恢复到你过去的饮食习惯。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f6/9c/F69C718AF8CBA2DC5C733EF3DE78F770.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/revert--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3965, 'revile', NULL, '[v. 辱骂,斥责]', 'The tramp revile the man who drive him off.', '流浪汉辱骂那位赶他走开的人。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/57/8a/578A61F9A6C6FDB3A3568486E6296990.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/revile--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3966, 'revitalization', NULL, '[n. 新生,复活,恢复元气]', 'Where does the creative force of market revitalization come from? ', '拉动市场的创造力从何而来? 靠高素质的人去创造。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/3c/75/3C754F8549EF0D22858A293E813D611C.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/revitalization--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3967, 'revitalize', NULL, '[vt. 使复兴,使振兴,使复活,使恢复]', 'I think we have to revitalize our society.', '我觉得我们的社会需要新生。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/5c/e0/5CE0AB136B40D9291F0AE06ECB68C0F4.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/revitalize--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3968, 'revoke', NULL, '[v. 撤回,撤销,废除]', 'We hereby revoke the agreement of May8, 2004.', '我方特此宣告于2004年5月8日签订的合同无效。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c3/26/C3265439D5B342FB31B9159C1B0372DF.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/revoke--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3969, 'revolutionize', NULL, '[v. 彻底变革,使革命化]', 'Computers have revolutionized banking.', '计算机的运用彻底改变了银行业务运作。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/85/7e/857E30DDC9E33DAFD9B58F80F8F478B3.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/revolutionize--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3970, 'revulsion', NULL, '[n. 剧变,非常的厌恶,剧烈的反应]', 'This is the period of revulsion.', '这是剧变的一段时期。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/72/2b/722BD4EBF94DA397B1D9CD9CF5A74936.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/revulsion--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3971, 'rhapsodic', NULL, '[adj. 狂喜的,狂想曲的]', 'The brochure sent to customers is written in a rhapsodic style.', '送给顾客的小册子是用夸张赞美的风格写的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/56/be/56BEAC11F0C2041AE724867CA6CF2B83.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/rhapsodic--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3972, 'rhubarb', NULL, '[n. 大黄,大黄的叶柄,激烈的争论]', 'I had rhubarb tart with a lot of cream.', '我吃了添加了许多奶油的大黄小馅饼。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a4/32/A4326E3EC1E7A8CE4C1E328FEA86DA61.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/rhubarb--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3973, 'rhythmical', NULL, '[adj. 有节奏的,有韵律的]', 'The rhythmical roar of the breakers sounded like a symphony.', '击岸浪有节奏的汹涌澎湃的声音,听起来象一首交响乐。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/42/1d/421D9DB1B5379AF04FF3E5F8FB829DBB.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/rhythmical--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (3974, 'ribald', NULL, '[adj. 说话猥亵的,猥亵逗笑的]', 'The answer was lost in a shout of ribald laughter.', '回答被一阵下流的狂笑声掩盖了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e9/57/E957A70E1DC219C406E94593D8106204.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/ribald--_gb_1.mp3');
