INSERT INTO `MASTER` VALUES (4029, 'sag', NULL, '[v. 下垂,下跌,消沉]', 'As a result, the skin may sag.', '结果,皮肤就松弛下垂了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/06/c7/06C7B90F84C0F9411258757F989B70FE.mp3', 0, 3, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sag--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4030, 'saga', NULL, '[n. 世家,英雄事迹,冒险故事]', 'This new novel is an absorbing family saga.', '这部新小说是一部引人入胜的家世小说。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d2/09/D209DAE95FF75A344826296474B1A5EB.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/saga--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4031, 'sagacious', NULL, '[adj. 聪明的,睿智的]', 'He thought me much more sagacious than I was.', '他把我看得太高明了,而我实际上并不是这样。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ea/25/EA25F1F253882B9088F6E50C8DFB5040.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sagacious--_gb_1.mp3');
