INSERT INTO `MASTER` VALUES (4062, 'saucy', NULL, '[adj. 无礼的,莽撞的,活泼的]', 'She\'s a saucy little girl!', '她是个黄毛丫头！', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/1d/69/1D69CDA442A1CC40D57BC924E1E1F434.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/saucy--_gb_1.mp3');
