INSERT INTO `MASTER` VALUES (4167, 'sentient', NULL, '[adj. 有知觉的,有感情的]', 'Man is a sentient being.', '人是有感觉的生物。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/05/bb/05BBF7D0D5F7C1AC26DA3D89A89D4485.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sentient--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4168, 'sentimentalism', NULL, '[n. 感伤主义,沉于情感]', 'That is a novel reeking with sentimentalism.', '那是一本充满着感伤主义的小说。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/16/8d/168DB0C834B5AB99490EC0098F716ECE.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sentimentalism--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4169, 'sentimentalize', NULL, '[v. 流于感伤,变成多情善感]', 'This book sentimentalizes the suffering of the disabled.', '这本书以柔懦的笔调渲染了残疾人的痛苦。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/61/61/6161AAE40B75566D81949F8329183389.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sentimentalize--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4170, 'sentinel', NULL, '[n. 哨兵,传送器,(计)标记符号]', 'The sentinel was stationed on a hill.', '哨兵被派在山上站岗。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4e/f7/4EF77F39E0F0AEC1EA7DD94B443D8B32.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sentinel--_gb_1.mp3');
