INSERT INTO `MASTER` VALUES (4173, 'sequacious', NULL, '[adj. 盲从的,前后一贯的]', 'I want something sequacious now and robust. ', '我现在想要前后一贯和健全的东西。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4a/61/4A614DD1DD3A959AEE5680DAD5C4650D.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sequacious--_gb_1.mp3');
