INSERT INTO `MASTER` VALUES (4176, 'seraphic', NULL, '[adj. 如天使般的,美丽的]', 'You\'re a seraphic suggestion of attenuated thought .', '你的思想是轻灵得如同天使一般的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b6/66/B6668FAEEDB3D1E0BC26FEE780093C56.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/seraphic--_gb_1.mp3');
