INSERT INTO `MASTER` VALUES (4179, 'serendipity', NULL, '[n. 意外的运气]', 'When destiny has a sense of humor, it is called serendipity.', '当命运富有幽默感时,即被称之为缘分。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a3/ed/A3ED4DC203F352D067A708B4D237187C.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/serendipity--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4180, 'serene', NULL, '[adj. 安详的,宁静的,平静的]', 'His serene smile calmed all of us down.', '他脸上安详的微笑使我们都冷静下来。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/42/a8/42A8C2E0E029FD8A3FA059546A038C9F.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/serene--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4181, 'serenity', NULL, '[n. 宁静,沉着]', 'He thought of her serenity as a foil for his intemperance.', '在他看来,她的平静反衬出了他的放纵。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/00/5d/005D53071E16C2EFF17E67CB4C093937.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/serenity--_gb_1.mp3');
