INSERT INTO `MASTER` VALUES (4218, 'short-range', NULL, '[adj. 短程的,短期间的]', 'They include short-range forces and long-range forces. ', '它们包括 近程 部队和远程部队. ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/3c/e5/3CE5735C8B6E7688FE17B6435DD559C4.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/short-range--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4219, 'shortsighted', NULL, '[adj. 近视的,缺乏远见的]', 'He was too shortsighted to focus on the object.', '他由于近视过深而无法把视力焦点对准在该物体上。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/6d/07/6D078C4BEC81D5B34A5B9E5AA1A82E1B.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/shortsighted--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4220, 'short-sightedness', NULL, '[n. 近视]', 'She is useding to squinting beacuse of short sight.', '因为有点近视,她有眯着眼睛看人的习惯。', 'https://dictionary.cambridge.org/media/english/us_pron/u/uss/ussho/usshort002.mp3', 0, 17, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/short-sightedness--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4221, 'short-term', NULL, '[adj. 短期的]', 'Malware is short for malicious software.', '恶意软件是短期的恶意软件。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8c/d4/8CD47508145484B9E594FA7B301E3790.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/short-term--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4222, 'shriek', NULL, '[v. 尖叫,叫喊][n. 尖叫]', 'The shriek sent shivers down my spine.', '那尖叫声使我的背脊起了一阵寒颤。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/84/3f/843F54284294BF85BB89F0E7019528E7.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/shriek--_gb_1.mp3');
