INSERT INTO `MASTER` VALUES (4261, 'slake', NULL, '[vt. 消除,满足,(石灰)熟化]', 'We had to slake ourselves with rainwater in the desert.', '在沙漠中我们不得不用雨水解渴。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/45/c7/45C786EECCBDDCA09D4D5E1462D7FB7C.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/slake--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4262, 'slander', NULL, '[n. 中伤,诽谤][vt. 中伤,诽谤]', 'In the last election, they spattered their rivals with slander', '在上届选举中,他们用谣言中伤对手。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c3/6d/C36DB446E59C94EE5C40178D563111B8.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/slander--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4263, 'slanderous', NULL, '[adj. 诽谤的,中伤的]', 'Her slanderous words soiled his reputation.', '她中伤性的话损害了他的名誉。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b0/f3/B0F3C59339FF4225A44AD08E627D3964.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/slanderous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4264, 'slant', NULL, '[v. (使)倾斜,使倾向][n. 斜面,偏向性]', 'The wooden floor has a noticeable slant.', '这木地板可以看得出有些倾斜。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/15/c7/15C71AB742AC58D72BB279D26A4C1AA7.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/slant--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4265, 'slat', NULL, '[n. (活动百叶窗等上的)板条]', 'The oil paintings are backed up with slats.', '这些油画是用细木条做背衬的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/57/1d/571DB6B10EB99FD0C05713C9387C657B.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/slat--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4266, 'slattern', NULL, '[n. 邋遢的女人,妓女,荡妇]', 'A slattern is a dirty untidy woman.', 'slatterny意思是一个肮脏的不整洁的女人。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9f/1c/9F1C28AFB2B776CC7A2BA7687C18F9BD.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/slattern--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4267, 'slavish', NULL, '[adj. 奴隶的,奴隶性的,盲从的]', 'Her slavish devotionto her job ruled her life.', '她对工作奴隶般的投入主宰了她的生活。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ef/f9/EFF97FE189AC11C6FA442F9C5FC8C330.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/slavish--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4268, 'slay', NULL, '[vt. 杀害,残杀,使大笑]', 'Two visitors were brutally slain yesterday.', '昨天有两名游客惨遭杀害。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/cb/c4/CBC4FA655B30881184FC059BF2721959.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/slay--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4269, 'sledge', NULL, '[n. 雪橇][v. 坐雪橇]', 'The sledge coasted down the mountain slope.', '雪橇滑下山坡。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0e/88/0E889AF3C3AE167C60022DF653828407.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sledge--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4270, 'sleek', NULL, '[adj. 光滑的,圆滑的][v. 使光滑]', 'Sleek surfaces are a hallmark of the style.', '光滑的表面是现代派厨房的特点。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b6/95/B695651176BDF8C8C5FB682062C585B3.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sleek--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4271, 'sleight', NULL, '[n. 熟练,巧妙,诡计,狡诈]', 'The trick is done simply by sleight of hand.', '变这个戏法全凭手法敏捷。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/99/c8/99C8F6010C8B5404D9B4D526FDDD16A6.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sleight--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4272, 'slew', NULL, '[n. 沼地,回转,许多][v. 转向]', 'He faced a whole slew of problems.', '他面临了一大堆的问题。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/08/df/08DF13845358A934756FF0CA142E40C3.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/slew--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4273, 'slick', NULL, '[adj. 娴熟的,油滑的][n. 海面浮油]', 'I advised them to watch out for slick spots on the sidewalk.', '我叫他们当心人行道上路滑的地方。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/50/23/502334D7F06494B91FD343ACDFF68388.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/slick--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4274, 'slime', NULL, '[n. 烂泥,黏液][v. 涂上黏泥]', 'There is a coating of slime on the unwashed sink.', '未刷洗的水涤槽上有一层污垢。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e4/f1/E4F11043F829487C3623FA56541B872C.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/slime--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4275, 'slimy', NULL, '[adj. 黏滑的,卑劣的]', 'The walls were all slimy and green.', '这些墙布满了青苔,极其黏滑。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ae/93/AE93E47B4B39DF6A2E3100098FACA472.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/slimy--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4276, 'slink', NULL, '[v. 偷偷溜走,悄悄溜走]', 'The thief slunk down the dark alley.', '那个贼偷偷钻进黑胡同里。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9e/3e/9E3E9DC8C0F01C486A732D809F7DC579.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/slink--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4277, 'slippage', NULL, '[n. 下滑,滑移,动力传动损耗]', 'Such slight slippage does not constitute a trend.', '这样轻微的下滑不会构成趋势。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7a/48/7A4838DC62F9AB90C157AC28A3390B49.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/slippage--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4278, 'slipshod', NULL, '[adj. 马虎的,不严谨的]', 'You\' re too slipshod about your presentation.', '你表达得太不认真.', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/81/51/81516CB8C7A643F76429BDEE4928D0F0.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/slipshod--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4279, 'sliver', NULL, '[n. 裂片,碎片,薄片]', 'A sliver of glass nicked my hand.', '一片玻璃扎了我的手。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/72/1c/721CEDA993EABFCB316357B6D55C6731.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sliver--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4280, 'slobber', NULL, '[v. 流口水,垂涎][n. 口水]', 'I still slobber when thinking of the dishes.', '想起美餐,我仍流口水。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f8/84/F8849E3C120466FFE46DB2715D570971.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/slobber--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4281, 'slog', NULL, '[v. 苦干,跋涉,努力做][n. 一段时间努力]', 'He started to slog his way through the undergrowth.', '他踏上了穿越林莽的艰难征程。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/6e/3a/6E3A3D410EAEE57D45B3F522331678E9.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/slog--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4282, 'sloop', NULL, '[n. 单桅小帆船,小型护航舰]', 'A sloop has only one central pole.', '单桅帆船只有一个中央桅杆。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/44/09/4409FBB7FEC1563971B00A7386762281.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sloop--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4283, 'sloping', NULL, '[adj. 倾斜的]', 'I managed to pull myself up onto a wet, sloping ledge.', '我终于爬上了一块潮湿倾斜的暗礁。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/1c/80/1C800B31F18E605272E7D0C11D91586A.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sloping--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4284, 'sloppy', NULL, '[adj. 稀薄的,草率的,肥大的]', 'At home I tend to wear big sloppy jumpers and jeans.', '在家里我喜欢穿宽大的套衫和牛仔裤。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2e/3f/2E3F82B3720920BEA3D08E3DC8BE4B58.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sloppy--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4285, 'slosh', NULL, '[v. (液体的)晃荡,在泥中荡,泼溅]', 'Devils don\'t slosh around much of a Sunday, I don\'t reckon. ', '鬼魂在星期日的大部分时间里都不会晃荡,我想。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/cd/8f/CD8F85205938FDA5C782D588D2C8DB37.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/slosh--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4286, 'sloth', NULL, '[n. 树獭,懒惰]', 'Sloths live in trees and move very slowly.', '树獭生活在树上而且行动缓慢。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ea/a6/EAA6286066FD9D56D4A354725AEB1D85.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sloth--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4287, 'slothful', NULL, '[adj. 怠惰的,懒惰的,迟钝的]', 'He was not slothful, he had been busy all night.', '他可不懒,昨晚他忙了整整一夜。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/22/4f/224F565348230E393E8D943107A242DF.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/slothful--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4288, 'slouch', NULL, '[n. 没精打采的姿态][v. 没精打采地站]', 'There had something of a slouch and a sneer in his bearing.', '他的脸上带着一副心灰意懒而又不屑一顾的神情。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/30/18/30186C2A0A8B0635D04E3255B435DA55.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/slouch--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4289, 'sloven', NULL, '[n. 邋遢鬼][adj. 疏忽的,不整洁的]', 'Such sloven work habits will never produce good products.', '这样马马虎虎的工作习惯决不能生产出优质产品来。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/47/01/4701A4D2F5DA7BFD3B0F495E5C86EEA9.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sloven--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4290, 'slovenly', NULL, '[adj. 不修边幅的,邋遢的]', 'He had no dealings with those slovenly easy riders.', '他不与那些不修边幅,到处闲荡的人打交道。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/eb/a8/EBA8E4CCB2CF438A664836EFB9E144DA.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/slovenly--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4291, 'slug', NULL, '[n. 蛞蝓,懒散的人,子弹][v. 拳头猛击]', 'The small garden slug can stretch its body to enter worm holes.', '渺小的庭院蛞蝓能把身体伸长而钻进虫子洞里。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/25/c9/25C9EDBD62332C67C961DA0AC19E1905.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/slug--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4292, 'sluggish', NULL, '[adj. 迟缓的,懒惰的,萧条的]', 'There is a sluggish stream.', '那有一条流速缓慢的溪流。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/49/ad/49AD4001E639C9180BE792728A950875.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sluggish--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4293, 'slumber', NULL, '[n. 睡眠,休眠][v. 睡觉,打盹]', 'Don\'t wake him from his slumber because he needs the rest.', '不要把他从睡眠中唤醒,因为他需要休息。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b5/ee/B5EEA93CC534331CF9692227CB743AAE.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/slumber--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4294, 'slur', NULL, '[n. 诽谤,诋毁][v. 含糊地说,诽谤]', 'That was an awful slur, but it wasn\'t really surprising.', '这是无耻的诽谤,但是实际上也不足为奇。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e4/fd/E4FD5DBEFC370A51C3612988F86C0794.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/slur--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4295, 'slurp', NULL, '[v. 饮食出声][n. 吃喝的声音]', 'He was slurping (down) his soup.', '他喝汤时发出啧啧的声音。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f3/cb/F3CB7DBC28DFABA517FCF765DB488A88.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/slurp--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4296, 'slurry', NULL, '[n. 泥浆]', 'The gypsum slurry is pumped into a diked area.', '我们用泵将石膏料浆打到一块用堤围起来的空地中。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7a/11/7A114D896DFCFB1F3645235CFC708161.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/slurry--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4297, 'sluttish', NULL, '[adj. 懒惰的,邋遢的,淫荡的]', 'Her hair was tied in a sluttish knot.', '她的头发胡乱地束成一团。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/93/2f/932FE44D7E4606A03FF9A1BD78FAFA1C.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sluttish--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4298, 'smallpox', NULL, '[n. (医学)天花]', 'Smallpox has finally been conquered.', '天花终于被遏制住了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2a/35/2A3569AC154858ED7A398ED48814B513.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/smallpox--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4299, 'smarmy', NULL, '[adj. 令人厌烦的,爱说奉承话的]', 'I hate his smarmy compliments. ', '我痛恨他拍马屁的恭维。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a0/0d/A00D75CF8CA7308135D5414CD031D791.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/smarmy--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4300, 'smattering', NULL, '[n. 一知半解,一点点]', 'He has a smattering of knowledge about physics.', '他对物理一知半解。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8b/30/8B305B64CE4FAF40E7CBA6156CC40B54.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/smattering--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4301, 'smear', NULL, '[v. 涂抹,弄脏,诽谤][n. 污点,诽谤]', 'We smeared cream on our faces.', '我们在脸上搽雪花膏。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/28/6b/286BA7F750F43ED27B25BDE95066DE55.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/smear--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4302, 'smelting', NULL, '[n. 熔炼]', 'Fire provided a means of smelting ores.', '火提供了熔炼矿石的手段。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/3b/fb/3BFBA6AF7C945015286EAB5C0E86477F.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/smelting--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4303, 'smirch', NULL, '[n. 污点][vt. 玷污]', 'Study of reducing compound material\'s drilling smirch.', '减少复合材料钻孔污斑的研究。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/68/60/6860DB16B730131949EA62E78EB16947.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/smirch--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4304, 'smirk', NULL, '[v. 假笑,得意地笑][n. 假笑,傻笑]', 'Come on, professor, do not smirk at me like that.', '拜托！老师,你不要那样对着我假笑。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/45/89/4589FB6254CF09D9B98CF043ABFA47BA.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/smirk--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4305, 'smite', NULL, '[v. 重击,折磨,迷惑]', 'The hero smote the giant with his sword.', '英雄用剑猛劈巨人。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c0/19/C019073AD51C018ADD57CFE3A9D55C0C.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/smite--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4306, 'smother', NULL, '[v. 使窒息,闷死,扼杀,把火焖熄]', 'They smother his better instinct.', '这些声音窒息了他的良知。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/bc/de/BCDE06B61589E6C125FB7738C30A85EA.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/smother--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4307, 'smudge', NULL, '[n. 污点,渍痕,浓烟][v. 把...弄脏]', 'You\'ve got a smudge on your cheek.', '你脸上有一块污迹。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d0/8d/D08D348C4BE448F4F986678AF0E04AAB.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/smudge--_gb_1.mp3');
