INSERT INTO `MASTER` VALUES (4358, 'sparsely', NULL, '[adv. 稀少地,贫乏地]', 'We took tea by lamplight in his sparsely furnished house.', '在他那所少有陈设的房子里,我们坐在灯下喝着茶。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c6/fc/C6FC37A67D75E3727B08AA3D846EA99E.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sparsely--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4359, 'spartan', NULL, '[adj. 清苦的,简朴的,斯巴达式的]', 'Only one among us keeps his Spartan reserve.', '我们之中只有一人仍保持着斯巴达人的缄默。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9e/64/9E64123104E01574B59359C90CD5CD57.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/spartan--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4360, 'spasm', NULL, '[n. 抽筋,痉挛]', 'A curious spasm passed through her.', '一种奇异的痉挛的感觉传遍她周身。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b7/64/B764C99CDF94095A13759C085C187C40.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/spasm--_gb_1.mp3');
