INSERT INTO `MASTER` VALUES (4362, 'spat', NULL, '[n. 小争吵,口角][v. 争吵,争执]', 'Her parents always have spats.', '她的父母经常有些小的口角。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9a/c5/9AC500DFF09AF81E624BF932DDEA7A35.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/spat--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4363, 'spate', NULL, '[n. 泛滥,洪水,突然的一阵]', 'After the storm all the rivers were in spate.', '暴雨过后河水都上涨了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9c/54/9C54D8DAFE61A143B634855975A975A2.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/spate--_gb_1.mp3');
