INSERT INTO `MASTER` VALUES (4365, 'spawn', NULL, '[n. 卵][vt. 使产生,催生][vi. 产卵]', 'I found a mass of spawn in the fish before cooking.', '烧鱼前,我发现鱼里有很多鱼籽。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/11/ef/11EFB3AC01ED4D120081B49EC6A3C959.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/spawn--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4366, 'specialise', NULL, '[vi. 专门从事,专攻,专门研究]', 'Most of the staff specialise in the care of children.', '多数员工都掌握专业的儿童保育知识。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ec/0e/EC0EFEE6054898007C01B7398744A210.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/specialise--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4367, 'specialized', NULL, '[adj. 专门的,专科的]', 'Both games require strength and specialized skills.', '两者都要求力量强度和专门的运动技巧。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/82/26/82269D262CA0261451F72884E9A2636F.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/specialized--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4368, 'specifics', NULL, '[n. 细微问题,细节]', 'Do not disclose the specifics of the project.', '不要给他们透露项目的细节。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/34/c9/34C98C950882A1B270E8703AA68FBE67.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/specifics--_gb_1.mp3');
