INSERT INTO `MASTER` VALUES (4460, 'stingy', NULL, '[adj. 吝啬的,小气的]', 'There was once a very poor person who was also very stingy.', '有一个很穷又很吝啬的人向上帝祷告。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d0/6a/D06AE0C365C2D4376E4263E79FBDCC1B.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/stingy--_gb_1.mp3');
