INSERT INTO `MASTER` VALUES (4501, 'stunt', NULL, '[n. 特技表演][v. 阻碍成长,表演特技]', 'Have you watched a stunt flying?', '你看过特技飞行表演吗?', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/6b/c5/6BC5FD0738DB188CBD15CF54C3E60BCA.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/stunt--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4502, 'stupefy', NULL, '[v. (使)茫然,失去知觉]', 'Exhilarated or stupefied by or as if by alcohol; intoxicated.', '醉的,陶醉的因(仿佛)喝酒类饮料而兴奋或木然的; 醉的', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b3/d5/B3D5339239CF690ADB6EF6E488134FDB.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/stupefy--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4503, 'stupendous', NULL, '[adj. 惊人的,巨大的]', 'The opera was quite stupendous.', '这部歌剧很精彩。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9a/31/9A31C4070897C9F155B15498C0C99E45.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/stupendous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4504, 'stupor', NULL, '[n. 昏迷,麻木,不省人事]', 'Kunta lay numbly, in a kind of stupor.', '昆塔麻木地躺在那里,陷于一种痴呆的状态。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/86/d5/86D593BC4C0374E6136C49889420154C.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/stupor--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4505, 'stutter', NULL, '[v. 口吃,结巴着说话][n. 口吃]', 'Those who stutter often receive speech therapy.', '那些口吃者经常接受语言治疗。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/24/9b/249B193F875BDE3694DE797A057F6D81.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/stutter--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4506, 'stygian', NULL, '[adj. 地狱的,阴暗的,冥河的]', 'I\'ll explore a stygian cave.', '我要去一个阴森森的山洞探险。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d0/d2/D0D27CC7159AFC2F4768B96B3A2B448D.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/stygian--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4507, 'stylize', NULL, '[vt.  使风格化,仿效...的风格]', 'Fabric with highly stylized animal prints.', '具有高度风格化动物图案的织物。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9f/34/9F340EDFAC6E78CDA935193B30D081DC.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/stylize--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4508, 'stylized', NULL, '[adj. 程式化的,风格化的]', 'The gestures are highly stylized and symbolic. ', '各种姿势都是高度程式化和象征。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a9/19/A919BFB27D63F47DF89462E331221B1D.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/stylized--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4509, 'stymie', NULL, '[vt.  使 ... 处于困难境地, 妨碍]', 'Wind, Rain and Nigeria can\'t stymie the U.S. ', '风雨和尼利亚都无法阻挡美国队前进的步伐。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f4/03/F4038790D6C17590ACAD6F8285850472.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/stymie--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4510, 'suavity', NULL, '[n. 温和,殷勤,愉快]', 'She was highly impressed by his elegance and suavity.', '她被他的温文尔雅深深打动。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/73/a6/73A6547DBA58067D67CD71210E5DC66A.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/suavity--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4511, 'subdiscipline', NULL, '[n. 学科的分支,亚学科]', 'Educational geography is a subdiscipline of education and geography.', '教育地理学是一门教育学和地理学分支学科。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/1b/90/1B90F98D6F1312888B393F9F0778FACA.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/subdiscipline--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4512, 'subdivision', NULL, '[n. 细分,分部,再分的部分]', 'Each subdivision has its own language.', '每个分部都有自己的语言。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0d/8e/0D8EC3DAFEA91FED5A92916C9A93E4A0.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/subdivision--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4513, 'subdue', NULL, '[v. 使服从,压制,减弱]', 'No one has been able to subdue these areas.', '从没有人能够压制这一地区。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2b/ff/2BFF1DB85D8DE62CEC1B617F8D00DF7A.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/subdue--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4514, 'subdued', NULL, '[adj. 被镇住的,轻声的,柔和的]', 'There is a subdued atmosphere in the school at exam time.', '在考试期间,学校里有一种压抑的氛围。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0e/13/0E138AC8B914D9BA46719021A8B9EC4D.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/subdued--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4515, 'subjected', NULL, '[adj. 从属的,隶属的]', 'His family was subjected to a hideous attack by the gang.', '他的家人遭到了匪帮的恐怖袭击。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/63/b8/63B846D546E9906C12481FC53BDBB3F4.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/subjected--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4516, 'subjugate', NULL, '[v. 征服,制服,克制,抑制]', 'Imperialism has not been able to subjugate China.', '帝国主义不能征服中国。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d8/d3/D8D357333B17A82D95D080D38A9C2269.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/subjugate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4517, 'sublimate', NULL, '[v. 使升华,使净化][n. 升华物]', 'Her sublimate future husband will be tall, dark, and handsome.', '她理想化的未来丈夫将是身材高大,皮肤浅黑,相貌英俊。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c4/d6/C4D61CA3019CC3D27A4C1779723D1869.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sublimate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4518, 'sublime', NULL, '[adj. 高尚的,壮观的,极其的][n. 极点]', 'I like sublime mountain scenery.', '我喜爱壮丽的山景。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/6a/e2/6AE2687AF1CBCBC6D35F4EFD6DF6E386.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sublime--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4519, 'subliminal', NULL, '[adj. 下意识的,潜意识的]', 'The soft sell approach gets to consumers in a subliminal way.', '软广告通过潜意识的作用来影响消费者。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/53/25/5325C5029CC3FD5FCB1DACE92BDEFC36.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/subliminal--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4520, 'submerged', NULL, '[adj. 水下的,沉浸的,遮覆的]', 'The ship was bilged by a submerged reef.', '船撞上暗礁,结果船底漏了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e1/39/E139F56BAE6CC038B139A06B0F29BEF9.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/submerged--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4521, 'suborn', NULL, '[vt. 教唆,贿赂,教唆某人作伪证]', 'If he thinks that he can suborn me, he is grievously in error.', '如果他认为可以收买我,那他就大错特错了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/44/f4/44F432A0C1160BB96F2C7A4D24D9C9C6.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/suborn--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4522, 'subpoena', NULL, '[n. 法院传票][v. 用(传票)传唤]', 'The couple may get a subpoena to appear.', '这对夫妇可能会接到传票出庭。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d2/b1/D2B11244559E45F35039218860A620F3.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/subpoena--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4523, 'subsection', NULL, '[n. 小部份,小单位,细分]', 'A brief exposition is given in this subsection and the next.', '在这一小节和下一小节中作概要的说明。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/95/08/95089110867A0BD49AA3042A6953B1CD.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/subsection--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4524, 'subservient', NULL, '[adj. 卑屈的,奉承的,次要的,从属的]', 'It was horrible to have to be affable and subservient', '不得不强作欢颜卖弄风骚,真是太可怕了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/22/62/22627B76A923DC5C848070F438445446.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/subservient--_gb_1.mp3');
