INSERT INTO `MASTER` VALUES (4526, 'subsidiary', NULL, '[n. 子公司,附属机构][adj. 辅助的,附属的]', 'A lack of corporate interest has made the subsidiary an orphan.', '因缺乏共同利益,这家附属机构无人管理。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f7/1e/F71E611CC1FB32DC2ED62957AB4FE7F5.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/subsidiary--_gb_1.mp3');
