INSERT INTO `MASTER` VALUES (4528, 'subsoil', NULL, '[n. 下层土,底土][v. 翻起 ... 的底土]', 'Earthworms burrow deep into the subsoil.', '蚯蚓深深地钻进底土。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/bb/a7/BBA75B79784D7B6AC42D6C550B88CCEB.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/subsoil--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4529, 'subspecies', NULL, '[n. 亚种]', 'Along a cline,subspecies with distinct characteristics may arise.', '在变异群中,带有明显特征的亚群可能产生。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2c/7e/2C7E880B1B0310707D2BF2E7B2E210C7.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/subspecies--_gb_1.mp3');
