INSERT INTO `MASTER` VALUES (4536, 'subtly', NULL, '[adv. 敏锐地,巧妙地,精细地]', 'He coped with the embarrassment subtly.', '他很巧妙地应付了一个尴尬局面。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/26/55/26553128254F35C34A67E8E433CFF064.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/subtly--_gb_1.mp3');
