INSERT INTO `MASTER` VALUES (4541, 'subvention', NULL, '[n. 补助金,津贴,援助]', 'The association is funded by an annual subvention from the government.', '协会的经费,每年由政府拨款补助。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/86/d1/86D1F99BEA6D6D24B13E06948D2D5657.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/subvention--_gb_1.mp3');
