INSERT INTO `MASTER` VALUES (4546, 'succinctness', NULL, '[n. 简明,简洁]', 'The suggested format encourages succinctness.', '被建议的格式提倡简洁。', 'https://dictionary.cambridge.org/media/english/us_pron/u/uss/ussub/ussubtr009.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/succinctness--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4547, 'succor', NULL, '[n. 救援,援助者]', 'In two short hours we may look for succor from Webb. ', '在短短的两小时内,韦布将军的救兵就可望到达。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7e/94/7E94EAAAB298A4D1FCA00F6B22825CDD.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/succor--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4548, 'succumb', NULL, '[v. 屈从,死]', 'Malnourished children are more likely to succumb to infections.', '营养不良的儿童更有可能死于感染。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/6e/39/6E395BB9DDF05612058D8F4F66757CD6.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/succumb--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4549, 'sucker', NULL, '[n. 傻瓜,吸盘,吸管,棒棒糖]', 'You are a sucker to believe his stories.', '你居然相信他的说法,真是大傻瓜！', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d3/5d/D35DCF136312A3FABC7696FF789D1B79.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sucker--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4550, 'suckle', NULL, '[v. 哺乳,吮吸,吸取]', 'She suckles her baby hardly.', '她艰难地哺育孩子。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0a/bd/0ABDD37C5260843822DCD701F17D55D8.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/suckle--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4551, 'suffocate', NULL, '[v. (使)窒息,(使)缺氧,(使)阻碍]', 'But they do suffocate from a lack of air.', '但它们确实也会因为缺少空气而窒息。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e9/d6/E9D6462E89F56250A7E7AC240E090135.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/suffocate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4552, 'suffrage', NULL, '[n. 投票,选举权,参政权]', 'The voters gave their suffrage to him.', '投票人都投票选他。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0b/5d/0B5D942F0317EE395CE2CCDDF084473A.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/suffrage--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4553, 'suffragist', NULL, '[n. 参政权扩大论者,妇女政权论者]', 'Margaret Mitchell was also a notable suffragist.', '玛格丽特米切尔同时也是一位著名的妇女政权论者。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/82/2e/822EB50FC5D738295CE7DB1D4EFFEF32.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/suffragist--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4554, 'suitably', NULL, '[adv. 适当地,(与期望)相符地]', 'It is appropriate that everyone be suitably attired.', '人人穿戴得体是恰当的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/79/be/79BECAAD86528EA5A7EDE193FF2D37D8.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/suitably--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4555, 'suited', NULL, '[adj. 适合的]', 'The girl is quite suited for the position .', '这姑娘很适合担任这个职务。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/55/25/55257116B08A0F7042F385CC51A2652E.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/suited--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4556, 'sulky', NULL, '[adj. 生气的,阴沉的]', 'He was very sulky about it indeed.', '他对这事确实很生气。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/19/93/19930DFDB9F8AA4DCD8FC4B3F7AF7E6F.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sulky--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4557, 'sullen', NULL, '[adj. 愠怒的,闷闷不乐的,阴沉的]', 'The sullen child refused to answer my questions.', '那愠怒的孩子拒绝回答我的问题。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/04/77/04776E98D53A73DE7AEA43236CB649C4.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sullen--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4558, 'sully', NULL, '[v. 玷污,弄脏][n. 污点,污斑]', 'I wouldn\'t sully my hands by acceptinga bribe.', '我决不接受贿赂,一尘不染。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e7/1e/E71EE9660C43F5227386FCDA656647A5.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sully--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4559, 'sultry', NULL, '[adj. 闷热的,风骚的,性感的]', 'I met her in a sultry summer afternoon.', '我在夏天一个闷热的下午遇见了她。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/3c/88/3C881E945EB3B7AE290E72B3CC262127.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sultry--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4560, 'summarise', NULL, '[v. 概括]', 'To summarise, this is a clever approach to a common problem.', '总而言之,这是一个解决常见问题的巧妙方法。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/cb/d2/CBD24D414B7E74D74F0D287EF60A7556.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/summarise--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4561, 'summation', NULL, '[n. 总结,加法,总和,有代表性的整体]', 'The defense attorney phrased his summation at last.', '最后,辩护律师作了辩论总结。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b7/14/B71474F6FBFC66240434DA6F4C58D34D.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/summation--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4562, 'sumptuous', NULL, '[adj. 华丽的,奢侈的]', 'Life is a sumptuous funeral and burial.', '生命是一场华丽的礼葬。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/91/e7/91E74983618912E39BBDF7D86AFA9B71.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sumptuous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4563, 'sunder', NULL, '[v. 分开,分离]', 'Lightning tore the tree in sunder.', '闪电把树劈成两半。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/83/92/839248E648DEF3DB527F383E747C0F10.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sunder--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4564, 'sundial', NULL, '[n. 日昝仪,日规]', 'The hands are actually modeled after the shadow on a sundial.', '时针实际上是以日昝上的阴影为模型的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8f/32/8F32C6FDAF910B4AD7A12FFCDBB6F8FA.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sundial--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4565, 'sundry', NULL, '[adj. 各种各样的,杂七杂八的]', 'We can see the rich man on sundry occasions.', '我们能在各种场合见到那个富豪。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f9/1e/F91EF1D1FC96B3B1129E237BC2F2E0C5.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sundry--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4566, 'sunflower', NULL, '[n. 向日葵]', 'The sunflower turns towards the sun.', '向日葵向着太阳。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f9/aa/F9AA9965C9D29D5435C26818E4C78283.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sunflower--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4567, 'sunglasses', NULL, '[n. 墨镜,太阳镜]', 'Her eyes were masked by huge round sunglasses.', '她的双眼被一副圆形大墨镜遮住了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a2/09/A20968A2E8F1C069A3ADCF350D6F6A46.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sunglasses--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4568, 'sunlit', NULL, '[adj. 被日光照射的]', 'Her house has two big sunlit rooms with floor-to-ceiling windows.', '她的房子里有两间向阳的房间,并且有落地大窗。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e5/11/E51195FE20D764BD6B85F15654177638.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sunlit--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4569, 'sunshade', NULL, '[n. 遮阳伞,天棚,帽遮]', 'A sudden gust of wind blew his sunshade inside out.', '一阵狂风把他的遮阳伞给吹翻了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/22/88/22881FB7BEAF6B692CE2E238546F4F04.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/sunshade--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4570, 'superannuate', NULL, '[v. (使)领养老金退休,废弃]', 'She is a superannuated opera star.', '她是一位过气的歌剧演员。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/23/a7/23A71AE29DE3A279ED8F352BFFD37FED.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/superannuate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4571, 'superannuated', NULL, '[adj. 老朽的,退休的,陈旧过时的]', 'Are you still riding that superannuated old bike?', '你还骑那辆老掉牙的自行车吗?', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/66/80/6680AE47C738AEC43D3E21FE2737AE7D.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/superannuated--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4572, 'supercilious', NULL, '[adj. 目中无人的,高傲的]', 'I resent your supercilious and arrogant attitude.', '我讨厌你这种目中无人的傲慢态度。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/91/9c/919C36057EE2F110BE92578936BAF553.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/supercilious--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4573, 'supercontinent', NULL, '[n. [地]超大陆]', 'The study of supercontinent breakup is a project of earth science.', '超大陆裂解研究是地球科学的一个课题。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d2/54/D2543E53D59809642FA12FF56F9EB075.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/supercontinent--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4574, 'supererogatory', NULL, '[adj. 职责以外的,多余的]', 'It was supererogatory for her to gloat.', '她幸灾乐祸。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9d/54/9D54B737C3F15DCD6C55A369BDD54439.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/supererogatory--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4575, 'superficially', NULL, '[adv. 表面地,表面上地]', 'The film touches on these issues, but only superficially.', '这部电影涉及了这些问题,但却流于表面。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/17/dd/17DD1680E53863C82232149182EF3435.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/superficially--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4576, 'superfluity', NULL, '[n. 多余,过剩,奢侈品]', 'This book has a superfluity of introduction.', '此本书中有多余的介绍。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/63/b0/63B053CA351987004BC4CF5B2E97A0F4.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/superfluity--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4577, 'superimpose', NULL, '[vt. 置于某物之上,添加]', 'Westerners should not superimpose its value judgement on China.', '西方人不应该把他们的价值观强加于中国。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2b/c8/2BC8021D3B72441B52A50FC080F27B4E.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/superimpose--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4578, 'superlative', NULL, '[adj. 最好的,最优秀的][n. 最好的事物]', 'We went to a superlative restaurant.', '我们去了一家最好的餐馆。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/fd/fc/FDFC9A18DC41E267EDD22797AE0504EF.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/superlative--_gb_1.mp3');
