INSERT INTO `MASTER` VALUES (4580, 'supernova', NULL, '[n. (天文)超新星]', 'This image shows the entire region around the supernova.', '这张图像显示了超新星周围的整个区域。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/34/f6/34F619F5047093E354143FE7B54C3208.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/supernova--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4581, 'supersede', NULL, '[vt. 取代,接替,废弃]', 'Will factory workers be entirely superseded by machines one day?', '工人将来能完全由机器取代吗?', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a7/f3/A7F3579477672128E0C0C3C57B0F006B.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/supersede--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4582, 'superstructure', NULL, '[n.  上层建筑, 上层结构,上部构造]', 'Education forms part of superstructure.', '教育是上层建筑。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a8/ae/A8AEA3F793F5CD7E0E2706614E229916.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/superstructure--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4583, 'supine', NULL, '[adj. 仰卧的,懒散的]', 'In fact America\'s government has been anything but supine of late.', '事实上最近美国政府绝对不是躺着不干事。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8a/3f/8A3FB72B41AADD699D342AAABC4C6ABA.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/supine--_gb_1.mp3');
