INSERT INTO `MASTER` VALUES (4585, 'supple', NULL, '[adj. 柔软的,灵活的][vt. 使柔软,使灵活]', 'I picture my spine supple and flexible.', '我想像我的脊椎是柔软弹性的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/61/c9/61C930289FB0AA44712C5E40A9CE1739.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/supple--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4586, 'supplementation', NULL, '[n. 增补,补充,追加]', 'She returned to baseline after vitamin supplementation.', '增补维生素后病变改善。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/1f/6e/1F6E91553519BE6F2E6443AC44F759B5.mp3', 0, 15, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/supplementation--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4587, 'suppliant', NULL, '[adj. 哀恳的][n. 恳求者]', 'He asked for help in a suppliant attitude.', '他以恳求的态度要我帮忙。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/da/7f/DA7F9AEE6B06F2A2A6781F80748D9712.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/suppliant--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4588, 'supplicate', NULL, '[v. 恳求,乞求]', 'She supplicated for pardon.', '她恳求原谅。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/72/1e/721E3546DCEAEAA517370F60AE2D9EAF.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/supplicate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4589, 'supremely', NULL, '[adv. 无上地,崇高地,极度地]', 'She gets on with her job and does it supremely well.', '她继续她的工作,并且做得非常出色。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/cf/18/CF1804EB09F392CFBE945B04DD3BBEBD.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/supremely--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4590, 'surcharge', NULL, '[n. 额外费用,附加税][vt. 额外收取]', 'What\'s the surcharge on this express parcel?', '这个快邮包裹的额外邮资是多少?', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f9/4d/F94D22FBD2822E5943E6D786C9F445A1.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/surcharge--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4591, 'surfeit', NULL, '[n. 过食,过量][v. 暴食,过分沉溺]', 'A surfeit of rich food is bad for you.', '多吃油腻食物对身体有害。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/85/35/8535DC28AB7F23440313F9264777504C.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/surfeit--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4592, 'surging', NULL, '[adj. 浪涌的,冲击的]', 'Anger surged up within him.', '怒火在他心中燃烧。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b1/8a/B18AF578D138838D987A0A425B53FB6C.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/surging--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4593, 'surly', NULL, '[adj. 暴躁的,(天气)阴沉的,傲慢的]', 'She is always so surly,she never smiles at anyone.', '她总是那么个坏脾气,对谁也没有一个笑脸。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9f/d8/9FD8D3043BA665467FF7335134CED0C8.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/surly--_gb_1.mp3');
