INSERT INTO `MASTER` VALUES (4786, 'transcription', NULL, '[n. 抄本,抄本,转录]', 'The transcription of his speech must be punctuated.', '他的讲话文本得加上标点符号。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8c/07/8C07856B35ABFB98686B644369311B12.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/transcription--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4787, 'transferable', NULL, '[adj. 可转移的,可转让的]', 'Coupon is transferable but not cashable.', '此券优惠可转让他人使用但不能兑换现金。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/5b/e0/5BE05C913D55F82C914B14F9DE3581BB.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/transferable--_gb_1.mp3');
