INSERT INTO `MASTER` VALUES (4789, 'transgress', NULL, '[v. 违背,越界,违法]', 'His behavior transgressed the moral rules of the social conduct.', '他的行为违背了社会行为的道德准则。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0a/eb/0AEBF1112FA716E09B32CEFB4EE058AD.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/transgress--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4790, 'transgression', NULL, '[n. 违反,犯罪,逸出]', 'This would be a serious transgression of the law.', '不论哪一种情形都是严重的违反律法。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9d/70/9D70F2807DF22752F4286CCB0A70A8C5.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/transgression--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4791, 'transience', NULL, '[n. 短暂,片刻,稍纵即逝]', 'The result is a culture of transience and disposability.', '结果就是一种稍纵即逝的文化,一种随意弃置的文化。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0b/bb/0BBB85B1458BC74FC1B1D8D243E4D023.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/transience--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4792, 'transitoriness', NULL, '[n. 暂时,短暂]', 'She was transitoriness just like snow.', '她就像雪一样,是短暂的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ad/87/AD875575F6EF494B0EAEA62B0DC753BE.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/transitoriness--_gb_1.mp3');
