INSERT INTO `MASTER` VALUES (4794, 'translucent', NULL, '[adj. 半透明的]', 'A translucent design was impressed on the paper.', '一个半透明的设计被印在纸上。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c0/a6/C0A69BD5A3AE06C7F3801CF1A5D0DF6C.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/translucent--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4795, 'transmute', NULL, '[v. 使 ... 变形]', 'It is possible to transmute one form of energy into another.', '把某种形态的能量改变成另一形态的能量是可能的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/56/40/56404A4AD244C09A55A1D5E5B3255932.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/transmute--_gb_1.mp3');
