INSERT INTO `MASTER` VALUES (4833, 'trumpeter', NULL, '[n. 小号手,号兵,鹤形鸟]', 'I was a trumpeter in the jazz band at school.', '在学校时我是爵士乐队的小号手。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ac/be/ACBE672425C5E2E842E36373E323D3E4.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/trumpeter--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4834, 'truncate', NULL, '[vt. 缩短,删节,截去...的棱]', 'Erosion has truncated the ridges of the mountains.', '侵蚀削去了山脊。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/71/64/7164CD624764F7B99EA8038435B7BBD9.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/truncate--_gb_1.mp3');
