INSERT INTO `MASTER` VALUES (4879, 'unbend', NULL, '[v. 伸直,解开,放松]', 'This kind of wire is easy to unbend.', '这种金属线很容易弄直。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/64/e6/64E66644224A94438BA2C3AE6C498168.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unbend--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4880, 'unbiased', NULL, '[adj. 公正的]', 'The witness is unbiased and so reliable.', '那个证人没有偏见, 因而是可靠的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/05/9e/059E5C91DDA83B3A6385F41DDF68E1C2.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unbiased--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4881, 'unbidden', NULL, '[adj. 未经请求的,未经邀请的,自动的]', 'He walked into the room unbidden.', '他径自走进了屋子。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9d/c5/9DC5F98C534CEDEABDE3867F8D7750DE.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unbidden--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4882, 'unblemished', NULL, '[adj. 清白的,无疵的]', 'He had an unblemished reputation.', '他的名声白璧无瑕。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2b/21/2B21F4DCC1976D9BD0D3E0D8705EF202.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unblemished--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4883, 'unbosom', NULL, '[v. 吐露心事,剖明心迹]', 'At last she decided to unbosom herself to her mother.', '她最终决定向她母亲吐露心声。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e6/4d/E64DD4929DF42EB64D4C023146D0B15A.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unbosom--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4884, 'unbridgeable', NULL, '[adj. 不能架桥的,不可逾越的]', 'By the next day, it had risen 9 meters, becoming unbridgeable.', '第二天,水位升到九米,已无法架桥。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/eb/66/EB66FDC7F6438A0A25EF2FE8997690B3.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unbridgeable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4885, 'unbridled', NULL, '[adj. 无拘束的,激烈的,放纵的]', 'But now he and Han Dan cried with unbridled joy.', '但这一次,他和韩丹无拘无束快乐地叫了起来。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2e/ce/2ECE1FB449F458A7AF03E9F28F3C12F7.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unbridled--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4886, 'unbroken', NULL, '[adj. 未破的,完整的,未被阻断的]', 'He had ten hours of unbroken sleep.', '他连续睡了十个小时。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/27/09/2709A539337C0D87FF7CD123B17F11FC.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unbroken--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4887, 'uncanny', NULL, '[adj. 神秘的,不可思议的]', 'The silence was uncanny.', '静得出奇。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/77/f0/77F0DA96E1F32C2C8D378A9AC249DEEF.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/uncanny--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4888, 'uncharted', NULL, '[adj. 地图上没标明的,未经勘测的]', 'The ship had drifted into uncharted waters.', '船漂到了海图上未载明的海域。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ad/df/ADDF34AD98754012ED5E3FC39C45F596.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/uncharted--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4889, 'uncommitted', NULL, '[adj. 不受约束的,未承诺的,未遂的]', 'I am still uncommitted to undertaking the work.', '我还没有说定要接受这份工作。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/cd/44/CD44BDF7EF5E66304B2609B11979BFF6.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/uncommitted--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4890, 'uncommunicative', NULL, '[adj. 不爱说话的,拘谨的]', 'Her uncle was a silent, uncommunicative Yankee farmer.', '她伯父是一个沉默寡言的美国式农民。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/07/2c/072C578314C99A22F307E43DAA563795.mp3', 0, 15, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/uncommunicative--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4891, 'uncompromising', NULL, '[adj. 不让步的,不妥协的,强硬的]', 'He typifies the uncompromising reformer.', '他是不屈不挠的改革者的典型。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a7/ea/A7EAF253226F0608317CCAA3C4451E95.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/uncompromising--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4892, 'unconcerned', NULL, '[adj. 不关心的,不忧虑的]', 'Most tourists were unconcerned at the poor weather.', '那些游客大多没把坏天气放在心上。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/fc/79/FC7923E0B6D0A4B1692F44DF21FC91D6.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unconcerned--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4893, 'unconquerable', NULL, '[adj. 不可征服的,压抑不住的]', 'There is nothing unconquerable under the sun.', '世上没有不可征服的东西。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/cd/e7/CDE7AAAD0090563DDC96566A93025E61.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unconquerable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4894, 'unconscionable', NULL, '[adj. 不合理的,没有条理的,过度的]', 'It would be unconscionable for her to keep the money.', '她若私吞那笔钱,那可就太没良心了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/71/1a/711A0C9A565568E9432BD6979B7E1256.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unconscionable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4895, 'uncontroversial', NULL, '[adj. 非争论性的,未引起争论的]', 'He chose an uncontroversial topic for his speech.', '他为自己的演讲选择了一个不会引起争议的话题。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/16/bb/16BB103FC39A80C72DEF255EC12F01F3.mp3', 0, 15, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/uncontroversial--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4896, 'unconventional', NULL, '[adj. 非传统的,不合惯例的,非常规的]', 'He was by nature revolutionary and unconventional.', '他生来具有叛逆的、非传统的性格。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a3/da/A3DABF91F89F2D51F822840CF24D4120.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unconventional--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4897, 'unconvinced', NULL, '[adj. 不信服的]', 'The jury were unconvinced that he was innocent.', '陪审团不相信他是无辜的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d0/4e/D04E967A85F2F146570B563FF51DC291.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unconvinced--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4898, 'unconvincing', NULL, '[adj. 不足以令人相信的,难以置信的]', 'All these theories are rather unconvincing.', '所有这些理论都十分的不足以令人相信。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7d/08/7D08E2213001B1C4A164843B15EE4050.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unconvincing--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4899, 'uncouth', NULL, '[adj. 粗俗的,笨拙的,无教养的]', 'His nephew is an uncouth young man.', '他的侄子是一个粗野的年轻人。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ad/86/AD866696D4952FA84CCA44796B1E8D31.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/uncouth--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4900, 'unctuous', NULL, '[adj. 油腔滑调的,油的,虚情假意的]', 'He speaks in unctuous tones.', '他说话油腔滑调。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/5b/66/5B668BC64032F909C69D64FBBA5EE8E0.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unctuous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4901, 'undecipherable', NULL, '[adj. 不可译的]', 'A hopelessly undecipherable jumble of overlapping names. ', '一大团无法分辨、层层叠叠的名字。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/13/41/1341BB87B30E493C756481878A1BB20F.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/undecipherable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4902, 'undemanding', NULL, '[adj. 容易的,要求不高的,不严格的]', 'Over a tenth of the population have secure, undemanding jobs.', '超过1/10的人口拥有稳定且相对轻松的工作。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/99/1a/991AE26BEBB479498AF1BE5BE0308229.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/undemanding--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4903, 'underbid', NULL, '[v. 出较低的价钱,以低价提供]', 'With this pool of slave labor, you can underbid any contractor in town. ', '有这些劳工,你可比这镇上的承包商出更低价。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/db/a8/DBA801EA6D6D6CB2275EACD9D4430E50.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/underbid--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4904, 'undercut', NULL, '[v. 削弱,廉价出售,从下边切]', 'Popular support would be undercut by political developments.', '民众的支持率将会随政治势态的发展而下降。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/6c/1b/6C1B53AD13D044DFABA68A671E28AE8B.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/undercut--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4905, 'underdog', NULL, '[n. 劣势的一方,牺牲者,受害者]', 'The underdog team scored two surprise goals.', '处于劣势的一队出人意料地进了两球。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/54/24/54249C0025861804DC55DC9671D5A910.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/underdog--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4906, 'underestimated', NULL, '[n. 低估][v. 低估]', 'The figure of $10 million was a serious underestimate.', '一千万美元这个数据是一个严重的低估。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/73/84/73844C52485540B84360198B52660205.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/underestimated--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4907, 'undergird', NULL, '[vt. 从底层加固,加强]', 'Their way of life is undergirded by religious faith.', '他们的生活方式受到宗教信仰的影响。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/5e/59/5E59E75683A7388F080A080DACC4B3D6.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/undergird--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4908, 'underhanded', NULL, '[adj. 秘密的的,卑鄙的,人手不足的]', 'I don\'t believe in getting what you want by underhanded methods.', '我认为以不光明的手法获取东西是不应该的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/68/70/6870865E3C683091F101A232C488134A.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/underhanded--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4909, 'underling', NULL, '[n. 部下,下属]', 'He\'s an underling of a gang leader.', '他是匪首的爪牙。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ac/2d/AC2D595814DF477C49EB310C2B75B06D.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/underling--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4910, 'underpin', NULL, '[v. 从下头支持,支撑]', 'That reality must underpin our partnership. ', '这一现实必须支撑我们的合作伙伴关系。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c2/c2/C2C29723942ED66140D80CF6E5FF1FBF.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/underpin--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4911, 'underplay', NULL, '[v. 对...轻描淡写,忽视,节制表演]', 'We often underplay the skills we have.', '我们常常贬低自身的技能。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/82/6f/826FB7CB7018621A64A733C28862F9E3.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/underplay--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4912, 'underrate', NULL, '[v. 低估,看轻]', 'I fear that I underrate the difficulty of the task.', '我担心我低估了这项任务的困难。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/30/6d/306D082AA62E4CB52168B728250D1514.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/underrate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4913, 'underrepresented', NULL, '[adj. 未被充分代表的]', 'Hispanics are underrepresented in US political institutions.', '拉美裔在美国政治机构中的代表性不足。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ae/a0/AEA06CCEAC7C2713F547FCE82EE8A54A.mp3', 0, 16, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/underrepresented--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4914, 'underscore', NULL, '[vt. 划线于,强调][n. 下划线]', 'Let me underscore two of many reasons for this concern.', '值得担忧的原因很多,让我着重说明其中两点。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c6/65/C66532CC0C9C586C6069FCE07F9BBCFB.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/underscore--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4915, 'understandable', NULL, '[adj. 可理解的,能够懂的]', 'It is understandable that he is angry.', '他生气是可理解的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/47/e7/47E7C28058D042F934087E9A9058139E.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/understandable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4916, 'understate', NULL, '[v. 轻描淡写地说,少说]', 'To call this a security hole is to understate the point woefully.', '不幸的是,将它称之为安全性漏洞是轻描淡写的说法。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f8/10/F8109070048974528A06EF00D5492D41.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/understate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4917, 'understated', NULL, '[adj. 不夸张的,朴素的,简朴的]', 'I expressed my opinion in understated words.', '我以十分有节制的措辞表达了自己的观点。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/50/a4/50A49349A48D7F6B2A43F6594DB82949.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/understated--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4918, 'understudy', NULL, '[v. 充当候补演员][n. 候补演员]', 'The understudy was substituted when the leading actor fell ill.', '主角演员患病,由替角代替演出。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/bd/c1/BDC1EFA0248812C966A2CCFD926016C3.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/understudy--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4919, 'underutilized', NULL, '[adj. 未充分使用的,使用不当的]', 'They had to sell off 10 percent of all underutilized farmland.', '他们不得不将10%未被充分利用的农田廉价卖掉。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/44/91/4491C2F1B2D717DF5AEC43989FC1CB75.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/underutilized--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4920, 'underwrite', NULL, '[v. 承保,写在...下面,给……保险]', 'The shares were underwritten by the Bank of England.', '这些股票由英格兰银行包销。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d2/dd/D2DDCC40032EF08E194DF4966C125F1F.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/underwrite--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4921, 'undeserved', NULL, '[adj. 不恰当的,不应得的]', 'The criticism was totally undeserved.', '这批评纯属冤枉人。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/69/be/69BEC118FE119557C1315029B444DCB6.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/undeserved--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4922, 'undeserving', NULL, '[adj. 不值得的,不配受到的]', 'He was undeserving of her affections.', '他不配得到她的爱。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/60/c7/60C722618133326FC859D3E22A13DC52.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/undeserving--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4923, 'undesirable', NULL, '[adj. 不受欢迎的,不良的,不想要的]', 'Big cuts in education are very undesirable.', '教育经费的大幅度削减是极不受欢迎的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/03/06/03061299B6A84652DDF6579DFA860350.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/undesirable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4924, 'undetected', NULL, '[adj. 未被发现的,未被觉察的]', 'They feared some undetected trace of poison.', '他们担心一些未被识破的投毒痕迹。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/89/75/8975C3105FCC242D469ED8BBADFED5BD.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/undetected--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4925, 'undifferentiated', NULL, '[adj. 无差别的,无区别特征的]', 'A view of society as an undifferentiated whole.', '作为一个未分化整体的社会观。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7a/74/7A74AA48BECE9DC8158F2EC4C5F753D0.mp3', 0, 16, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/undifferentiated--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4926, 'undirected', NULL, '[adj. 无目标的,未受指导的]', 'Unenlightened and undirected, I can do so little.', '但若得不到启蒙和指导,我就差不多无能为力了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/aa/2d/AA2DF69129266CD122237C22FB882792.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/undirected--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4927, 'undiscovered', NULL, '[adj. 未被发现的]', 'At last, the miners struck on an undiscovered gold mine.', '最后,矿工们突然发现了一个不为人知的金矿。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f1/fe/F1FE25F1C91D07C60207A9B0718CBBDF.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/undiscovered--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4928, 'undisguised', NULL, '[adj. 无伪装的,坦率的,公然的]', 'She looked at him with undisguised contempt.', '她毫无伪装的鄙视地看着他。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a1/06/A10659D0283D660B050A7F97C2EA0E6C.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/undisguised--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4929, 'undistorted', NULL, '[adj. 无失真的,未变心的,未曲解的]', 'Only in quiet waters do things mirror themselves undistorted.', '只有平静的水面才能照映出他们未失真的一面。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2e/47/2E4707BB773CDE130DC866511E76E0B7.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/undistorted--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4930, 'undisturbed', NULL, '[adj. 未受干扰的,安静的,镇定的]', 'I think we should find a place to talk undisturbed.', '我认为我们应该找个地方单独谈一谈。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b2/33/B2333F9DD2A0A8647E98DBBE2391D3DD.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/undisturbed--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4931, 'undulate', NULL, '[v. (使)波动,(使)起伏,(使)震动]', 'We soon see a field of wheat undulate in the breeze.', '我们很快看到一片在微风中起伏的麦田。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d0/67/D0670C05478376332693EF571B0512C2.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/undulate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4932, 'unearth', NULL, '[v. 发掘,掘出,发现并披露]', 'You will unearth a whole new history.', '你们将会挖掘出一个完整的新历史。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/15/69/15695C6E265976A5733D64CD5C21B1D3.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unearth--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4933, 'unearthly', NULL, '[adj. 怪异的,超自然的]', 'All of a sudden we heard an unearthly cry.', '我们突然听到一声怪叫。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9b/57/9B57A58D990CB39DCB0176AA422CABCF.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unearthly--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4934, 'unedited', NULL, '[adj. 未编辑的,未修订的,未剪辑的]', 'Short for weblog, a blog is an unedited online journal.', '网络日志的简写,博客是未经检查的网上杂志。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/eb/b4/EBB43F3300ADB2ECE92BF671F7FD6FBE.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unedited--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4935, 'unencumbered', NULL, '[adj. 没有阻碍的,没有负担的]', 'In all cases redistribution is unencumbered.', '但是,再发布却是没有任何障碍的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/dd/cc/DDCCC10B7057108E75B086FBF60863D2.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unencumbered--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4936, 'unenlightened', NULL, '[adj. 未受启蒙的,无知的]', 'Unenlightened and undirected, I can do so little.', '但若得不到启蒙和指导,我就差不多无能为力了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9f/39/9F39A9097DA8F42EB30B8543EE1B7F0C.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unenlightened--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4937, 'unequivocal', NULL, '[adj. 不含糊的,明白的,确实的]', 'We were unequivocal in response to the third question.', '我们毫不含糊地回答了第三个问题。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/71/27/7127750E548AED3D74C5163307D4A591.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unequivocal--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4938, 'unerringly', NULL, '[adv. 无过失地,正确地]', 'She had seized unerringly on the fact that most disturbed him.', '她很准确地抓住了令他苦恼不已的事由。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a4/34/A43407D62F5D3D70B66FA6FF761596B8.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unerringly--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4939, 'unevenly', NULL, '[adv. 不平坦地,不均衡地]', 'Having the yolk unevenly distributed throughout the egg.', '异卵黄的卵子中卵黄分布不均匀的', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d9/3b/D93B7F06D09428970248A0123DE09F5D.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unevenly--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4940, 'uneventful', NULL, '[adj. 太平无事的,平静无事的]', 'Her passage across the Pacific was uneventful.', '她横穿太平洋的航行是平静的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/84/b7/84B7F9F9D71DC7FE37FDA07991CC662D.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/uneventful--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4941, 'unexceptionable', NULL, '[adj. 无可挑剔的,无可指责的]', 'Mr. Weston was a man of unexceptionable character, easy fortune. ', '韦斯顿先生人品出众, 广有钱财。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/14/a0/14A0A0A63FF9134F12ECE23D5E274F3E.mp3', 0, 15, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unexceptionable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4942, 'unexplored', NULL, '[adj. 未勘查过的,未开拓的]', 'Very little forestry is left unexplored nowadays.', '如今尚未开采的森林是少之又少了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/05/ef/05EF57DAC41D685BFABE6F46FE048EF9.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unexplored--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4943, 'unfailing', NULL, '[adj. 永恒的,无穷的,可靠的]', 'Their discipline and good behaviour was unfailing.', '他们的纪律和良好行为始终如一。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/80/bd/80BD35D5CA64E997EFA341007712B871.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unfailing--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4944, 'unfasten', NULL, '[v. 解开,松开]', 'He unfastened the buckles and took off the coat.', '他解开扣子,把上衣脱掉。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/63/a2/63A2B04E15FCF61A831BC0379C4EE8E7.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unfasten--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4945, 'unfavorable', NULL, '[adj. 不宜的,不理想的]', 'I am surprised you got an unfavorable impression of him.', '我很惊讶你对他印象不佳。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/35/50/35507D917AC54868F5C1F61AAC9BCFE7.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unfavorable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4946, 'unfeigned', NULL, '[adj. 真实的,真诚的]', 'He showed unfeigned satisfaction at his friend\'s success.', '他对朋友的成功表现出真正的满足。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/18/3b/183BA37D518A7DC32277D916F4BC95E0.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unfeigned--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4947, 'unfertilized', NULL, '[adj. 未施肥的,未受精的]', 'Sperm race towards the unfertilized egg.', '精虫朝未受精的卵子冲去。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/44/3f/443F596BF1590959EEA6EBC8BE0351AE.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unfertilized--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4948, 'unfettered', NULL, '[adj. 无拘无束的,被除去脚镣的]', 'I want to fly, like an unfettered bird.', '我想飞,像一只无拘无束的小鸟。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/84/36/8436C31AA6692481558070C048727354.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unfettered--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4949, 'unflappable', NULL, '[adj. 镇定自若的,临危不乱的]', 'A busy manager needs a completely unflappable secretary.', '经理工作忙就需要一个头脑十分冷静的秘书。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/3e/45/3E4594290F0A216650CFAD4C176C5A60.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unflappable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4950, 'unfounded', NULL, '[adj. 无根据的,无稽的,未建立的]', 'We hold that their proposal is unfounded.', '我们认为他们的建议是无事实根据的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4e/98/4E9833D8D0BE69FD3E3F84F5F356C18F.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unfounded--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4951, 'ungainly', NULL, '[adj. 笨拙的,难看的,不雅的]', 'He walked in long ungainly strides.', '他迈着笨拙的大步子行走。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/dd/51/DD51D83D2F3E95F5FC626D8283019CC9.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/ungainly--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4952, 'ungrateful', NULL, '[adj. 忘恩负义的,不领情的]', 'He is an ungrateful fellow, and I\'ll never help him.', '他是一个忘恩负义的家伙,我再也不帮他了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e9/8a/E98A8A1D2403E1EDFE11E87FA712E6C3.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/ungrateful--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4953, 'ungrudging', NULL, '[adj. 慷慨的,情愿的]', 'I have received ungrudging help from several friends.', '我得到了几个朋友的慷慨帮助。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/40/1f/401F5BA9C13678B2840ADD4253A28B44.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/ungrudging--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4954, 'unheralded', NULL, '[adj. 未预先通知的,不为人知的]', 'The complete reversal of this policy was unheralded.', '事先没有听到一点儿风声要彻底推翻这项政策。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c6/75/C67507233A08D630F95FAFEAF57A9720.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unheralded--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4955, 'unidimensional', NULL, '[adj. 线性的,一维的,一度空间的]', 'A novel with one-dimensional characters.', '一维人物小说。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f3/eb/F3EB01F4D74B0EE80878F51A4F1B7C48.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unidimensional--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4956, 'unimaginable', NULL, '[adj. 不能想象的,想象不到的]', 'It is unimaginable that he is an unhonest man.', '他是个不诚实的人是不可思议的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a2/fa/A2FA522CC0FF425ABC49ED452CAB7946.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unimaginable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4957, 'unimpassioned', NULL, '[adj. 没有激情的,不感情用事的]', 'He answered with an unimpassioned defense.', '他以没有热情的辩护回答控告。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/34/c8/34C8CEB61B1F06C9414A74EDB60A6E79.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unimpassioned--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4958, 'unimpeachable', NULL, '[adj. 无懈可击的,可靠的]', 'Your testimony on this matter is hardly unimpeachable.', '在这个问题上你的辩驳很难说是无懈可击的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7c/a4/7CA4D1E2812929278BCDB1C8F8696428.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unimpeachable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4959, 'unimpressed', NULL, '[adj. 没有印象的,未受感动的]', 'I\'m unimpressed with a man who doesn\'t take the lead.', '我不喜欢不主动的男人。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/63/fb/63FB9F8C5CE96BB58445E55610E4ADC7.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unimpressed--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4960, 'uninhabited', NULL, '[adj. 无人居住的,杳无人迹的]', 'He was banished to an uninhabited island for a year.', '他被放逐到一个无人居住的荒岛一年。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/44/f0/44F03D2E56720E1C94927F9C600274AF.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/uninhabited--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4961, 'uninitiated', NULL, '[adj. 缺乏特定知识的][n. 门外汉]', 'The labels can be a bit confusing for the uninitiated customers.', '对于缺乏经验的顾客来说,这些标签有点令人困惑。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8d/2d/8D2D9E941926DD7F281A7B86CAD37137.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/uninitiated--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4962, 'uninspired', NULL, '[adj. 无想象力的,平庸的,单调的]', 'The book is fascinating,despite its uninspiring title.', '这本书很吸引人,尽管它没有令人鼓舞的标题。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a1/32/A1326E80A8AAC9E5AFAEFDEC4C64EE3B.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/uninspired--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4963, 'unintelligible', NULL, '[adj. 难以理解的]', 'He answered in words unintelligible to her.', '他用她听不懂的话来回答。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/6e/7b/6E7BF7BFA03E831FD78FBBF09B721245.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unintelligible--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4964, 'uniqueness', NULL, '[n. 唯一性,独特性]', 'A sequential number used to ensure data uniqueness.', '用于确保数据唯一性的连续编号。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ed/e9/EDE91E76BF01C55864B31AFF8067FE7C.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/uniqueness--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4965, 'unison', NULL, '[n. 一致行动,齐唱,齐奏,和谐]', 'They ran together, their legs moving in unison.', '他们步调一致地一起跑。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b6/c8/B6C881D29B56D736781201E94A4FC33B.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unison--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4966, 'universality', NULL, '[n. 普遍性,一般性]', 'One might question the universality of this method.', '有人会怀疑这个方法的普遍性。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e4/8c/E48C06EB17D716D35F233A411834B4D5.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/universality--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4967, 'univocal', NULL, '[adj. 单一的意思,意义明确的]', 'A series of univocal and concise equations was developed.', '建立起物理意义更明晰的方程组。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ad/9d/AD9D1392B3032C5B61D0CBB4EA2E84A7.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/univocal--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4968, 'unjustifiable', NULL, '[adj. 不合道理的,不可原谅的]', 'His behaviour was quite unjustifiable.', '他的行为毫无道理.', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c1/81/C18152AA7CC9AB6BD6FAA443E047B635.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unjustifiable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4969, 'unkempt', NULL, '[adj. 乱蓬蓬的,不整洁的]', 'The old man was shabby and unkempt.', '老头蓬头垢面,衣衫褴褛。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f9/a4/F9A4B17549355C9C4D5FE1FA3F7780F5.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unkempt--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4970, 'unmatched', NULL, '[adj. 无匹敌的,不相配的]', 'The grandeur of the Great Wall is unmatched.', '长城的壮观是独一无二的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a8/aa/A8AADF1AB8298216AD309F70BBB85937.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unmatched--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4971, 'unmitigated', NULL, '[adj. 未缓和的,十足的,绝对的]', 'The costs of unmitigated climate change are potentially enormous.', '未减缓的气候变化所造成的经济损失将是巨大的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/83/5f/835F7BAFEC45985727281E22DD2F7D8E.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unmitigated--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4972, 'unmoved', NULL, '[adj. 无动于衷的,坚定的,不动摇的]', 'He remained unmoved even when I began to cry.', '当我开始哭泣时,他还是无动于衷。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c5/5b/C55B5BD95CF426F24469E7F965B34B8A.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unmoved--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4973, 'unobstructed', NULL, '[adj. 无阻碍的,没有阻挡的]', 'Lay them on their side and ensure the airway is unobstructed. ', '让他们侧躺着,并确保呼吸道畅通。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/64/86/64867804EEEB31308C4704D7670B2E76.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unobstructed--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4974, 'unobtrusive', NULL, '[adj. 不突出的,不显眼的,谦虚的]', 'She\'s a quiet unobtrusive student.', '她是个文静而不引人注目的学生。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/13/bb/13BB42B7D3427EC02F0C17866F215F19.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unobtrusive--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4975, 'unpack', NULL, '[v. 打开取出,卸下]', 'He began to unpack his briefcase.', '他开始打开公事包取出里面的东西。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b7/66/B76689F64C08AD8DE538E61E5D0CE6CE.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unpack--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4976, 'unpalatable', NULL, '[adj. 不可口的,不好吃的,让人不快的]', 'The fish was particularly unpalatable.', '这鱼特别难吃。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/1c/ad/1CAD790B3CDCEFF2AE3BB5DD2AB03B3E.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unpalatable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4977, 'unparalleled', NULL, '[adj. 无比的,无双的,空前的]', 'It was an unparalleled opportunity to develop her career.', '这是她发展自己的事业的绝好机会。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/95/fb/95FB28A7F3204C0164F2986BEDF0F5FC.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unparalleled--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4978, 'unpredictable', NULL, '[adj. 不可预知的]', 'He is unpredictable, weeping one moment, laughing the next.', '他喜怒无常,一会儿哭,一会儿笑。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ce/a0/CEA04341D7038147187ADCCA74619B89.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unpredictable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4979, 'unprejudiced', NULL, '[adj. 无偏见的,没有成见的,公平的]', 'I think the unprejudiced observer will feel that justice was done today.', '我认为,公正的旁观者会觉得今天正义已得到伸张。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ce/e0/CEE0790928CD7B574FC3102204AC4FCF.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unprejudiced--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4980, 'unpremeditated', NULL, '[adj. 无预谋的,非故意的,偶然的]', 'He asked an unpremeditated question.', '他问了一个意外的问题。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/12/94/12941380ADEFF4C8708B550BF9BF3152.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unpremeditated--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4981, 'unprepossessing', NULL, '[adj. (外表)不吸引人的]', 'Though unprepossessing to look at, he is highly intelligent.', '他虽然相貌平平,但却很有才气。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d3/28/D32858446955A3008ADFD9292233F78C.mp3', 0, 15, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unprepossessing--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4982, 'unpretentious', NULL, '[adj. 不炫耀的,含蓄的,谦虚的]', 'Simple and unpretentious in behavior.', '朴素的,不做作的行为简便且不矫揉造作的', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/25/94/2594AD5DFC4F19BBD95CAFD32A8F755D.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unpretentious--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4983, 'unpromising', NULL, '[adj. 没有希望的,无前途的]', 'The prospect of international trade is unpromising.', '国际贸易的前景看来很是不容乐观。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a1/c8/A1C8FDC8379BC3084A0AD954F97240CF.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unpromising--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4984, 'unproven', NULL, '[adj. 未经证明的,未经检验的]', 'There are a lot of unproven allegations flying around.', '流言蜚语满天飞。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b5/ec/B5ECCFB0302447DA89EDE576857FF78A.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unproven--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4985, 'unprovoked', NULL, '[adj. (生气等)无缘无故的]', 'This malicious and unprovoked attack astounded him.', '这个恶意的无端攻击使他吃惊。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/77/d6/77D6BF36E49A2FD9FBD3F899B8E2FF18.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unprovoked--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4986, 'unqualified', NULL, '[adj. 不合格的,无资格的,不适任的]', 'We\'ll change the unqualified product absolutely.', '我们保换质量不合格的产品。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e6/12/E612F7412A81FC6D0CF30C90BE394E16.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unqualified--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4987, 'unquestionable', NULL, '[adj. 无疑问的,确实的,无可非议的]', 'It is unquestionable that he must be there.', '他肯定在那儿,这是毫无疑问的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0a/75/0A75C5D8A82C1F42AACBED050CAEC402.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unquestionable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4988, 'unquestionably', NULL, '[adv. 当然地,无可非议地]', 'He is unquestionably a star.', '他毫无疑问是个明星。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/55/47/5547593069F5CF015198B9BD14E869D7.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unquestionably--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4989, 'unquestioning', NULL, '[adj. 无条件的,不犹豫的,绝对的]', 'Isabella had been taught unquestioning obedience.', '伊莎贝拉被要求无条件服从。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b2/28/B2283C749FD4F576B86B3123C454C5F0.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unquestioning--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4990, 'unquote', NULL, '[n. 引用文结束]', 'Mr. Smith said quote I will not run for governor unquote.', '史密斯先生说,引文开始,我将不竞选州长,引文结束。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/44/fc/44FCE380517FAF5B2EC5F59C3D6ED63F.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unquote--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4991, 'unravel', NULL, '[v. 解开,阐明,解释,破坏(计划)]', 'My knitting has unravelled.', '我编织的东西散开了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2b/ff/2BFF37FC2389C878CF88B8810DA01729.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unravel--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4992, 'unrealistic', NULL, '[adj. 不切实际的,不实在的]', 'The proposal struck me as unrealistic.', '我感到这个建议不现实。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/92/87/9287BDC6142FAE40B3EC5D608A781897.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unrealistic--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4993, 'unrecognized', NULL, '[adj. 未被承认的,未被认出的]', 'Both organizations are unrecognized by the Cuban government.', '这两个组织都不被古巴政府认可。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b8/de/B8DECDFC0FA0336F5D103B255ECF97B1.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unrecognized--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4994, 'unregenerate', NULL, '[adj. 不能再生的,顽固不化的]', 'Coal is an unregenerate resource. ', '煤炭是不能再生资源。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/40/09/40099B235436FB1A298457D9C2F5DEFE.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unregenerate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4995, 'unregistered', NULL, '[adj. 未注册的,未登记的]', 'The registered gage has priority to the unregistered gage.', '抵押物已登记的先于未登记的受偿。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a7/9c/A79C54316B162001F5582CA6A28ADF71.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unregistered--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4996, 'unregulated', NULL, '[adj. 不规范的,紊乱的,不受管理的]', 'She has violent and unregulated nature.', '她生性狂放,不受拘束。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/56/2a/562AB37B6B3F16A5D8A760063025094D.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unregulated--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4997, 'unreliable', NULL, '[adj. 不可靠的]', 'Shelly doesn\'t like people who are unreliable.', '雪莉不喜欢不可靠的人。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/14/96/14967228782A50D2149D512C31F69375.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unreliable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4998, 'unremitting', NULL, '[adj. 不懈的,不间断的,坚忍的]', 'Her love for Chinese dance led to her unremitting efforts.', '这爱促使她在创作中不懈地追求中国舞蹈的神韵。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f0/95/F09575F4F6F243333DFBE460CF923B01.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unremitting--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (4999, 'unrepentant', NULL, '[adj. 不后悔的,不思悔改的,顽固的]', 'Ali was mouthy, gutsy, and unrepentant.', '阿里是伶牙俐齿的,坚定无畏的,从不懊悔的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/38/7b/387B42AC364AD1B5E402E39DF5A58595.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unrepentant--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5000, 'unrepresentative', NULL, '[adj. 不典型的,非代表性的]', 'The surviving fraction of Hitler’s library is unrepresentative.', '希特勒藏书中留存下来的那部分并不具备代表性。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e2/2e/E22EE6B324FEFC85D600B93C3687EBD3.mp3', 0, 16, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unrepresentative--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5001, 'unreserved', NULL, '[adj. 坦率的,无保留的,没被预订的]', 'He offered us his unreserved apologies.', '他诚恳地向我们道了歉。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/39/06/3906012174EB122565F23FFBFFECE557.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unreserved--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5002, 'unrestrained', NULL, '[adj. 无限制的,放纵的]', 'The unrestrained development of tourism breaks the eco-balance.', '旅游业无限制的发展破坏了生态平衡。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/33/18/3318338722D38B8C26DB51CAE7A9F4C4.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unrestrained--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5003, 'unrestricted', NULL, '[adj. 不受限制的,无限制的]', 'Assemblies have unrestricted access to the Clipboard.', '程序集可以不受限制地访问剪贴板。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/74/8f/748FE1235962E800E764E850AF21E86F.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unrestricted--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5004, 'unsanitary', NULL, '[adj. 不卫生的,不利健康的]', 'I would call it one of the most unsanitary areas in the world.', '我愿称它为世界最不卫生的地区之一。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c8/35/C835DE8CB22763A58ED5144B7628187D.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unsanitary--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5005, 'unsatisfactory', NULL, '[adj. 不能令人满意的]', 'Her performance proved to be unsatisfactory.', '她的表现并不令人满意。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ab/fa/ABFAD7595D7A74F9BD360A92ED8ECA9E.mp3', 0, 14, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unsatisfactory--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5006, 'unscathed', NULL, '[adj. 没有受伤的,未受损害]', 'The hostages emerged from their ordeal unscathed.', '人质经受磨难而平安生还。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2e/53/2E5318C96D33AFD4E80AAFEDB8B97F81.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unscathed--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5007, 'unscented', NULL, '[adj. 无气味的][无香味的. ]', 'We have perfumed and unscented soap. ', '我们有香皂和不加香水的肥皂。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2b/f1/2BF13ED3073E3729747C2B294EF81A4E.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unscented--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5008, 'unscrupulous', NULL, '[adj. 肆无忌惮的,不道德的]', 'You always take part with the unscrupulous man.', '你总是袒护那些肆无忌惮的人。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/22/68/2268A9C13CD35F6E7EFB05E82365D51C.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unscrupulous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5009, 'unscrupulousness', NULL, '[n. 狂妄]', 'He went with unscrupulousness in those days.', '他那时候太狂妄了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/60/f2/60F258CD71A202B3E2E2B3B837FB191B.mp3', 0, 16, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unscrupulousness--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5010, 'unseasonably', NULL, '[adv. 不合时令地,不合时宜地]', 'He looked like a ghost evoked unseasonably from the grave. ', '他那副样子就像是一个从坟墓中不合时宜地钻出来的鬼魂。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/79/a9/79A9A69617ADE375B92247BB683D9BB4.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unseasonably--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5011, 'unseemly', NULL, '[adj. 不合适的][adv. 不适当地]', 'Everyone was shocked by his unseemly conduct.', '大家都被他不得体的举动震惊了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/6d/85/6D85D22BBBD62C158F0B6A678C622D2E.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unseemly--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5012, 'unselfish', NULL, '[adj. 无私的,慷慨的]', 'Unselfish love is of the highest kind.', '无私的爱是最高境界的爱。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/71/ea/71EAD6BE4B203ADACA63A898EF8DB259.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unselfish--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5013, 'unsettle', NULL, '[v. 使(某人)不安或担忧,使动摇]', 'Seafood unsettles my stomach.', '我一吃海鲜胃就不舒服。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/31/8b/318BEEC82CE6866D77ED0F1294DEF010.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unsettle--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5014, 'unsettling', NULL, '[adj. 使人不安的]', 'The news was very unsettling.', '这则新闻实在扰乱人心。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/21/27/2127C750D5BC3A68FF7C802239A54BC4.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unsettling--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5015, 'unskilled', NULL, '[adj. 不熟练的,未成熟的,拙劣的]', 'A number of the workers are unskilled.', '一些工人不熟练。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/07/60/0760A88FC13742630B46346C790B22DE.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unskilled--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5016, 'unsophisticated', NULL, '[adj. 不谙世故的,不复杂的]', 'He was confiding, good-natured, unsophisticated, companionable.', '他为人坦率,一团和气,世故不深,蔼然可亲。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8c/2b/8C2B8B5737014E73F8ADC75820DA9FC2.mp3', 0, 15, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unsophisticated--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5017, 'unsound', NULL, '[adj. 腐烂的,谬误的,无根据的]', 'In theory as well as in practice, the idea is unsound.', '这个主意在理论上和实践上都站不住脚。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c9/c5/C9C561B4FF7E76CA6A6AE2B67CC680E8.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unsound--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5018, 'unspoiled', NULL, '[adj. 未损坏的,未宠坏的]', 'The port is quiet and unspoiled.', '这个港口宁静、天然。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e9/d2/E9D281018B57F70C9FAF1DEC031F1F0C.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unspoiled--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5019, 'unspotted', NULL, '[adj. 清白的,无污点的]', 'He was able to get into the building unspotted and unsuspected. ', '他能清白、不受怀疑地走入大楼。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b2/3b/B23BC71F64507E4DDCB363A4DDEA4399.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unspotted--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5020, 'unstable', NULL, '[adj. 不稳定的,易变的]', 'The hydroperoxides are unstable compounds.', '氢过氧化物是不稳定的化合物。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ce/dc/CEDC49E964E697604EFA12AE4D83DD3F.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unstable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5021, 'unstinting', NULL, '[adj. 无限制的,慷慨的]', 'We all appreciate your unstinting help.', '我们都感谢你不吝相助。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/91/b6/91B60A6C5F34B19B9A231C6E6AE806C2.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unstinting--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5022, 'unsubstantiated', NULL, '[adj. 无事实根据的]', 'His attack of the president was unsubstantiated.', '说他袭击总统是没有事实根据的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2c/c7/2CC7AF18F5965315D6EFFB289352BC10.mp3', 0, 15, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unsubstantiated--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5023, 'unsure', NULL, '[adj. 不肯定的,没有自信的]', 'Consult your dictionary when you are unsure of your spelling.', '当你不敢肯定拼写时,就查阅一下词典。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/61/87/6187F2C6936682519C5AFBB9E9E81F0F.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unsure--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5024, 'unsurpassed', NULL, '[adj. 未被超越的,非常卓越的]', 'To my mind,Bach is unsurpassed as a composer.', '就我看来,巴赫是一个无与伦比的作曲家。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ee/66/EE660F3796C3D832A5885AC39E712B55.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unsurpassed--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5025, 'unsuspecting', NULL, '[adj. 无疑心的,无戒心的]', 'It is possible to fool unsuspecting buyers.', '欺骗那些易轻信的买主是可能的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/76/d7/76D7AA61CC168DCB71C07A57ABD84160.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unsuspecting--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5026, 'untainted', NULL, '[adj. 无污点的,未污染的]', 'Few modernisers are untainted by the past.', '有现代思想的人很少没有前科的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/25/c8/25C8C7EFE389F61D11639334B15CA18F.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/untainted--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5027, 'untalented', NULL, '[adj. 没有天赋的,缺乏才能的]', 'Untalented sports teams often resort to dirty tricks to win. ', '没有天分的运动队伍常常用不当手法来赢取比赛。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b8/eb/B8EBBD053DD36DAC0C29ECE8BBC4756D.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/untalented--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5028, 'untamed', NULL, '[adj. 不能抑制的,难控驭的]', 'The interior of Corsica is high and untamed.', '科西嘉岛腹地地势高企,环境荒芜。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/16/4f/164FEC2E7EE6B46A1A8DA5D7C97BD108.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/untamed--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5029, 'untapped', NULL, '[adj. 塞子未开的,未使用的]', 'An untapped cask of wine is stored quite well.', '一桶未去塞的酒储存的很好。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/78/95/78956D1291D4375D13B9A61A451E06A6.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/untapped--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5030, 'untarnished', NULL, '[adj. 有光泽的,未受玷污的]', 'From a sky of untarnished blue the sun beamed down upon Beijing.', '阳光透过万里碧空照耀着北京城。', 'https://dictionary.cambridge.org/media/english/us_pron/c/cdo/cdo03/cdo0318usunta5375.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/untarnished--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5031, 'untenable', NULL, '[adj. 不能防守的,支持不住的]', 'I believe this view is untenable.', '我认为这种观点是站不住脚的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2d/fe/2DFED5E9D5FA2699B56273501003B312.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/untenable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5032, 'unthreatening', NULL, '[adj. 善意的,不威胁的]', 'It consists of an unthreatening minority position.', '它持有不具威胁性的少数股权。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/91/9a/919AEFDA4E2828169A07720828B480D2.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unthreatening--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5033, 'untimely', NULL, '[adj. 不合时宜的][adv. 过早地]', 'His untimely intervention annoyed me.', '他那不合时宜的干涉让我生气。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c2/4d/C24D792D8EBD9B28B14E7A5C52BF2AA9.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/untimely--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5034, 'untold', NULL, '[adj. 数不清的(没有说到的)]', 'This age-old struggle for control had led to untold bloody wars.', '这场由来已久的对控制权的争夺已经引发了无数流血的战争。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c2/43/C2439252AA86863E3E8CC8445AEEFBAD.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/untold--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5035, 'untouched', NULL, '[adj. 未触及的,未受影响的,未开发的]', 'The subject remains untouched upon.', '这个题目仍然没有触及。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/fd/b5/FDB54C9223F7141DA2201DE1F25295E3.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/untouched--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5036, 'untreated', NULL, '[adj. 未经处理的,未治疗的,未加工的]', 'If untreated, the illness can become severe.', '若不加以治疗,病情就可能会变得很严重。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e6/1c/E61C1624433C3F9E5607ABB002A8692E.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/untreated--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5037, 'untrustworthy', NULL, '[adj. 靠不住的,不能信赖的]', 'The statistical analysis is untrustworthy.', '这个统计分析是不可信赖的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/83/08/8308421E725538D3391A79DE0B081DC3.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/untrustworthy--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5038, 'untutored', NULL, '[adj. 未受教导的,未经训练的]', 'He had only untutored strength like a bull in a china shop.', '他只有一身的蛮力,干事笨手笨脚的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d1/e4/D1E46BA9DBEA50565114E6290851A1C6.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/untutored--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5039, 'unwarranted', NULL, '[adj. 无根据的,未授权的,无保证的]', 'Your assumption that I would agree was unwarranted.', '你认为我会同意,这种假设是毫无根据的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d4/31/D431ADD9B5B3DC82521722E157EA8AD7.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unwarranted--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5040, 'unwieldy', NULL, '[adj. 笨重的,笨拙的,庞大的]', 'He is carrying an unwieldy parcel.', '他拿着一个笨重的包裹。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8b/00/8B000D7B13F9E2272C9AEC38E2BB96F0.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unwieldy--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5041, 'unwitting', NULL, '[adj. 不知情的,无意的]', 'The prime minister was an unwitting tool of the president.', '首相不知不觉被总统利用了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/25/f8/25F8CD2E99B072B63AE531B6315CFC36.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unwitting--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5042, 'unwonted', NULL, '[adj. 异常的,不习惯的]', 'He spoke with unwonted enthusiasm.', '他讲话显得出人意料地热心。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/39/6f/396F78E897DED191B4678E5C0CD667AE.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unwonted--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5043, 'unworldly', NULL, '[adj. 超凡的,超脱世俗的,天真的]', 'The landscape had a stark, unworldly beauty.', '那景色有一种简朴、超凡的美。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/68/18/6818ADF556C4AC97321D7945B3E682DE.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unworldly--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5044, 'unwrap', NULL, '[v. 打开,展开]', 'Don\'t unwrap your present until your birthday.', '生日礼物要等到你生日那天才可打开。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/44/f3/44F34B98EF2433FAA619D093210D883C.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unwrap--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5045, 'unyielding', NULL, '[adj. 不屈的,坚强的,坚固的]', 'He stood unyielding and unafraid against the enemy.', '他面对敌人,英勇无畏。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e7/41/E7412C3677A4BE45B7825E9F5DAC18BF.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/unyielding--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5046, 'upbraid', NULL, '[vt. 斥责,责骂]', 'The old man upbraided him with ingratitude.', '那位老人斥责他忘恩负义。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/50/95/509566A4A78DDB275FC0466623FF4495.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/upbraid--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5047, 'upfront', NULL, '[adj. 在前面的,预付的][adv 在前面]', 'He\'s been upfront about his intentions since the beginning.', '他从一开始就明白说出了他的意图。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/15/d3/15D351A84B30EEF665756C669F019E87.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/upfront--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5048, 'upheaval', NULL, '[n. 向上的运动,剧变,动乱]', 'The French Revolution was a volcanic upheaval in European history.', '法国大革命是欧洲历史上的一次剧变。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/db/56/DB56AD37F1FD1F4E196485C85EC5D76F.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/upheaval--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5049, 'uphill', NULL, '[adj. 上坡的,向上的][adv. 上坡地]', 'We cycled uphill for over an hour.', '我们骑自行车爬了一个多小时的坡。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f8/c3/F8C39F38E65369901C2F580C6A2C4D3C.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/uphill--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5050, 'upland', NULL, '[n. 高地,山地][adj. 高地的,山地的]', 'Creeks pour down from the uplands.', '小溪从高地流下。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0f/da/0FDA6DF4AD377C73DAF22B96F8456BCE.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/upland--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5051, 'uproarious', NULL, '[adj. 喧嚣的,滑稽的]', 'Never was a gathering more varied and more uproarious.', '像这样各色人等混杂,环境喧闹不堪的集会倒是从未见过。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/76/cc/76CC53ED44D71AD1BEEF318181069A90.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/uproarious--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5052, 'uproot', NULL, '[vt. 连根拔起,迁离,根除]', 'Whthin seconds a tornado can uproot trees.', '几秒钟内,龙卷风就能连根拔起大树。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0b/f4/0BF42B46797A6E135F2EB6B678005E30.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/uproot--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5053, 'upscale', NULL, '[adj. 高档的][adv. 高端地]', 'The family later moved to Neuilly-sur-Seine, an upscale suburb.', '他家后来搬到诺伊市,一个高消费的郊区。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/2e/ad/2EADCC9A98A8B95D5333DED2CBABB62B.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/upscale--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5054, 'upside-down', NULL, '[adj. 颠倒的,乱七八糟的]', 'Everything is upside down in this house.', '这房间什么都搞得乱七八糟的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c6/57/C657F30146D611CA60339C086733AB1B.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/upside-down--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5055, 'upstage', NULL, '[adv. 在舞台后部地][v. 抢风头,抢戏]', 'The dancers were directed to move upstage.', '跳舞的人向舞台后部走去。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/49/99/4999712EE0EB095DE3E452A003D8CD75.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/upstage--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5056, 'upstart', NULL, '[n. 暴发户,傲慢自负之人]', 'He was a new upstart and a gentleman of the first head.', '他是个暴发户,是个新封的贵族。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/02/0d/020D0492EFAEED44AA8D07C5B9818254.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/upstart--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5057, 'upsurge', NULL, '[n. (突然的)增长][v. 增长,高涨]', 'A new upsurge of revolution has come.', '革命的新高潮来了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/dc/ff/DCFFBD1C42B42EC7AE49A524E1A5E7B9.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/upsurge--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5058, 'upswing', NULL, '[n. 上升,回升][v. 向上摆动,提高]', 'This policy led to an upswing in the party\'s popularity.', '这一政策使该党深得人心。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/22/ee/22EE6589EF0FC730874C41F28636FF78.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/upswing--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5059, 'urbane', NULL, '[adj. 温文尔雅的,懂礼的]', 'We expect educated people to be urbane people.', '我们都以为受过教育的人都是温文尔雅的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/04/f3/04F3FD2B624F1683DBBF50A1268DF8B1.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/urbane--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5060, 'urbanism', NULL, '[n. 都市生活方式,城市化]', 'The new urbanism theory is the reform for urban development.', '新城市主义理论的提出是城市发展的思想变革。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b2/fd/B2FD54F7D99A72D2FAA954E53EB27318.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/urbanism--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5061, 'urbanite', NULL, '[n. 都市人]', 'More and more urbanite  begin to pay attention to mental health.', '越来越多的都市人,开始注重心理健康。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/09/f3/09F3FE3B48EACEF4A05D92602F6B6055.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/urbanite--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5062, 'usable', NULL, '[adj. 可用的,适用的]', 'Giftwrap can be a usable part of the gift.', '礼物包装是礼物中可利用的一部分。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c5/f8/C5F8E1698F4C067638999F392EF2F52B.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/usable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5063, 'utensil', NULL, '[n. 器具,用具]', 'This store sells cooking utensils.', '这商店出售炊具。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ec/c8/ECC846A35A6C5A20CE32FAEAFF63C3E6.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/utensil--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5064, 'utilise', NULL, '[vt. 利用]', 'The cook will utilise the leftover ham bone to make soup. ', '厨师要用吃剩的猪腿骨做汤. ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/89/34/8934E319FD3EFA4A0B66A29EFC0DBB87.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/utilise--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5065, 'utilitarian', NULL, '[adj. 功利的,实用的][n. 功利主义者]', 'In the selection, he attempts to clarify the utilitarian standard.', '在这段选文中,他试图对功利标准作一清楚表述。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f7/ea/F7EACA08EF097F2A9889BA2094C7810C.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/utilitarian--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5066, 'utopia', NULL, '[n. 理想国,乌托邦]', 'When Vida came in to tea Carol sketched her Utopia.', '维达来喝茶的时候,卡萝尔就情不自禁把她的乌托邦扼要地说了一下。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/28/ab/28AB11E1AF1BAF67F6E64BB16A6A7701.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/utopia--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5067, 'utopian', NULL, '[adj. 乌托邦式的,梦想的][n. 空想家]', 'His was a utopian vision of nature in its purest form.', '他对大自然怀有一种极为纯粹的乌托邦式看法。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d5/e1/D5E149715770724E52549457DCB0F860.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/utopian--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5068, 'utterance', NULL, '[n. 说话,发表,说话的方式]', 'His utterance annoyed me instead of what he said.', '惹恼我的不是他说什么而是他说话的方式。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/82/7d/827D5F9D74816478DB6B2365EE463C20.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/utterance--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5069, 'vacate', NULL, '[v. 空出,让出]', 'Hotel guests are requested to vacate their rooms by twelve noon. ', '旅馆的房客按规定要在中午十二点之前退房。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/42/f0/42F044A2CE94E4C2C0EA30946EB3FD4D.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vacate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5070, 'vacillate', NULL, '[v. 游移不定,踌躇,犹豫]', 'She vacillated between hope and fear.', '她时而抱有希望,时而心存恐惧。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c2/5e/C25E8A880B95C7D667BC8507A3602363.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vacillate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5071, 'vacuous', NULL, '[adj. 空的,发呆的,心灵空虚的]', 'The lyrics are completely vacuous.', '歌词毫无内涵。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a8/93/A893A38E3FEDAD00C2AD2F3CEBDFCB19.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vacuous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5072, 'vagary', NULL, '[n. 奇特,好奇,奇特行为,变幻莫测]', 'The vagaries of the weather.', '天气的变幻无常。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/33/4f/334FFD919F85EB53B46B0845BA7BD253.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vagary--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5073, 'vagrancy', NULL, '[n. 流浪罪,漂泊,神思恍惚]', 'He was convicted of drunkenness and vagrancy.', '他因醉酒和流浪罪被判刑。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b0/55/B05559A37BF2C5C1197A79BD46AAD5C6.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vagrancy--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5074, 'vagrant', NULL, '[n. 流浪汉,漂泊者,无赖]', 'The vagrant had to beg for money.', '那个流浪汉不得不乞求钱财。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/49/cc/49CCB51AF2D75E10CA7A6D8D9FAE2829.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vagrant--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5075, 'vagueness', NULL, '[n. 模糊,含糊]', 'Their report is on the vagueness of future economic prospects.', '他们的报告针对未来经济前景方面的含糊不清之处作了阐述。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7d/f3/7DF3CCD1361D5C6159FDD20C69CE2617.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vagueness--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5076, 'vainglorious', NULL, '[adj. 非常自负的,虚荣心强的]', 'She is a vainglorious woman. ', '她是个爱虚荣的女性。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/57/c1/57C165F492718FBD17EB36F07221CB68.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vainglorious--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5077, 'vainglory', NULL, '[n. 极度自负,虚荣]', 'This is the truth by which vainglory is put to flight.', '这是一项真理,它能除去人贪慕虚荣的心。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7c/13/7C13F441B4D3365FEE737DDA4E6517BE.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vainglory--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5078, 'valediction', NULL, '[n. 告别,告别演说,告别辞]', 'I came here just for a valediction.', '我来仅仅是向你告别。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/29/25/292522175E1BDED4FC581B236CF40C12.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/valediction--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5079, 'valedictory', NULL, '[adj. 告别的][n. 告别词,告别演说]', 'Children would write valedictory speeches about KP2.', '孩子们将会为KP2写段告别词。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/eb/01/EB01B8E8FC95FDB09C910F9C37F57557.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/valedictory--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5080, 'valiant', NULL, '[adj. 勇敢的,英勇的][n. 勇士]', 'Let\'s hail to the valiant victors.', '让我们向勇敢的胜利者致敬！', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0f/f0/0FF0E3EC46F3AABA9D9550BAD6A0F4D5.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/valiant--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5081, 'valorous', NULL, '[adj. 勇敢的,勇武的,刚勇的]', 'Valorous as a Hector, he knows no danger.', '勇武如赫克托,他从不知危险是何物。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b2/55/B2553A23A0EA16A29FDB2AD3D29E9163.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/valorous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5082, 'vandalism', NULL, '[n. 故意破坏公物的行为]', 'Vandalism used to be a rare occurrence here.', '过去这里很少发生故意破坏公物的事。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/61/ad/61ADEAEE8BF4B133B8C0E84C4A259E2F.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vandalism--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5083, 'vandalize', NULL, '[vt. 肆意破坏]', 'The walls had been horribly vandalized with spray paint.', '墙壁被用喷漆喷得一塌糊涂。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ee/f7/EEF741C29E056D57F276368477AD15AB.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vandalize--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5084, 'vanilla', NULL, '[n. 香草]', 'He used to love milk flavoured with vanilla.', '他过去常爱喝带香草味的牛奶。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4b/bd/4BBD409CBC284AB8701BF10622C74908.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vanilla--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5085, 'vanquish', NULL, '[v. 征服,克服,击败]', 'It is no honor for an eagle to vanquish a dove.', '老鹰胜鸽,不足为荣。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/df/b5/DFB5FC51B8BC2B96B5A129EE2679004C.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vanquish--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5086, 'vantage', NULL, '[n. 优势,有利情况]', 'The famous athlete had no vantage to win the game.', '那个有名的运动员已经没有优势赢得那场比赛了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/5e/ee/5EEE4367F00EB912AE478F197F9DFE84.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vantage--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5087, 'vapid', NULL, '[adj. 索然无味的]', 'He did the same thing year by year and found life vapid.', '他每年做着同样的事,觉得生活索然无味。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/59/6e/596E2F068549C32AFA85870FB5D34ED1.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vapid--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5088, 'vaporization', NULL, '[n. 蒸发]', 'A similar definition holds good for latent heat of vaporization. ', '气化潜热的定义与此雷同. ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/33/be/33BE4760995D1A1CA6237996BA8A4ECA.mp3', 0, 12, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vaporization--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5089, 'vaporize', NULL, '[v. 使...蒸发]', 'The heat from the water is used to vaporize a low-boiling liquid.', '从水中得到的热用来使一种低沸点的液体蒸发。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/40/7c/407C2C272F534DCE158166B7C541B017.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vaporize--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5090, 'vaporous', NULL, '[adj. 空想的,蒸汽的,雾状的,易挥发的]', 'Exhaust vaporous wastes through a pipe.', '通过管道把废蒸汽排空。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b5/0c/B50CCC31136C17CC2DF9BE1506073E08.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vaporous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5091, 'variability', NULL, '[n. 易变,变化性,变异性]', 'The answer is that diversification reduces variability.', '答案就是分散降低了变异性。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ea/06/EA0692460EEA8C9FAABEA6107B52D9FD.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/variability--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5092, 'variance', NULL, '[n. 不一致,变化,数学方差]', 'We are at variance about our lodger.', '我们在对待房客的问题上意见不一。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/67/20/672013B15B736D8D68BDF78BD57368C9.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/variance--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5093, 'variegate', NULL, '[vt.  使...多样化, 弄成杂色]', 'Variegate with different colors, shades, or patterns.', '用不同的颜色阴影或图案使多样化。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/95/d9/95D9BFD36F0786732A25CA02F671BFDE.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/variegate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5094, 'varnish', NULL, '[n. 油漆,指甲油][v. 粉饰,涂油漆于]', 'The varnish was made to imitate wood grain.', '油漆刷出来像木纹。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/97/a9/97A9A9D91DE7EF9D46D00A6CEA83EA93.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/varnish--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5095, 'vastness', NULL, '[n. 巨大,广阔,广袤]', 'The world puts off its mask of vastness to its lover.', '世界对着它的爱人,把它浩翰的面具揭下了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/a2/49/A249FF7DF979BF3F95A7DC4CAEF7D6AA.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vastness--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5096, 'vault', NULL, '[n. 地窖,库房,墓穴,撑杆跳][vt. 撑竿跳]', 'He was buried in the family vault.', '他被安葬在家庭的墓穴里。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/57/d5/57D536E982CD988D453084432573099F.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vault--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5097, 'vaulted', NULL, '[adj. 拱形的,圆顶的]', 'He ran to the door and vaulted into the saddle.', '他跑到门口,飞身跃上马背。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/25/f8/25F8ECF66C5DFBD54054589384BAE70D.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vaulted--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5098, 'vaunting', NULL, '[adj. 吹嘘的,骄慢的]', 'She is vaunting her successes to all of us.', '她正向大家炫耀她的成就。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/5e/81/5E81B09489CCCFA41B3A41DDA13F9CCE.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vaunting--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5099, 'veer', NULL, '[vt. 转向,改变][n. 转向]', 'The wind has veered round to the north recently.', '近日风向已转北了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/18/8b/188B39A679F35DCB8FCB8FAD46B2451F.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/veer--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5100, 'vegetate', NULL, '[v. 生长,无所事事,使像植物般生长]', 'This kind of fruit vegetates in many areas.', '这种水果香甜可口,生长在世界上许多地方。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d6/41/D641FB30D30FBAA89FB90185BCEBC2B1.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vegetate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5101, 'vehement', NULL, '[adj. 感情强烈的,猛烈的]', 'They expressed a vehement protest.', '他们表达了强烈的抗议。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9c/07/9C07821D70E6C11E254F07D8F630D310.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vehement--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5102, 'veining', NULL, '[n. 静脉文理,脉纹的排列]', 'There is a vein of melancholy in his character.', '他的性格中有少许忧郁的气质。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/cc/f4/CCF430D0564ACC612DB4480EF77F85A1.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/veining--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5103, 'velvety', NULL, '[adj. 像天鹅绒般柔软光滑的,醇和的]', 'Her skin was admired for its velvety softness.', '她的皮肤如天鹅绒般柔软, 令人赞叹。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/95/43/95437E43D91D74B45FFA9E88B486E58D.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/velvety--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5104, 'venal', NULL, '[adj. 受贿的,贪赃枉法的]', 'The venal policeman accepted the bribe.', '贪污的警察收受贿赂。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/77/c8/77C8A99BAE1B3DD978A05A9C3FD3EFF3.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/venal--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5105, 'vendetta', NULL, '[n. 仇杀,相互复仇]', 'She conducted a personal vendetta against me.', '她对我有宿仇。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/1b/1a/1B1A24921E421BC4692C200667AB34FD.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vendetta--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5106, 'venerable', NULL, '[adj. 值得尊敬的,庄严的]', 'We all listened to the venerable scholar with awe.', '我们都怀着敬畏之心倾听着这位德高望重的学者的讲话。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c7/fc/C7FC68CC734E7B81DAD57AEE8E72E577.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/venerable--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5107, 'venerate', NULL, '[v. 尊敬,尊崇,崇拜]', 'Most Italians venerate the name of Dante. ', '大多数意大利人崇拜但丁的名字。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/bf/fc/BFFCF1C14828BE7D6399921266A3C7F3.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/venerate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5108, 'veneration', NULL, '[n. 崇敬]', 'The relics were objects of veneration/were held in veneration.', '这些遗物是备受崇敬之物。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9e/30/9E30CC6E818CF88CF524646983C3CA08.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/veneration--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5109, 'vengeance', NULL, '[n. 报复,报仇]', 'But the vengeance of Juno was not yet satiated.', '但是朱诺报复之心不死。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/df/96/DF961FA2369FDEC5973EA2D60867D63F.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vengeance--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5110, 'vengeful', NULL, '[adj. 复仇心重的,报复的]', 'The whole episode made me vengeful.', '整个事件使我一心想复仇。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ff/c5/FFC529B621C1F4137CA0DC406867C542.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vengeful--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5111, 'venial', NULL, '[adj. 可原谅的,(错误等)轻微的]', 'The venial sins are relatively minor and more easily forgiven.', '可宽恕的罪都是比较微小且易被原谅的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/bb/7b/BB7B69B478A681FBEABC9819C8F7C9D6.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/venial--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5112, 'venom', NULL, '[n. 毒液,恶意]', 'Nothing is more fatal than a viper\'s venom.', '没有什么比响尾蛇的毒液还要致命。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/45/76/4576C333A29396EC282D0F05101698AF.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/venom--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5113, 'venomous', NULL, '[adj. 恶意的,有毒的]', 'His venomous look terrified the little girl.', '他恶毒的表情吓坏了这个小女孩。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/95/40/95408292F7A183BD43B1F4DB850C8FDE.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/venomous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5114, 'ventriloquist', NULL, '[n. 作腹语者,口技表演者]', 'To practice your ventriloquist voice, keep your lips motionless.', '要练习以腹语术发声,你得保持双唇不动。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0a/ec/0AECE012C2BDB18DB75F6FF300BA7EB1.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/ventriloquist--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5115, 'venturesome', NULL, '[adj. 冒险的,不顾一切的]', 'Bungee jumping is a sort of venturesome sports.', '高空跳伞是一项冒险的运动。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/1d/96/1D96DCC2586A3D1E8C8A7147BFDAC854.mp3', 0, 11, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/venturesome--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5116, 'veracious', NULL, '[adj. 诚实的,精确的]', 'Miss Stackpole was a strictly veracious reporter. ', '斯坦克波尔小姐是一丝不苟、实事求是的记者. ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b0/8b/B08B111013B60CDCBB5C05C32B65D91F.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/veracious--_gb_1.mp3');
