INSERT INTO `MASTER` VALUES (5165, 'viral', NULL, '[adj. 病毒的,病毒引起的]', 'A viral illness left her barely able to walk.', '一场病毒引起的疾病使她走路都十分困难。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/1d/db/1DDB0DDAE0F0165F61E9AAA7ABD63DAF.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/viral--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5166, 'virile', NULL, '[adj. 有男子气概的,精力充沛的]', 'She is both virile and feminine.', '她既有男子的气概,又有女性的娇柔。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/b9/89/B989058BC6F7ECA04171FFE98951BF05.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/virile--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5167, 'virility', NULL, '[n. 男子气概,生殖力,刚强有力,活力]', 'There was nobody doubting his virility.', '没有人质疑他的生殖力。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/64/d9/64D9D9F5D96071109C9E178943E5CF81.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/virility--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5168, 'virtuosity', NULL, '[n. 精湛技巧,演奏技巧,艺术爱好]', 'His virtuosity on a banjo won consistent applause. ', '他弹奏班卓琴的技艺受到了异口同声的称赞。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/77/be/77BE4BEA84A5D68640E321C468F667F3.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/virtuosity--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5169, 'virtuoso', NULL, '[n. 艺术能手,演艺精湛的人]', 'In the world of car salesmen, Golomb is a virtuoso.', '在同行当中,格鲁姆是一位汽车销售艺术家。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/04/47/0447C1A51D47BCA4BC48789066F387D7.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/virtuoso--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5170, 'virulence', NULL, '[n. 有毒,毒性,致病性,恶意]', 'Animal experiment showed it had virulence to mice.', '动物试验结果表明,该菌对小白鼠有致病力。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8d/69/8D691CECD84E8867EF2BB7B065E0523C.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/virulence--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5171, 'virulent', NULL, '[adj. 有毒的,有恶意的,充满敌意的]', 'This virus was both lethal and virulent.', '这种病毒不但致死率高,而且毒性极强。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d2/cb/D2CBFC070A674E975524776D832C2A82.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/virulent--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5172, 'visceral', NULL, '[adj. 发自肺腑的,内脏的]', 'There are visceral and parietal peritonea.', '有内脏与腔壁的腹膜。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/10/0b/100B2200338ECCA28C985A228EC0EFF3.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/visceral--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5173, 'viscid', NULL, '[adj. 粘质的]', 'Honey is a viscid fluid produced by bees.', '蜂蜜是一种蜜蜂产生的粘液。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/9d/97/9D97B71F68F7636E52D6C4692F6A6F09.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/viscid--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5174, 'viscosity', NULL, '[n. 粘度,粘性]', 'Apply to fill various kinds of viscosity.', '适应各种粘度液体罐装。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/46/55/4655429BF9547E66CE330E52ED95EBEE.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/viscosity--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5175, 'viscous', NULL, '[adj. 粘的,粘性的]', 'The mud is too viscous, you must have all the agitators run.', '泥浆太稠,你们得让所有的搅拌机都开着。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/e3/a9/E3A9A01F56113713CF762CEB3179AD56.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/viscous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5176, 'vista', NULL, '[n. 街景,展望,回想]', 'The days stretch out in an endless vista.', '时日在无穷的展望中延展着。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/6b/d7/6BD7FA3F2FE0D746E2EC8E8C5CA028D2.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vista--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5177, 'vitalism', NULL, '[n. 活力论,生机说]', 'They are still a lot of people believe in vitalism.', '仍有许多人信奉活机论。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f2/22/F22203063E0F173DF76E8FCB0186DCFC.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vitalism--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5178, 'vitalist', NULL, '[n. 活力论者]', 'A vitalist refers to someone who believes in vitalism.', '活力论者是指相信活力论的人。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/28/85/28853478C3525DE54B96921460B0C2D5.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vitalist--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5179, 'vitalize', NULL, '[vt.  给与...生命力, 激发, 使有活力]', 'We hope the reform plan can vitalize our economy. ', '我们希望改革方案能激活我们的经济发展。 ', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/7b/1a/7B1AFBC7985AAD4FBAC0DA1C25436FBA.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vitalize--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5180, 'vitiate', NULL, '[v. 使败坏,损害,使失效]', 'This may vitiate a literal translation.', '这就会损害直译的价值。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/ee/bd/EEBDAFA20F6A0AA2B981EDDE6DE3D8C4.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vitiate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5181, 'vitriolic', NULL, '[adj. 硫酸的,刻薄的,挖苦的]', 'The newspaper launched a vitriolic attack on the president.', '这家报纸对总统发起了一场恶意的攻击。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f8/cd/F8CD216CB79DB37632D2F879BD12FB99.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vitriolic--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5182, 'vituperate', NULL, '[v. 痛斥,辱骂]', 'He vituperated her in a strong language.', '他用强硬的语言辱骂她。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/79/c5/79C540BFA842DFE378FCD91E67F43C41.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vituperate--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5183, 'vivacious', NULL, '[adj. 活泼的]', 'She is an artless, vivacious girl.', '她是一个天真活泼的女孩。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/33/07/330753F83C50763D8981AC9B138D5F19.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vivacious--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5184, 'volcanologist', NULL, '[n. 火山学家]', 'That volcanologist was busying with memoir after his retirement. ', '自从退休以后,那位火山学家一直忙于撰写回忆录。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/64/54/6454313B44C4ABB115506B2139342C94.mp3', 0, 13, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/volcanologist--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5185, 'volition', NULL, '[n. 决定,自主,意志力]', 'She offered to help us of her own volition.', '她自愿提出要帮助我们。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/28/a7/28A7CB3B1858C803D3E24BAAFE9E14A5.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/volition--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5186, 'volley', NULL, '[n. 齐发,齐射][v. 齐射,迸发,截击]', 'He let out a volley of oaths.', '他像发连珠炮似地破口大骂。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/0b/67/0B6709B94BD731D26DCF13A95C1DA509.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/volley--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5187, 'voluble', NULL, '[adj. 健谈的,口若悬河的]', 'The new comer in our company is voluble.', '我们公司新来的同事很健谈。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/69/7d/697D0E4BF570E03850FB9E1C17E3FACC.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/voluble--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5188, 'voluptuous', NULL, '[adj. 激起性欲的,沉溺酒色的,撩人的]', 'She was a voluptuous creature with blonde hair.', '她是个性感十足的金发尤物。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/34/68/3468CFF4DB196B58835D137D8ABADAED.mp3', 0, 10, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/voluptuous--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5189, 'vomit', NULL, '[v. 吐出,呕吐,喷出][n. 呕吐,呕吐物]', 'He vomited up all he had eaten.', '他把吃下的东西全吐了出来。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/14/a7/14A73890A00D5564DB65211261D926B9.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vomit--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5190, 'voracious', NULL, '[adj. 贪吃的,求知欲强的]', 'After swimming, I find that I have a voracious appetite.', '游完泳后,我发现我的食欲大增。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/bb/37/BB37541F77E0266AAF3733C221E4CC83.mp3', 0, 9, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/voracious--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5191, 'voracity', NULL, '[n. 贪食,贪婪]', 'Hunt and voracity are unnatural to him.', '捕杀动物与贪食不是人类的本性。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/73/ba/73BA73F893FDE5C969D378278C61852D.mp3', 0, 8, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/voracity--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5192, 'votary', NULL, '[n. 崇拜者,热心支持者,信徒]', 'Then at last the votary of venus found words to thank the goddess.', '这个时候,维纳斯的信徒才想起来向维纳斯女神感谢了一番。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/74/a6/74A6B93F492EE961DFE666D5FEEDC822.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/votary--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5193, 'vouch', NULL, '[v. 担保,保证,证明,确定]', 'Let him in, I\'ll vouch for the man.', '让这人进来,我愿替他担保。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/23/a5/23A5AC763F289BFB6CC8FEEE8132329C.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vouch--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5194, 'voyeur', NULL, '[n. 窥淫狂者,窥隐私者]', 'A voyeur was seen lurking around the girl\'s dormitory.', '有人看到一位偷窥狂躲藏在女生宿舍附近。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/4f/17/4F17B645BC77D630836ABFA9258043E7.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/voyeur--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5195, 'vying', NULL, '[adj. 竞争的]', 'Four rescue plans are vying to save the zoo.', '4个拯救动物园的方案正争得不可开交。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/62/71/627133B2083D4E75E4F90661386CAD11.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/vying--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5196, 'wacky', NULL, '[adj. (行为等)古怪的,愚蠢的]', 'Physicists hope to find a new astronomy and test some wacky ideas.', '物理学家们试图开展新的天文学来检测一些新奇古怪的想法。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/c4/d8/C4D8DBCA88A81A5DB4617BE59A2FAD86.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/wacky--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5197, 'waddle', NULL, '[v. 蹒跚而行][n. 摇摆的步态]', 'A short plump woman came waddling along the pavement.', '有个矮胖女子一摇一摆地沿人行道走来。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/56/f5/56F59FF4C310E30C8A44220994AECE0D.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/waddle--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5198, 'wade', NULL, '[v. 跋涉,涉水][n. 跋涉]', 'I wade down a shallow pebbly stream daily.', '我每天沿着一条浅的有卵石的小溪跋涉。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/93/ba/93BAF9C117F3F67FF7A2CB013934B356.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/wade--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5199, 'waggish', NULL, '[adj. 诙谐的,滑稽的]', 'The house had been facetiously named by some waggish officer.', '这房子是由某个机智幽默的军官命名的。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/d1/a6/D1A64300577060855E15B1FA899EB379.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/waggish--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5200, 'walkout', NULL, '[n. 罢工,中途离开]', 'Cabin crews plan a walkout over pay and sick leave.', '全部机组乘务人员计划了一项针对薪资的罢工并集体请病假。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/30/69/3069B1FD84E15D968C050DCA2F8F0653.mp3', 0, 7, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/walkout--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5301, 'zenith', NULL, '[n. 顶点,天顶,全盛]', 'Our spirits rose to their zenith after the victory.', '胜利之后我们的士气高昂到极点。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/f5/d6/F5D6D8AA53539B5DFBB3BFBA1371ADC6.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/zenith--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5302, 'zephyr', NULL, '[n. 西风,和风,徐风]', 'Instead, zephyr, the most gentle of winds, carried her away.', '相反,风向中最温和的西风,将她带走了。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/5f/92/5F92DC3AFA9BE3ADE5F8AEBCE5DBB194.mp3', 0, 6, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/zephyr--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5303, 'zest', NULL, '[n. 热情,风味,(橙子、柠檬等的)皮]', 'He dived into his new job with great zest.', '他充满热情地投入了新的工作。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/8e/7f/8E7F205D4A22EF99000BBB59F7D2B7A7.mp3', 0, 4, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/zest--_gb_1.mp3');
INSERT INTO `MASTER` VALUES (5304, 'zesty', NULL, '[adj. 兴致很高的,有滋味的]', 'Eating anywhere in China can be such zesty.', '中国任何地方的佳肴都会让你大饱口福。', 'https://dictionary.blob.core.chinacloudapi.cn/media/audio/tom/56/4f/564F74872A69114032D4B3B137FC20B9.mp3', 0, 5, 0, 0, 'https://ssl.gstatic.com/dictionary/static/sounds/oxford/zesty--_gb_1.mp3');
